INSERT INTO `DistReport_response` VALUES (738,'2','The bid was opened and the host clubs were announced as per the schedule. \nThe host clubs and the district core were in contact with the PRESTO 2 team throughout the event.','-','2020-10-05 14:11:22.184351','09-2020-2',738,'0'),(739,'2','Club Presidents/representatives contact me prior to the installation. As per the availability of the DRR/DDRR , date is confirmed with the clubs. \nAgenda is asked 3 days prior.','-','2020-10-05 14:13:43.080310','09-2020-2',739,'0'),(740,'2','The agenda was sent by the Convenor Rtr. Shubham Savale to all the registrants, as asked by the District Core team.','-','2020-10-05 14:14:36.300231','09-2020-2',740,'0'),(741,'2','The bid for the Talk 3.0 was announced on Mon, Sep 14, at 8:00 AM as the District Sports Meet was called off due to pandemic. \n','-','2020-10-05 14:19:20.016424','09-2020-2',741,'0'),(742,'2','The bid for the Talk 3.0 was announced on Mon, Sep 14, at 8:00 AM as the District Sports Meet was called off due to pandemic. \nThis was discussed with the CORE prior and the same was conveyed in the Council Meeting.','-','2020-10-05 14:19:54.956427','09-2020-2',742,'0'),(743,'2','Was present for both the events throughout. ','-','2020-10-05 14:20:15.484702','09-2020-2',743,'0'),(744,'2','Attended installation of RC Panvel. ','-','2020-10-05 14:21:03.700543','09-2020-2',744,'0'),(745,'2','Report for the month of August has sent and the report for the month of September has been scheduled on 6th October 2020, 2 PM','-','2020-10-05 16:36:26.191485','09-2020-3',745,'0'),(746,'2','Newsletter for the month of August was sent and the Newsletter for the month of September has been scheduled on 6th October 2020, 2 PM','-','2020-10-05 16:36:54.913684','09-2020-3',746,'0'),(747,'2','The Presidential kit has been sent to all new presidents. ( 29 September 2020)','-','2020-10-05 16:38:00.504192','09-2020-3',747,'0'),(748,'2','Minutes for DFM were sent on 28th August to all President and Council','-','2020-10-05 16:38:55.892866','09-2020-3',748,'0'),(749,'2','Had personally called some secretaries who were added late to the group to join the training and regular PR message were being sent to the group.','-','2020-10-05 16:39:54.640798','09-2020-3',749,'0'),(750,'2','Was present for both DFM and Presto 2','-','2020-10-05 16:40:24.084939','09-2020-3',750,'0'),(751,'2','Have attended maximum installation in the month of August and September.\nInstallation attended in the month of September \nRC Panvel\nRC of Laxmi College of Optometry \nRC of RSCOE\n','-','2020-10-05 16:41:48.247898','09-2020-3',751,'0'),(752,'2','More than 50% of the clubs have completed their orientations till date. \nFollowing clubs have completed their orientation in August and September, 2020:\n1. RC SAOE & RC MODERN GK : 1st August\n2. RC UBS : 2nd August\n3. RC Alumni : 8th August\n4. RC DYPIMS, RC DPU, RC Indira College, RCPKMM & RC AIMS : 9th August\n5. RC Vishwaniketan College : 15th August\n6. RCDYPACS and RCSCOE : 5th September\n7. RC Deccan Gymkhana : 13th September\n8. RC Modern AC&S : 19th September\n9. Rotaract Club of Marathwada Engineering College : 23rd September (I could not attend this orientation due to some personal commitments.)\n10. New Club (MES Garware BBA College) : 26th September (I could not attend this orientation due to some personal commitments.)\n11. Rotaract Club of Pune : 27th September\n\nTotal 57 clubs from RID 3131 have completed their orientation till date. ','-','2020-10-03 08:08:31.408027','09-2020-5',752,'0'),(753,'2','I have been supporting and guiding all the clubs as and when they are approaching me. \nI had also contacted a couple of Presidents regarding the reviews about District functioning and have discussed the same withe the DRR before COPS meeting.   ','-','2020-10-02 16:47:11.252764','09-2020-5',753,'0'),(754,'2','I am in touch with Rtr. Vijay and we are planning to initiate a few things for membership development. ','-','2020-10-02 16:50:39.867819','09-2020-5',754,'0'),(755,'2','I attended PRESTO 2.  ','-','2020-10-02 16:51:13.621832','09-2020-5',755,'0'),(756,'0','Unfortunately I couldn\'t attend any installation. Will try to attend a few in the upcoming month. ','-','2020-10-02 16:52:53.251968','09-2020-5',756,'0'),(757,'2','Reporting of Secretaries is done for July & August.\nReport has been sent to DRR/DDRR for both the months.','-','2020-10-05 14:26:20.552730','09-2020-6',757,'0'),(758,'2','1. Gave training (during UpSurge District Training seminar) to Secretaries on how to fill up the form of secretarial reporting and why secretarial reporting is important.\n2. Recorded the Secretarial Reporting Portal Demo and email has been sent to all the secretaries.\n3. Solved all  the queries/doubts of secretaries \n4. Email with unique username & password have been sent to New club Secretaries.','-','2020-10-05 14:26:31.576867','09-2020-6',758,'0'),(759,'2','1. Attended PRESTO-2\n2. Could not attend DFM due to personal problems.','https://drive.google.com/drive/folders/1GVSZsiZixf0Y2zyzz2nP3116bJVlseE_?usp=sharing','2020-10-05 14:26:42.580372','09-2020-6',759,'0'),(760,'2',' Attended installations of RC VIIT & RC Amanora Youngistan','https://drive.google.com/drive/folders/1lw0LwRLEMqDr90m3F1M1ucTqYSxibTR-?usp=sharing','2020-10-05 14:26:45.572778','09-2020-6',760,'0'),(761,'2','Yes, the Task is Partially Completed \nThe Excel Sheet attached in the Drive contains List of the clubs of RI \n\nThe ones marked in Green are Active in all aspects like their Presidents are also updated on RI\n\nThe ones in orange are having issues of updating their Presidents on RI (I\'m working on same)\n\nThe ones in Red are not having their team even Presidents are not elected for RIY 2020-21\n\nThe ones with no color , are total inactive\n\nAlso, the link contains excel workbooks maintained and updated by ZRs, in respect of the Status of Presidents on RI of their respective zonal Clubs.\n','https://drive.google.com/fo