basis. References for HDFC Bank, Kotak Bank & Bank of Baroda have been shared with the respective groups. The queries are generally solved on via phone calls and therefore no screenshots have been maintained. Word of mouth can be taken from Rtr. Kaizen, RCPC Pioneers, Rtr. Sanjana Singh, RC of Amnora Youngistand, Rtr. Vidisha Naik, RCGY, Rtr, Trashna, RCGY ','-','2020-10-05 13:21:33.211642','09-2020-36',894,'0'),(895,'2','The Clubs are provided with the details of sponsoring parties depending on the type of events to be done. The clubs are then guided on how to pitch the sponsorer, documentation to be maintained, the balance of interest to be followed, email negotiations etc.\nDetails of sponsors were have been shared with RCPC Pioneers and RCGY till now.','-','2020-10-05 13:24:54.027301','09-2020-36',895,'0'),(896,'2','The District Treasurer is helped with all the finance-related tasks. \nA draft format of Projected Annual Budget was prepared and provided to all the clubs.\nA list of documents has been prepared for the application of PAN, with an alternative option for unavailability of any. \nA tie-up has been done with the agents of Kotak Bank, HDFC Bank and Bank of India to facilitate the clubs in the opening of bank accounts with minimum documentation and speedier execution.\nGuidance regarding Reimbursement Form is provided on as and when required basis.  ','-','2020-10-05 13:28:45.520450','09-2020-36',896,'0'),(897,'2','The entire event of EDFM was attended by myself.\nThe event Presto was attended completely for the first day and partially for the second day since I had my flight. \nThe event UPSURGe was attended by myself completely.','-','2020-10-05 13:30:32.695301','09-2020-36',897,'0'),(898,'2','Virtual Installations are being attended as much as possible. Unfortunately, no record has been kept for the installations attended.\nThe last installation attended was of RC of Rajarshi Sahu','-','2020-10-05 13:33:14.150157','09-2020-36',898,'0'),(899,'2','	An official group was formed at the starting of RIY 2020-2021 and the link was shared with respective Presidents.\n	With the help of Zonal Representatives, certain reminders were given to the President to verify whether the respective SAA is added in the group.\n	Database of the BODs(for the SAA counterpart) maintained by the District Club Advisor, was checked and utilized effectively.\n	Currently there are 66 SAAs added in the group (excluding District SAA).\n','-','2020-10-02 09:44:58.229770','09-2020-37',899,'0'),(900,'2','	Working with ZR\'s to get a response from remaining SAA\'s regarding assets details\n	A rough format of assets book was shown and the importance of the same was discussed. Minutes Book was discussed too.\n	A google form was shared with all the SAAs to maintain a proper database of all the assets they have in the club, which is filled by 55 SAAs.\n	Contacts of all the vendors(Better Services, Choice Prints, and Tej Brothers) were shared and communicated with vendors too to help them get it available. Contact of Rtr. Meet Shah was shared for queries regarding printing new minutes book. \n','-','2020-10-02 09:45:01.936217','09-2020-37',900,'0'),(901,'2','1. Two new SAA\'s were added to the group.\n2. Discussed the assets which are required over a telephonic conversation.\n2. Both SAA\'s have purchased the assets and they are with the respective Presidents.\n','-','2020-10-02 09:45:05.052710','09-2020-37',901,'0'),(902,'2','	All the SAA\'s were asked to send a soft copy of the Assets Book and individual suggestions and feedback was given.\n	A demonstration was shown in the meeting and pdf of the same was shared in the official WhatsApp Group.\n','-','2020-10-02 09:45:07.988271','09-2020-37',902,'0'),(903,'2','In total more than 180 hours were spent on this event.\nPRE-ERYLA: We had approximately 11 meetings with Rotary E-Ryla committee along with Rotaract committee made by us of 17 Rotaractors from 14 Rotaract Clubs. The Rotaract Committee were:- Core team, Programme Committee, Registration Committee, Promotion Committee, Activity Committee, Faculty Coordination Team, Technical Team.\nBoth of us played a major role in guiding as well as motivating our Rotaractors. We handled all the social media handles of Rotary District 3131 and Rtr Sanjana made the LinkedIn profile of them. More than 800 registrations were brought by our Rotaractors. Each and every flyer and messages were made by our Rotaractors and were uploaded time to time.\nDuring E-RYLA: 2 of our committee rotaractors handled technical part and 5 of them were leaders of our whatsapp groups. We included 6 council members to be the moderators and one council member was the leader of whatsapp group. The activities were planned by Rtr Sanjana & Rtr Karishma along with our Activity team. And in one of the activities 3 council members helped us in its planning and execution. Time to time coordination was done with the rotarians and participants. Also, we had two more meetings with the rotarains where the council member team also joined. We handled the score sheet and decided the winners in consent of the moderators. Also during the zoom sessions, Rtr. Karishma and Rtr. Sanjana Introduced two speakers. Rtr. Alfiya and Rtr. Rutuja gave vote of thanks for two sessions. Rtr. Aaryan prepared the quizzes and kept the track of screenshots of each and every event along with Rtr. Dilip Sonawane. DRR Shraddha was addressed the team on the inauguration day.\nPost E-RYLA\n We had our meeting with our Rotarians and Rotaractors to acknowledge and appreciate the work of everyone.\n  We had a meeting with the DRR and DDRR with our Rotaract Committee to recognise the work and appreciate the learnings. \n  The Rotarians are now working on participation certificate and have given the committee the certificate of participants only. \n  The clubs of the Rotaract Committees have been recognised by Rotaract District 3131 on Oct 5, 2020.\nRotaractors Worked in the committees and their club names:-\n1. Core team\n  Rtr. Sanjana Singh - Rotaract Club of Amanora Youngistan (District E-Ryla Chairperson)\n  Rtr. Karishma Awari - Rotaract Club of Pune Shaniwarwada (District Rotary Rotaract Relationship Officer)\n2. Programme Committee\n  Nirajana Mongal - Rotaract Club of Viman Nagar\n  Rtr. Gayatri Jadhav - Rotaract Club of Modern College Ganeshkhind\n  Rtr. Dilip Sonawane - Rotaract Club of Sinhagad Academy of Engineering\n3. Registration Committee\n  Rtr. Divija Marwaha - Rotaract Club of Viman Nagar\n  Rtr. Faizan Tamboli - Rotaract Club of Pune Shaniwarwada\n  Rtr. Harvardhan Kale - Rotaract Club of Modern College Ganeshkhind\n  Rtr. Pooja Navratna - Rotaract Club of Panvel Elite\n4. Activity team\n  Rtr. Sanket Nagpure - Rotaract Club of Pune Mid-East\n  Rtr. Masooma Dalal - Rotaract Club of Poona Royal\n  Rtr. Vaishnavi Saraf - Rotaract Club of Pune Camp Horizon\n5. Promotion Team\n  Aaryan Joshi - Rotaract Club of DYPIEMR\n  Masooma Dalal - Rotaract Club of Poona Royal\n  Dheeraj Mantri - Rotaract Club of Indira College\n  Vidisha Nayak - Rotaract Club of Global Youth\n6. Faculty Coordination Committee\n  Rtr. Alfiya Sayyad - Rotaract Club of Electrical MCOE Metro\n  Rtr. Rutuja Patil - Rotaract Club of MITCON\n7. Technical Team\n  Rtr. Sanket Nagpure - Rotaract Club of Pune Mid-East\n  Rtr. Harvadhan Kale - Rotaract Club of Modern College Ganeshkhind\n8. Rotaract leaders for WhatsApp Groups \n  Rtr. Gayatri\n  Rtr. Vaishnavi\n  Rtr. Harshvardhan\n  Rtr. Faizan\n  Rtr. Rutuja Patil\n9. Quiz Team \n  Rtr. Aaryan Joshi\n  Rtr. Sanjana Singh\nThe Council Team who worked:-\nModerators \n  Rtr. Sattyajeet Karale Patil\n  Rtr. Rushikesh Dale\n  Rtr. Niharika Chaturvedi\n  Rtr. Chirag Gadge\n  Rtr. Nishant\n  Rtr. Lalit Desale\nLeader \n  Rtr. Tulna Gupta\nActivity planning and execution (Devil\'s Advocate) \n  Rtr. Sayali\n  Rtr. Sattyajeet\n  Rtr. Mriti\n','https://drive.google.com/drive/u/0/folders/1jb_Br0-pFn6CLq4sOdbgH4BsolsTvfdE','2020-10-05 1