y active contribution during Presto -2.','-','2020-10-05 13:42:30.139958','09-2020-39',913,'0'),(914,'2','I have tried to attend few club installations this month and would be doing the same the next month too.','-','2020-10-05 13:42:33.075944','09-2020-39',914,'0'),(915,'2','I am sending regular updates to all rotaractors.','-','2020-10-02 20:03:05.349509','09-2020-40',915,'0'),(916,'2','I have circulated my contact to all district groups, Presidents as well council members and asked everyone to save my contact and ping me on WhatsApp so I can save their contact. Maximum people from broadcast list checks every messages on daily basis.\nI also received some appreciation messages from club members for keeping them up to date by sending all event messages.\nI am still adding rotaractors in broadcast lists, as they recently connected to Rotaract organization.\n','-','2020-10-02 20:01:06.436181','09-2020-40',916,'0'),(917,'2','I am sending Birthday details of rotaractors everyday at 12:00 AM. ','-','2020-10-02 20:01:16.241168','09-2020-40',917,'0'),(918,'2','I have attended both the events.','-','2020-10-02 20:01:21.443960','09-2020-40',918,'0'),(919,'2','1. Installation  Rc Alibag Seashore\nDate: 2nd Aug 2020\nTime: 5 PM\n\n2. Installation  Rc Amanora Youngistan\nDate: 6th Aug 2020\nTime: 7:30 PM\n\n3. Installation  Rc VIIT\nDate: 29th Aug 2020\nTime: 5 PM\n\n4. Installation  Rc AIT\nDate: 30th Aug 2020\nTime: 7 PM\n\n5. Installation  Rc Panvel\nDate: 6th Sep 2020\nTime: 11 AM\n\n6. Installation  Rotaract Club of RSCOE\nDate: 29th Sep 2020\nTime: 7 PM\n','-','2020-10-02 20:01:33.985398','09-2020-40',919,'0'),(920,'','','',NULL,'09-2020-41',920,'0'),(921,'','','',NULL,'09-2020-41',921,'0'),(922,'','','',NULL,'09-2020-41',922,'0'),(923,'2','1. Created a Small Template Design and Drafted a Message along with it. (Attached in Drive Folder)\n2. Circulated both with the help Zonal Representatives to all the Presidents and Secretaries. (Personal Broadcast as well as Zonal Groups)\n3. Personally contacted few Charter Presidents and Presidents who haven\'t appointed WRWCs.\n4. In the last reporting total 44 WRWCs were there in the group. \n5. Now \"62 WRWCs\" are there in the Whatsapp Group. (Screenshot attached in Drive)\n','https://drive.google.com/drive/folders/1QGgXwQZsRdFOIiPFgcNaq_tyrlgnbGzO?usp=sharing','2020-10-05 11:15:14.846150','09-2020-42',923,'0'),(924,'2','Task - Push Clubs to have WRWC as a BOD post in their Club.\n1. Sorted out the list of Clubs who don\'t have WRWC post in their BOD.\n2. Personally Contacted Presidents , explained about the roles and responsibilities of WRWC.\n3. Explained them the importance and benefits of having WRWC post in their BODs.\n\nTask - Help them to be active all round the year.\n1. Asked them to go and attend at least 2 sponsor Rotary Meetings per month.\n2. So that the bonding issue won\'t arise at the time of WRW Celebration.\n3. Asked them to Plan their World Rotaract Week full of activities and with smart management.\n4. Four WRWCs have already given me their whole plan out to celebrate WRW of their club. ','-','2020-10-05 11:15:17.362675','09-2020-42',924,'0'),(925,'2','1. Planned the Project which can mark the end in World Rotaract Week of RIY 2020-21.\n2. I\'m yet to prepare an Power Point Presentation of same.\n3. Left with sharing the plan with DRR Shraddha & DDRR Drishti so can not explain in the reporting.\n4. But I\'m Ready with the plan.\n','-','2020-10-05 11:20:00.302507','09-2020-42',925,'0'),(926,'2','PRESTO 2 \n- Was Present there . (Screenshot attached in the Drive link)\n\nDFM\n- Was Absent.\nHad already conveyed to District Secretary - Administration that wont be able to attend. (Screenshot attached in the Drive link)\nReasons- 1. College Test was Scheduled in that period.\n                 2.  On 16th Aug we had function at our home.\n\nAnyways this task was sent to me 21st Aug and the DFM was over till date.','https://drive.google.com/drive/folders/1uvZqL7H0AA2GYke_KFvkhUL-6MoOD8hj?usp=sharing','2020-10-05 13:20:28.963689','09-2020-42',926,'0'),(927,'2','Installations attended in First Quarter\n1. RC RSCOE\n2. RC Panvel\n3. RC Panvel Midtown\n4. RC Roha\n5. RC Electrical MCOE Metro\n6. RC VIIT\n7. RC Amanora Youngistan\n8. RC Talegaon City\n9. RC Pune Sinhgad Road\n (Screenshots are attached of few installtions Didn\'t get all )','https://drive.google.com/drive/folders/1vgIt-CZmOAOEubue8ZjpSi2zB7wI88Pv?usp=sharing','2020-10-05 13:39:59.274204','09-2020-42',927,'0'),(928,'2','Date:- 20 August 2020\n\nEryla Anvikshiki date:- 4-6th September 2020\nIn total more than 180 hours were spent on this event.\nPRE-ERYLA: We had approximately 11 meetings with Rotary E-Ryla committee along with Rotaract committee made by us of 17 Rotaractors from 14 Rotaract Clubs. The Rotaract Committee were:- Core team, Programme Committee, Registration Committee, Promotion Committee, Activity Committee, Faculty Coordination Team, Technical Team.\nBoth of us played a major role in guiding as well as motivating our Rotaractors. We handled all the social media handles of Rotary District 3131 and Rtr Sanjana made the LinkedIn profile of them. More than 800 registrations were brought by our Rotaractors. Each and every flyer and messages were made by our Rotaractors and were uploaded time to time.\nDuring E-RYLA: 2 of our committee rotaractors handled technical part and 5 of them were leaders of our whatsapp groups. We included 6 council members to be the moderators and one council member was the leader of whatsapp group. The activities were planned by Rtr Sanjana & Rtr Karishma along with our Activity team. And in one of the activities 3 council members helped us in its planning and execution. Time to time coordination was done with the rotarians and participants. Also, we had two more meetings with the rotarains where the council member team also joined. We handled the score sheet and decided the winners in consent of the moderators. Also during the zoom sessions, Rtr. Karishma and Rtr. Sanjana Introduced two speakers. Rtr. Alfiya and Rtr. Rutuja gave vote of thanks for two sessions. Rtr. Aaryan prepared the quizzes and kept the track of screenshots of each and every event along with Rtr. Dilip Sonawane. DRR Shraddha was addressed the team on the inauguration day.\nPost E-RYLA\n We had our meeting with our Rotarians and Rotaractors to acknowledge and appreciate the work of everyone.\n  We had a meeting with the DRR and DDRR with our Rotaract Committee to recognise the work and appreciate the learnings. \n  The Rotarians are now working on participation certificate and have given the committee the certificate of participants only. \n  The clubs of the Rotaract Committees have been recognised by Rotaract District 3131 on Oct 5, 2020.\n\nRotaractors Worked in the committees and their club names:-\n1. Core team\n  Rtr. Sanjana Singh - Rotaract Club of Amanora Youngistan (District E-Ryla Chairperson)\n  Rtr. Karishma Awari - Rotaract Club of Pune Shaniwarwada (District Rotary Rotaract Relationship Officer)\n2. Programme Committee\n  Nirajana Mongal - Rotaract Club of Viman Nagar\n  Rtr. Gayatri Jadhav - Rotaract Club of Modern College Ganeshkhind\n  Rtr. Dilip Sonawane - Rotaract Club of Sinhagad Academy of Engineering\n3. Registration Committee\n  Rtr. Divija Marwaha - Rotaract Club of Viman Nagar\n  Rtr. Faizan Tamboli - Rotaract Club of Pune Shaniwarwada\n  Rtr. Harvardhan Kale - Rotaract Club of Modern College Ganeshkhind\n  Rtr. Pooja Navratna - Rotaract Club of Panvel Elite\n4. Activity team\n  Rtr. Sanket Nagpure - Rotaract Club of Pune Mid-East\n  Rtr. Masooma Dalal - Rotaract Club of Poona Royal\n  Rtr. Vaishnavi Saraf - Rotaract Club of Pune Camp Horizon\n5. Promotion Team\n  Aaryan Joshi - Rotaract Club of DYPIEMR\n  Masooma Dalal - Rotaract Club of Poona Royal\n  Dheeraj Mantri - Rotaract Club of Indira College\n  Vidisha Nayak - Rotaract Club of Global Youth\n6. Faculty Coordination Committee\n  Rtr. Alfiya Sayyad - Rotaract Club of Electrical MCOE Metro\n  Rtr. Rutuja Patil - Rotaract Club of MITCON\n7. Technical Team\n  Rtr. Sanket Nagpure - Rotaract Club of Pune Mid-East\n  Rtr. Harvadhan Kale - Rotaract Club of Modern College Ganeshkhind\n8. Rotaract leaders for WhatsApp Groups \n  Rtr. Gayatri\n  Rtr. Vaishnavi\n  Rtr. Harshvardhan\n  Rtr. Faizan\n  Rtr. Rutuja Patil\n9. Quiz Team \n  Rtr. Aaryan Joshi\n  Rtr. Sanjana Singh\nThe Council Team who worked:-\nModerators \n  Rtr. Sattyajeet Karale Patil\n  Rtr. Rushikesh Dale\n  Rtr. Niharika Chaturvedi\n  Rtr. Chirag Gadge\n  Rtr. Nishant\n  Rtr. Lalit Desale\nLeader \n  Rtr. Tulna Gupta\nActivity planning and execution (Devil\'s Advocate) \n  Rtr. Sayali\n  Rtr. Sattyajeet\n  Rtr. Mriti\n','https://drive.google.com/folderview?id=12tcRyYpQdGHaW7LUUBveSRarOVukCwqC','2020-10-05 14:20:32.876424','09-2020-43',928,'0'),(929,'2','A meeting with Presidents, Council Members, RRRO and ISD and all the board of directors was organised on 24-08-2020 and was attended by more than 71 Rotaractors','https://drive.google.com/file/d/11cdYBzNpXs6u6Ny7XVGsjf0Xvw_xe1s8/view?usp=drivesdk','2020-10-05 14:20:39.900228','09-2020-43',929,'0'),(930,'2','I have encouraged all the Rotaract Clubs via whatsapp and meetings organised on 1 Aug and later 24 August which was attended by more than 35 clubs. Also at upsurge and I have personally contracted 10 Rotaract clubs post','https://drive.google.com/folderview?id=13O4iq89E0v4YBPHnN3ZQEoHKMftmTUr4','2020-10-05 14:20:58.100262','09-2020-43',930,'0'),(931,'2','PFA the list','https://drive.google.com/folderview?id=13jENebDa1HejJvwFt9wd6GuB1tUGElbx','2020-10-05 14:44:04.416709','09-2020-43',931,'0'),(932,'2','PFA The proof','https://drive.google.com/file/d/12Bm2q8skvs7EPzSOnE1SzFyhcfPpB-xc/view?usp=drivesdk','2020-10-05 14:21:57.600426','09-2020-43',932,'0'),(933,'2','PFA the proof.\n\nInstallation:- 2\nRC Electrical MCOE\nRC VIIT\n\nAlso I have attended the COPS and E-DFM.','https://drive.google.com/file/d/1