INSERT INTO `Main_faq` VALUES (1,'Where should I add PR Events ?','Under Club Service'),(2,'Where should I add other avenue events ?','Rotaract Events fall under 4 Categories : PD, ISD, CMD & CSD. If your event is under more than 2 avenues then add a new row and then add the same event again by just changing the avenue.'),(3,'What if I don\'t have an Instagram link or a drive link for a particular event/bulletin ?','Add a hyphen ( - )'),(4,'Which browsers are supported for Reporting ?','You can use Chrome or Firefox Browser. Use of Safari is not recommended.');
