INSERT INTO `SecReport_event` VALUES ('E-1-August-07U1f','2020-09-21 00:00:00.000000','2020-09-25 00:00:00.000000','Cleanliness Drive and Awareness','CM','','','','Our Club Rotaract club of RSCOE is going to organize the cleanliness drive and create awareness to keep our surrounding clean.','','2',0,'611556e79e9e454db666fd2832ee1166'),('E-1-August-1gNmm','2020-08-01 00:00:00.000000','2020-08-01 00:00:00.000000','Scribble Game','CS','15','3','0','On our first GBM, Scribble game was organized. It was really fun interacting with each other and everyone enjoyed playing online online pictionary game .','-','1',0,'611556e79e9e454db666fd2832ee1151'),('E-1-August-1kSa8','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Paw-Fi','CS','9','3','0','RC Global Youth along with RC Pune Salisbury Park & RC Koregaon Park had a cheery and fun filled weekend with a digital scavenger hunt and soulful PD session on fauna & their selfless friendship. Resource person Mrs Vijaya Tecksingani who is an author, a poetess and loves animals and supports various organisations meant for their welfare.\nDay & Date : Sunday 2nd August 2020\nAvenue : A PD & Club Service initiative.','https://www.instagram.com/p/CDcPznZA25h/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-1-August-2dle7','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Knowing about beauty standards and mental health','PD','','','','Knowing about beauty standards and mental health','','2',0,'611556e79e9e454db666fd2832ee1172'),('E-1-August-2RISr','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','GENERAL KNOWLEDGE AND DARE GAME','CS','20','2','0','In this game basic GK questions were asked and those who failed were given a dare to perform like sing, dance, eat masala, etc. It was a fun game which helped club members to bond.','-','1',0,'611556e79e9e454db666fd2832ee1163'),('E-1-August-32Yg6','2020-08-01 00:00:00.000000','2020-09-08 00:00:00.000000','knot the tree','IS','137','0','0','Rotaract Club of Pune Renaissance completed it\'s first International Service Initiative with a grand success! 137 members, 21 clubs and 9 districts took part in Project Knot The Tree. Participants tied rakhis / knot of thread to our eternal protectors- the tree and plant.','https://www.instagram.com/p/CEEVPojAR40/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-1-August-4kqZY','2020-08-02 00:00:00.000000','2020-08-08 00:00:00.000000','Fellows Amity','CS','150','72','0','the main idea behind this project was to create new bonds and networking. So on the occasion of Friendship\'s day, we took registrations from all over the District and other districts, paired all the participants with each other, gave them a week to bond we suggested them to do some fun activities ','https://www.instagram.com/p/CDOopq9AGiy/?igshid=f4awqiiellqq','1',0,'611556e79e9e454db666fd2832ee1158'),('E-1-August-5OxTP','2020-08-28 00:00:00.000000','2020-08-29 00:00:00.000000','Navnari','CM','23','6','0','club members played garba by visiting a old age home and donated food.','-','1',0,'7c5f3d7ce6de489692d2d52a6b530b90'),('E-1-August-6ryUQ','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','PROJECT AABHAAR','IS','1','1','0','At times, our own light goes out and is rekindled by a spark from another person. We all have deep gratitude to those who lighted the flame within us.\nRac SilverCity Mohali, Zone 5 organized Project Aabhar though which we thanked our leaders for being that example one searches for. Rotaract Club of Panvel Elite co-hosted the event and we also thanked Rtr. Ria Munot, Charter President of RCPE 2019-2020 for showing us how a leader functions efficiently and guides others knowingly and unknowingly\n','-','1',0,'611556e79e9e454db666fd2832ee1209'),('E-1-August-6S4Cn','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','Happiness','PD','40','20','0','We were colloberate in this event which were hosted by rotaract club of amonora youngistan.','-','1',0,'611556e79e9e454db666fd2832ee1132'),('E-1-August-6vgt5','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Club Assembly','CS','','','','Club Assembly conducted : RaC Pune Royal','','2',0,'611556e79e9e454db666fd2832ee1190'),('E-1-August-7BMAz','2020-08-02 00:00:00.000000','2020-09-02 00:00:00.000000','Friendship day','CS','14','2','0','RCDPU Team celebrates the friendship day by playing virtual games together to increase the bonding between the members','https://www.instagram.com/p/CDZXlvEg0af/?igshid=824vlzq9kbkb','1',0,'611556e79e9e454db666fd2832ee1196'),('E-1-August-7E8B7','2020-08-13 00:00:00.000000','2020-09-13 00:00:00.000000','Redesigning your life ','PD','20','1','0','Speaker explained how living life according to  vedic philosophy can enrich your lifr ','-','1',0,'611556e79e9e454db666fd2832ee1186'),('E-1-August-7KHFM','2020-09-01 00:00:00.000000','2020-09-01 00:00:00.000000','NA','CM','','','','NA','','2',0,'611556e79e9e454db666fd2832ee1145'),('E-1-August-7STWK','2020-09-09 00:00:00.000000','2020-09-14 00:00:00.000000','Choti so asha','CM','','','','This event is basically under women representative.in this event girls will confess about their harassment.','','2',0,'611556e79e9e454db666fd2832ee1132'),('E-1-August-8D0gK','2020-08-01 00:00:00.000000','2020-08-01 00:00:00.000000','RAKHI MAKING WORKSHOP','PD','15','2','0','HOMEMADE RAKHI WORKSHOP BY OUR MEMBER RTR. SUCHITA CHALKE . WE HAD CELEBRATED THIS RAKSHABANDHAN WITH ROTARACT CLUB CALCUTTA.','https://www.instagram.com/p/CDa8WZXAqRR/?igshid=1nlhta82z5xlq','1',0,'611556e79e9e454db666fd2832ee1154'),('E-1-August-A1FjH','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Let\'s talk travel','PD','','','','Live chat on Meet with Founder of Durgnaad Mr. Swapneil Jagtap on travelling QnA.','','2',0,'611556e79e9e454db666fd2832ee1189'),('E-1-August-A4yJ1','2020-09-12 00:00:00.000000','2020-09-12 00:00:00.000000','Club assembly','CS','','','','Club Aseembly','','2',0,'611556e79e9e454db666fd2832ee1149'),('E-1-August-AAgt3','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Paw-fi','PD','10','3','0','On the occasion of *Friendship Day we Rotaract Club of Koregaon Park along with Rotaract Club of Pune Salisbury Park & Rotaract Club of Global Youth conducted an interactive CSD event and a PD session - \'PAW - FI\' on 2nd Aug\'20.\nWe played Virtual Treasure Hunt  Yes, It\'s as exciting as it sounds! After a succesful CSD activity we moved on to our PD session. Our guest speaker, Mrs. Vijaya Tecksingani(an author, a poetess, India\'s former dart champion and an animal lover ) shared her inspiring stories and experiences with us.','https://www.instagram.com/p/CDal7dBAEk5/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1165'),('E-1-August-afqfM','2020-08-06 00:00:00.000000','2020-08-06 00:00:00.000000','Introduction of Rotaract for new members','PD','20','3','0','Giving a brief overview of Rotaract -benifts, working procedure to new members by Rtr. Sweta Tripathi, Rtr. Pratyush Das.','','1',0,'eb9670d295cc4f6e929bdf0c2e29fddf'),('E-1-August-asP9Z','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','AABHAR','IS','1','1','0','The project Aabhar was an initiative of Rotaract Club of Silver City Mohali. RC Patalganga was in collaboration for this project. Aabhar as the name suggests to thank. The project aimed to express gratitude to the Rotaract leaders for the work they had done for the society and the organisation. The clubs in collaboration were required to express gratitude to at least one Rotaract leader who is an epitome of inspiration, motivation and guidance, by just making a call, video call, online card posters, hand gifts, cooking for them or by giving flowers or in any way of expressing gratitude. Rtr Mohammad Shayan Usmani, President, Rotaract Club of Patalganga, participated and completed the project by expressing gratitude through a text message to the IPP Rtr Anil Kumar Saini, Immediate Past Secretary Rtr Siddhesh Bhojane and Immediate Past Treasurer Rtr Sorubasona Harikrishnan, the senior most members of the club for being crusaders of every situation.','-','1',0,'611556e79e9e454db666fd2832ee1160'),('E-1-August-atjqg','2020-09-19 00:00:00.000000','2020-09-19 00:00:00.000000','100 questions','CS','','','','we ask 100 question to club members','','2',0,'611556e79e9e454db666fd2832ee1186'),('E-1-August-aV3DG','2020-09-01 00:00:00.000000','2020-09-01 00:00:00.000000','E-Corjan','CM','','','','Spreading awareness of eco-friendly visarjan. People were asked to submit pictures of them doing visarjan at their homes or donating the idols.','','2',0,'611556e79e9e454db666fd2832ee1184'),('E-1-August-B3orp','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Club Assembly','CS','','','','Club Assembly','','2',0,'715586ae6a074411910a9f2d15b13b65'),('E-1-August-bSt2k','2020-09-09 00:00:00.000000','2020-09-09 00:00:00.000000','Bollywood Quize','CS','','','','Fun activity to keep active mind. Related to BOLLYWOOD & TECH','','2',0,'611556e79e9e454db666fd2832ee1194'),('E-1-August-cbR4h','2020-08-03 00:00:00.000000','2020-08-08 00:00:00.000000','Knot a tree','IS','09','3','0','It was a collaborated event with Rotaract club of Pune Renaissance, the event was to tie a rakhi to a tree and click pictures with it.','https://www.instagram.com/p/CDgs5kZgvL5/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1152'),('E-1-August-CEPvF','2020-09-19 00:00:00.000000','2020-09-19 00:00:00.000000','Flaneur','PD','','','','On your way is an inspiring Instagram live session with  Avani Awasthee. one of the youngest Indians to have been to the South Pole on an environmental expedition. To understand the collective and individual responsibility towards the environment.','','2',0,'611556e79e9e454db666fd2832ee1131'),('E-1-August-cmrzq','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Dance Pe Chance','CS','21','2','0','A dance therapy and BollyFitness session organised by our CSD, Rtr. Azhar Battiwala,where we invited choreographer Grusha Krishnani to conduct a session to get the members \'off the couch\' and on the dance floor for some physical exercise as well as enjoyment. The members danced to a choreographed song and performed some freestyle dance moves too. The aim of the activity was to motivate the members to do some regular physical exercise while also enjoying themselves.','https://www.instagram.com/p/CDbMYKcAEOm/?igshid=hcb9yyulgoy','1',0,'611556e79e9e454db666fd2832ee1213'),('E-1-August-cw1yW','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Serenity Peace of Mind','IS','50','100','0','SERENITY, Peace of Mind workshop was conducted by Rota facts in collaborations with ART OF LIVING FOUNDATION. In this workshop total 7 DISTRICTS,11 CLUBS AND 3 NGOs were participated.','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-1-August-Cy0D5','2020-08-22 00:00:00.000000','2020-08-28 00:00:00.000000','Green Ganesha ','CM','10','20','0','Green Ganesha was hosted by the Rotary Club of Pune Kalyani Nagar, Rotaract Club of Pune, Kalyani Nagar and Rotaract Club of Symbiosis Law School, Pune. It was a signature project and through the event, the clubs promoted eco-friendly celebration of the festival of Ganesh Chaturthi. Multiple competition were conducted via the social media platform of Instagram and participants from various clubs have engaged themselves enthusiastically. ','-','1',0,'611556e79e9e454db666fd2832ee1130'),('E-1-August-dJ62B','2020-08-03 00:00:00.000000','2020-08-07 00:00:00.000000','As the page Turns ','CM','30','15','00','Participants has to post a cover page of book and Write some interesting Quotes and Give Some Summary .','https://www.instagram.com/p/CDbFsx7g2KS/?igshid=8ztt06hu0s3j','1',0,'611556e79e9e454db666fd2832ee1146'),('E-1-August-DjgtS','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','Manavta2.0','CM','4','4','0','On Independence Day we distributed 85 study kits to children studying in Sarthak seva sang,saswad','https://www.instagram.com/p/CEdT5BNgGNw/?igshid=6lpi6gif9kys','1',0,'611556e79e9e454db666fd2832ee1157'),('E-1-August-dXznJ','2020-08-02 00:00:00.000000','2020-08-30 00:00:00.000000','Caring Connections','CM','12','5','0','Sometimes life is tough, and not everyone has a listening ear for their problems. This project is aimed to correct that with the help of our parent Rotary Club - Rotary Club of Amanora. There will be anonymous sessions where participants can vent and talk about their troubles to volunteers from Rotary Club of Pune Amanora. It is a year long project and has the potential to help plenty of people through mental and emotional support. Each slot will consist of maximum 5 people and our 2 counselors.','https://www.instagram.com/p/CDrVE8jgco1/','1',0,'611556e79e9e454db666fd2832ee1162'),('E-1-August-E2rmz','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Feel to Heal','CM','','','','A session organised to help deal with the stress, the pressure and the anxiety of coping up with the tough situations around us.','','2',0,'611556e79e9e454db666fd2832ee1213'),('E-1-August-e7htH','2020-08-03 00:00:00.000000','2020-08-03 00:00:00.000000','Beyond the Boundaries','IS','25','72','0','We MMRCPK had an event named \"Friendship beyond boundaries\" on the occasion of Raksha bandhan.\nWe did this project with three other countries. They are Costa Rica, Brazil and Venezuela.\nWe also had Cultural exchange with them. In that ,We learnt about different regions people, food, language, customs.\nIn short we built enduring friendship with the people around the globe.','https://www.instagram.com/p/CEGf_J-Aj4T/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-1-August-fgN76','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Finding your Ikigai','PD','','','','Speaker Rajitha Vipparthi will give a talk about how to find your Ikigai, and share her experience with choosing a career as well. ','','2',0,'8c865236269d494aa157d2f4474cae02'),('E-1-August-fp2Lm','2020-08-14 00:00:00.000000','2020-08-15 00:00:00.000000','Sanitizers Distribution ','CM','','','','Distribution of Sanitizers to Vegatable vendors in Nashik & Pune','','2',0,'611556e79e9e454db666fd2832ee1129'),('E-1-August-fXHpj','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','SUITABLE MATCH','CS','36','12','0','\"Suitable match\" was a Club service activity conducted on the Club\'s whatsapp group wherein our CSD Rtr. Devesh Navandhar shared memes, answers & riddles to which the members had to provide an appropriately witty QUESTION. ','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-1-August-fXqOn','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Not decided yet','PD','','','','This event will be conducted by Vivek Gurav, known as Plog man of Pune. He has initiated plogging in Pune. He will be enlightening the audience with what plogging is and how it\'ll help society.','','2',0,'611556e79e9e454db666fd2832ee1158'),('E-1-August-g4Scx','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Go With The Flow','PD','25','22','0','Ms. Disha Daga, a professional mandala artist conducted an interactive session on Mandala Art for the club members which began with an introduction to the history of mandalas, followed by explanation of the basics shapes that are used to create a mandala and then a follow- along session where all the rotaractors drew along with the artist and this ended with a Q &A session.','https://www.instagram.com/p/CD1k1YSgHim/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-1-August-G9yyz','2020-09-16 00:00:00.000000','2020-09-16 00:00:00.000000','Covid Kit Distribution','CM','','','','Covid Protection kit to be distributed to Gram Panchayat, Street Vendors, ASHA Workers, etc.','','2',0,'611556e79e9e454db666fd2832ee1160'),('E-1-August-ggYDj','2020-08-10 00:00:00.000000','2020-08-11 00:00:00.000000','Girls X Tech','CM','7','3','0','We RaC Laxmi College of Optometry attended the boot camp Girls X Tech which was hosted by Rotaract Club of VIIT.\nIt include