06 00:00:00.000000','Feel To Heal','CM','22','3','0','This event was organised under Community Service Avenue by our CMD Rtr. Roshni Wadiwala, we collaborated with RC Mumbai Downtown, RC Calcutta Endeavour, RC Palmville, RC  Kelaniya. We invited Mrs. Shadi  Razavian to talk to us about ways to cope up with the anxiety and stress which the past few months of quarantine have brought. She helped us understand the importance of recognizing and accepting our emotions and the need to vent them out every now and then. At the end of the session we had an activity where we wrote letters to ourselves penning down all the negative emotions we\'ve fostered and then destroyed the letters. The aim of the session was to get members to connect with their inner selves and let go of all negativity. ','https://www.instagram.com/p/CE1NXvdA4he/?igshid=1y0rvod8e77sr','1',0,'611556e79e9e454db666fd2832ee1213'),('E-1-September-xI6DE','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Ready to Revolutionise','PD','207','2','0','The Grand talk hosted by RAC Panvel Central along with Zone 1 and 29 other clubs pan India from various districts themed \"Ready to Revolutionise\". It was addressed by HH Shri. Braj Mohan Das Ji. He presented the GOLDen idea to enable the Rotaractors instill the spirit to do something great! Answering all the questions ranging from life issues to Bhagwadgeeta and Mahabharata he did won everyone\'s hearts. The event did gather lots of appreciation and love.','https://www.instagram.com/p/CErN6-kJQqz/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1150'),('E-1-September-XWpMG','2020-09-04 00:00:00.000000','2020-09-04 00:00:00.000000','\"Breast cancer awareness \" ','CM','4','2','0','It was a collaborated PD session on breast cancer awareness by speaker \"LALEH BUSHERI\" initiated by women representatives.','https://www.instagram.com/p/CFBiPtyArCc/?igshid=1of17bd7qczwo','1',0,'611556e79e9e454db666fd2832ee1152'),('E-1-September-y7Myt','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','CLOTHES DISTRIBUTION','CM','5','6','','The true value of one\'s life can be measured if the person can make a significant difference in someone\'s life\"\nOn 27th September Rotaract Club of Panvel Elite along with Rotary Club of Panvel Elite distributed men\'s, women\'s, and kid\'s clothes of all sizes to the villagers of Pen.','https://www.instagram.com/p/CF88ny_gpvW/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-1-September-ySbPb','2020-10-10 00:00:00.000000','2020-10-10 00:00:00.000000','Mental Health Day','CM','','','','A session on by our very own member will be conducting a session on Mental health on this World Mental Health Day.','','2',0,'611556e79e9e454db666fd2832ee1174'),('E-1-September-Z9fhH','2020-10-03 00:00:00.000000','2020-10-03 00:00:00.000000','VISUAL CONTENT CREATION TO IMPROVE PUBLIC IMAGE ','PD','','','','RCVN along with RC PUNE PIONEERS AND RCKP will conduct a professional development session on visual content to improve public image. ','','2',0,'611556e79e9e454db666fd2832ee1168'),('E-1-September-Zd9e1','2020-09-01 00:00:00.000000','2020-10-01 00:00:00.000000','Gajasanskruti 4.0','CM','12','24','0','On the day of Anant Chaturdashi, We Rotaract Club of Pune Mid-East held our flagship event GAJASANSKRUTI 4.0. Earlier in this event we used to help in cleaning roads after Visarjan but this year we improvised our flagship event in amazing way due to covid-19 situation. This year event was carried out at 9 different locations which were allocated by Pune Municipal Corporation (PMC). Rotaractors from our club were divided with Pune Municipal Corporation members and carried out Ganesh Visarjan safely. We helped in collection of Ganesh idol for donation and handling idols for visarjan. We helped collecting religious waste from people and dumped it properly. Also Pune Municipal Corporation (PMC) provided ammonium bicarbonate. Our member instructed people on how to use that chemical and complete idols visarjan in house. Every Rotaractor was wearing with mask and gloves.','https://www.instagram.com/p/CEtBRyogVfK/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-1-September-ZDbrY','2020-10-12 00:00:00.000000','2020-10-18 00:00:00.000000','Swa-Shastra','PD','','','','It\'s a WR initiative, our members will be rolling our videos of self defense to increase one\'s self confidence.','','2',0,'611556e79e9e454db666fd2832ee1158'),('E-1-September-zEI1B','2020-10-25 00:00:00.000000','2020-10-25 00:00:00.000000','AagniParva','PD','','','','Speech competition','','2',0,'611556e79e9e454db666fd2832ee1171'),('E-1-September-zlSn9','2020-09-17 00:00:00.000000','2020-09-27 00:00:00.000000','Bon Voyage','IS','17','10','0','Bon Voyage was an event initiated by RC Pune Pashan along with 16 Other Clubs from 16 Different countries on the Occasion of World Tourism Day. We had a Joint meeting, Joint Event as well released a Special Joint Bulletin.','https://www.instagram.com/p/CFrhzctAECU/?igshid=1jgowpobuyu47','1',0,'715586ae6a074411910a9f2d15b13b65'),('E-1-September-zWdob','2020-10-03 00:00:00.000000','2020-10-03 00:00:00.000000','Housie Night','CS','','','','Housie/Tambola Game Night','','2',0,'611556e79e9e454db666fd2832ee1183'),('E-10-August-21b54','2020-08-25 00:00:00.000000','2020-08-25 00:00:00.000000','ANIMAL WELFARE - PHASE 3','CM','4','4','0','During this pandemic, several NGOs have stood up to help fellow human beings. As we\nmove forward, we should also look after those creatures who cant ask for help. Recognizing\nthis, Rotaract Club of Panvel Elite took up a Community Service project- Animal Welfare\nProject, in which our club members collected donations for Thane Society for the Prevention\nof Cruelty to Animals.','https://www.instagram.com/p/CEej3rtAyJa/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-10-August-2d67n','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','Youth Skill Day','CM','21','3','0','ON 12th AUGUST,