ce:\nAround 8 clubs were a part of it including us.\nRC HUMANITAS (RID 3131)\nRC VIZAG CITY(RID 3020)\nRC Ivory City Mysore (RID 3181)\nRC Modern College GK (RID 3131)\nRC IGGMC Nagpur (RID 3030)\nRC Amonara Youngistan (RID 3131)\nRC SD College, Ambala (RID 3080)\n \n','https://www.instagram.com/p/CD53DA0ANj5/','1',0,'611556e79e9e454db666fd2832ee1157'),('E-10-August-a3khd','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','COGNIZANCE - PSORIASIS AWARENESS','CM','24','1','0','Rotaract club of Patalganga collaborated with RAC SILVERCITY MIDTOWN (RID 3080) for yearlong awareness program. We created awareness among masses by the means of social media like our official club Instagram handles, we laid emphasis on Psoriasis Awareness, treatment, symptoms, significance, etc.','https://www.instagram.com/p/CD0wCfTBdDk/?utm_source=ig_web_copy_linkhttps://www.instagram.com/p/CD0wCfTBdDk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-10-August-BW52S','2020-08-25 00:00:00.000000','2020-08-26 00:00:00.000000','Stree Leads','PD','13','24','0','On the occasion of Womens Equality Day, an E-Poster making competition was held in which the club members were asked to make posters focusing on women that have made remarkable progress in their respective sectors, in order to spread awareness about women equality. We also circulated a video depicting the history of Womens Equality Day to raise awareness regarding the same. Therefore, this event was a WR event as well.','https://www.instagram.com/p/CEcKq8kALRk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1201'),('E-10-August-czYCH','2020-08-21 00:00:00.000000','2020-08-21 00:00:00.000000','Letterhead Exchange with RC GURUGRAM MIDWEST ','IS','1','1','0','Letterhead Exchange with RC GURUGRAM MIDWEST RID 3011','https://www.instagram.com/p/CEhoYdTA9lV/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-10-August-dxEuA','2020-08-22 00:00:00.000000','2020-08-22 00:00:00.000000','Overcoming Stage Fear','PD','12','2','0','Rotaract Club of Pune Camp Horizon Hosted a Session on Overcoming Stage fear with the speaker Rtn. Kranti Shah. We got be part of it in Collaboration.','-','1',0,'611556e79e9e454db666fd2832ee1192'),('E-10-August-EMAd9','2020-08-30 00:00:00.000000','2020-08-30 00:00:00.000000','Club Assembly','CS','15','4','0','On 30th of August we successfully completed our club assembly with the panel including our DZR Rtr. Meet Shah and AZR Rtr. Riya Gupta. ','https://www.instagram.com/p/CFHVzHEgFEB/?igshid=1pgnyw01a97b4','1',0,'611556e79e9e454db666fd2832ee1169'),('E-10-August-eUeps','2020-08-22 00:00:00.000000','2020-09-22 00:00:00.000000','Naari','IS','2','4','0','Initiated by- Rotaract Club of New Bombay Seaside, RID 3142 So this event was initiated on the occasion of Womens Equality Day which is on 26th of August. Wherein a question was provided, and 2 members from the club were supposed to make a video of them speaking about the topic in not more than 2-3 sentences. The question was : what is the first thing that comes to your mind when you think about womens equality?\nVideo links\nhttps://drive.google.com/file/d/12Qu2LTJT12tnku5wIXlax3lTmSgLPTw7/view?usp=drivesdk\nhttps://drive.google.com/file/d/1PIsS1yPLWmFjxzusfZpQ7qhuwwrilTdm/view?usp=drivesdk\nhttps://drive.google.com/file/d/17rv8o6iLlq5lK5wefwhxLSitzouGTDN4/view?usp=drivesdk','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-10-August-GYs49','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','Perspective of Photography Competition','IS','6','0','0','Click Photos relating to the topics mentioned. ','https://www.instagram.com/p/CDiH6bjA0BC/','1',0,'611556e79e9e454db666fd2832ee1184'),('E-10-August-iIlxh','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','\"Inspirational Talk (Mr. Mandar Patki) IAS \"','PD','130','190','0','\"We attended the Joint Virtual Session Organized by our Sponsor Rotary Club of Pune Sarasbaug \nalong with Rotaract Club of Pune Renaissance \nand others of Mr. Mandar Patki, an IAS selected \ncandidate from Maharashtra with AIR 22.There \nwere 130+ participants on that session.\n\"','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-10-August-It6me','2020-08-06 00:00:00.000000','2020-08-06 00:00:00.000000',' Installation Ceremony','CS','71','2','0','It was a brilliant start for Rotaract Club of Amanora for RIY 2020-21 on 6th August 2020-21 as our club members gathered in Amanora Park Town premises (following all covid related precautions, of course) and started the installation ceremony. The chief guest was the president of Rotary Club of Amanora - Rtn. Sonia Meghani and the Guest of honor was DRR of RID 3131 - Rtr. Shraddha Lamkhade. There were guest talks, a charter day celebration and a club bulletin release along with lots and lots of well wishes and happiness.','https://www.instagram.com/p/CDmxJxlgAYN/','1',0,'611556e79e9e454db666fd2832ee1162'),('E-10-August-IvMlN','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','MARDANA','IS','6','3','0','SHIFAA Phase 1: - MARDANA was a joint project with Rotaract Club of Delhi Femina, RID 3011. In which boys some questions were asked to boy related to topic MARD and they have to answer it in a one word ','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-10-August-kZzP2','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','Just Click It !','CS','18','1','0','We RaC Laxmi College of Optometry did our Club service event JUST CLICK IT ! on the occasion of WORLD PHOTOGRAPHY DAY. In which we showcase the photographs which are clicked by each member.','https://www.instagram.com/p/CEE_2vMjo_x/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-10-August-Nfkm8','2020-08-26 00:00:00.000000','2020-08-26 00:00:00.000000','Dance Workshop','PD','13','2','0','This was PDD + WR initiative. Our new member Rtr. Trishna took dance workshop for two hours. It was very enthusiastic session. ','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-10-August-obFIz','2020-08-22 00:00:00.000000','2020-08-22 00:00:00.000000','Activating Leadership','PD','32','48','0','We had a PD Session jointly with RC Indira College, RC UBS And RC Electrical MCOE on \" Activating Leadership \" .\nIt was taken by \"Mr. Sahil Sethi\".We learned how you can create an impact as a leader.\nWe had a great time in this PD Session.','https://www.instagram.com/p/CFJ3wmwgPuX/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-10-August-opgL3','2020-08-24 00:00:00.000000','2020-08-25 00:00:00.000000','Fearless Talk','CM','10','8','0','FEARLESS ROTARACT GREETINGS\n\nBeing A Human Being\nSomewhere we all know\nThere are obstacle and barriers in our day to day life\nMost challenging , annoying , and what not\nBut What Makes you\nMoving Ahead of these stuffs is facing Them Fearlessly! \nTherefore ,\nFEARLESS TALK\nIn Collaboration with -\n\nRC DYPACS, RC Nigdi 3131, RC Pimpri 3131 RC St Xavier\'s College 3250 RC Kota Central 3054 & RC Calcutta Majestic 3291\n\nWhere you all be getting a virtual Platform to express what obstacle you had and how you faced it ! \nLets Motivate others by reading our Stories and Remind Ourselves by Overcoming such stuffs\nFEARLESSLY ! ','https://www.instagram.com/p/CEODWoWgOJ5/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-10-August-OtbGm','2020-08-22 00:00:00.000000','2020-09-22 00:00:00.000000','Birthdat Celebration and Word Game','CS','10','3','0','A suprise birthday celebration was organised by our BOD and members of the club for President \'Pooja Jahagirdar\'. Word game was also organised by ISD Karishma. A random word was given and all participants were asked to create multiple words from all the letters from that given word. Everyone enjoyed and interacted well by completing successful CSD event.','-','1',0,'611556e79e9e454db666fd2832ee1151'),('E-10-August-P8Dcp','2020-08-31 00:00:00.000000','2020-08-31 00:00:00.000000','Maha Aarti','CS','5','2','0','We had the Opportunity to host the morning Aarti of Sharda Gajanan Mandir, in the Presence of DRR Shraddha Lamkhade, District Treasurer Pranav Tukshetty and District Joint ISD Rushikesh Dale.','https://www.instagram.com/p/CE9gePMAEJG/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-10-August-q5kyh','2020-08-27 00:00:00.000000','2020-08-27 00:00:00.000000','Being mentally healthy during Pandemic','PD','18','2','0','We Rotaract Club of RSCOE along with RC DYP ACS , RC\nDYPIMS RID3131 , RC GEM RID 3131 , RC RSCOE RID 3131\nSucessfully\n\nInitiated a PD Session on \n\n\' BEING MENTALLY HEALTHY DURING PANDEMIC \n\nOur guest speaker Mrs. DEEPALI BEDI a Qualified Clinical\nA psychologist with RCI recognized degree in M.Phil.Her Varied\nExperience includes reputed Hospitals. She has 15+ Years of\nExperience in Psychology Field SESSION.\nThe session includes about :\n\" General Counselling on Psychological Problems, Their\nPrevention, Effect on the brain due to Current Situation, Symptoms\n& Common Causes of Psychological Disorders \".\nThis minutes shared by her gave an impact on individuals and\ngot aware of mental health.\nShe also gave tips on how to maintain your mental health.','-','1',0,'611556e79e9e454db666fd2832ee1166'),('E-10-August-QvVyI','2020-08-31 00:00:00.000000','2020-08-31 00:00:00.000000','CSD MEET','CS','8','20','0','Members gathered at Rtr Devikas place on occasion of her birthday','-','1',0,'611556e79e9e454db666fd2832ee1181'),('E-10-August-uqSMw','2020-08-14 00:00:00.000000','2020-08-14 00:00:00.000000','Multidistrict Share Market Webinar','IS','13','4','0','We, RC Pune Zenith organized our very First event Share Market Session under the banner of  RotaLand \"Multidistrict Share Market Webinar. The covered various aspects of stock market like- What causes stock prizes to change? Mistakes to avoid while investing, Basics of Stock Market. The event was Co-hosted along with 10+ Clubs. With 100+ participants attending the session, the event surely gave justic