ing cycling. It gives energy to start the day, a very fresh morning.\nIn fact we enjoyed cycling, had so much fun Majja and full too masti .\n\nWhile we followed all the precautions of Covid-19.\n\n','https://www.instagram.com/p/CEzRIxFpwEo/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1127'),('E-10-September-54nct','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Dog Feed Drive 2.0','CM','15','2','0','Dog Feed Drive 2.0\nCMD/PR\n-The dog feed drive 2.0 was conducted on 13th sep in the areas of Sanewadi & DP road.\n-Along with FTOB the event was accompanied by almost 15 volunteers for feeding about 80-90 dogs and collaring of 45 dogs.\n-The event was also a part of dog drive of feeding 20 dogs per day.\n-The event was chaired by Rtr.Sanat Bhatt who contributed immensely towards the event to made it a successful one.\n-Later videos and pictures were uploaded on the social media handle of club as a part of PR.','https://www.instagram.com/p/CF0NPF5AL12/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-10-September-bes5I','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','World Peace Day','IS','6','3','0','On International Peace Day, Rotaract Club of Pune Zenith participated in the district Peace event organized by Rotaract District 3131 along with Rotaract District 3080. It was a calming session on inner peace by TedX speaker Dr Virat Chirania on the 21st of September, 2020. The session covered some basic postures of yoga and gave us an insight on inner peace. \n','https://www.instagram.com/p/CFjiiteg96U/?igshid=19q82mm0bewm7   https://www.instagram.com/p/CFjideRgDvv/?igshid=17dwxtohc0s5f   https://www.instagram.','1',0,'611556e79e9e454db666fd2832ee1143'),('E-10-September-cB5Zm','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Blush it Up','PD','6','2','0','This was WR+PDD initiative by RCP Zenith along with 8 another club including RCSAOE. Makeup tutorial and QnA session was taken. Total attendance was 60+','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-10-September-HA7qt','2020-09-26 00:00:00.000000','2020-10-26 00:00:00.000000','ROTALINGO ','PD','62','2','0','Rotaract Club of Pune Camp Pioneers and Rotaract Club of Viman Nagar are coming up with an event on 26th September 2020 on the occasion of European Languages Day We along with 7 other international clubs will be conducting a PD and CS event to promote cultural exchange and build better bonds and friendship. Cultural Showcase, Inter-continental cultural quiz, Slang - sham: teaching common European slangs, Theme based intercontinental Antakshari. Rotaract Club of Dublin, Rotaract Club of Imperial, Rotaract Club of Salerno, Rotaract Club of  Moyuri, Rotaract Club of Lyon Quest, Rotaract Club of Split Novi, Rotaract Club of Pune Camp Next Gen (RID3131), Rotaract Club of Pune Pristine (RID 3131), Rotaract Club of JSPMs Rajshri Shahu College of Engineering (RID 3131),  Rotaract Club of Bharati Vidyapeeth Belapur( RID 3142) \n','https://www.instagram.com/p/CFxJHLbg6Pl/','1',0,'611556e79e9e454db666fd2832ee1168'),('E-10-September-Hhpzn','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Blush it up','PD','7','2','0','An Online make up tutorial hosted by the Rotaract Club of Zenith, by Vidhi Oswal. Enriching our knowledge on how to look more professional along with some skincare routine.','https://www.instagram.com/p/CGAbfnaA2JW/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-10-September-KYKmS','2020-09-19 00:00:00.000000','2020-10-19 00:00:00.000000','CSD Activity - Praprachya','PD','40','2','0','We Rotaract Club of Pune Mid-East had an exciting Ice breaker Session with Rotaract Club of ENTC MCOE named  meaning questions in Sanskrit. Each member was asked a question or given a situation and they had to answer them. The other members had to verify if he or she is telling the truth. The session was enjoyed by all the members. We also inducted 4 new members to our family.','https://www.instagram.com/p/CFH0RiRALRj/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-10-September-LREW5','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000','Seas the day','PD','12','2','00','Session on world maritime day With RC PUNE ROYAL','https://www.instagram.com/p/CF0CWL7g82N/?igshid=hjchrkve04y7','1',0,'611556e79e9e454db666fd2832ee1133'),('E-10-September-NfVIK','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000',' Session On World Peace Day ','IS','6','48','0','RID 3131 along with RID 3080 had conducted a session on the eve of World Peace Day on 21 September 2020.\nWe, the team of RC VIIT dynamically participated in the event.\n\nThe event was graced by Tedx Speaker Dr.Virat Chirania who is also an AOL International Faculty, he delivered us about the inner peace.\nWe were enthralled by his session.\nThe PDRR from 3080, Karamjit Sandhu also graced the session.\n','https://www.instagram.com/p/CFhvy6OAQur/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-10-September-SPidF','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','World Tourista Day','IS','45','24','0','WORLD TOURISM DAY is observed on 27th of September. RAC DYPIMS celebrated this day by collaborating with Rotaract Club of RSCOE for event WORLD TOURISTA. In this event rotarctors shared their favorite tourist places in their City, State and Country with description along with it. A video was made featuring some of the entries,\n\nThis Event was hosted by Rotaract Club of RSCOE RID 3131\n\n','https://www.instagram.com/tv/CFt0FdqgseV/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1129'),('E-10-September-ttUyC','2020-09-23 00:00:00.000000','2020-09-23 00:00:00.000000','Creativity and Lateral Thinking','PD','45','48','0','The session was all about the Things Your Brain Does and You Probably Didn\'t Know About. We got to learn many things which included how one can use their creativity and give a new look to any normal thing. The speaker for the session was our very own PP of Rotary Club of Pune Kothrud Rtn. Ujwal Tawade. \nWe also had many members from our Rotary Club who were present for the session. ','https://www.instagram.com/p/CFwpuswAQpt/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-10-September-Vb1C1','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Rising Pride','CM','12','2','0','LGBTQ - Spreading awareness about the community. The speakers were a Gay couple who shared their coming out story with all the attendees. ','https://www.instagram.com/p/CFw3BA8AtNz/?igshid=12bkzspwci1ze','1',0,'611556e79e9e454db666fd2832ee1174'),('E-10-September-YR8Nb','2020-09-14 00:00:00.000000','2020-09-14 00:00:00.000000','Cognizance','CM','24','1','0','Rotaract club of Patalganga collaborated with RAC SILVERCITY MIDTOWN (RID 3080) for yearlong awareness program. We created awareness among masses by the means of social media like our official club Instagram handles, we laid emphasis on  Polycystic Ovarian Syndrome, awareness, treatment, symptoms, significance, etc.','https://www.instagram.com/p/CFHAIDihlNe/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-10-September-yUNLv','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Sanrakshan','IS','30','00','00','Even as contraception remains to be a highly stigmatized issue in most societies, its importance in sexual and reproductive safety cannot be denied. With the aim of ensuring that every pregnancy in the world is safe and wanted, World Contraception Day (WCD) is observed every year on 26th September.\nThe initiative was taken by the Rotaract Club of Ingenious Minds.','https://www.instagram.com/p/CFmwxRhAMdZ/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1194'),('E-10-September-zRHUA','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Mirabilia ','PD','38','2','0','We conducted a Personality building session in collaboration with RC Poona Royal, RC Modern Arts, C&S. By Resource person Ms. Devaki Purohit who is a trained professional and undertakes personality development professionally and has guided numerous individuals entering the corporate world. \n\n','https://www.instagram.com/p/CGAud6hAXFd/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-10-September-ZroAR','2020-09-12 00:00:00.000000','2020-09-14 00:00:00.000000','Hindi Diwas','CS','4','10','0','In collaboration with Rotaract Club of Pune Salisbury Park and 10 other clubs from all over India, on the occasion of Hindi Diwas, female members of our club recorded themselves reciting certain lines of a poem as a way to inspire women across India to rediscover self-love. This was a PR and WR event as well.\n','https://www.instagram.com/p/CGDOm8dg8UH/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-11-August-3j9U9','2020-08-06 00:00:00.000000','2020-08-06 00:00:00.000000','Maskie','IS','27','1','0','Rotaract club of RSCOE Collaborated with Rotaract club of\nKota central have come up with an initiative to spread awareness of wear\nmask by sharing pictures in the social handle.','-','1',0,'611556e79e9e454db666fd2832ee1166'),('E-11-August-a7WXL','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','Interaction with Mander Patki: IAS','PD','100','2','0','Interaction with Mander Patki: IAS\nPDD/RRRO\n-A session conducted by speaker IAS Mander Patki was organised by Rotary club of Aundh focusing on the topic of UPSC exam.\n-Mander Patki shared his journey during the preparations of exams talking about the hurdles and challenges that he faced and what kept him motivating throughout his journey.\n-He also shared many of the studying tips and techniques for the preparations of the exam.\n-The session was attended by more than 100 participants from rotary and rotaract.\n-Later the Q&A round was taken for the aspirants to get guidance for the preparations of exam.','https://www.instagram.com/p/CE_1rQ3g_um/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),(