ined in the coming future\nWe co-hosted along with RC Kalyaninagar, RC Universal Business School, RC Aundh, RC Pune Royal, Rotaract Club of AIMS RID 3131, RC Bibwewadi, RC RSCOE, RC Global Youth, RC Pune Ganeshkhind a PD session on Vedanta Principles to lead a meaningful life of abundance.\nThe session was taken by Ms. Monica Pahuja, Alumnus of the Vedanta Academy. The session was a great insight in the life of Vedanta Academy, whose principles are much needed in todays times.','https://www.instagram.com/p/CEmDxo3gizB/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-11-August-MUJcr','2020-08-23 00:00:00.000000','2020-09-23 00:00:00.000000','SIGNATURE ANALYSIS','PD','100','1','0','Rotaract Club of Pune Mideast collaborated with Rotaract Club of Poona Royal, Rotaract Club of Universal Business School, Rotaract Club of Kalyaninagar, Rotaract Club of Alumni and Rotaract Club of Pune Shaniwarwada for a session on Signature Analysis conducted by Ms. Shweta Jha an experienced graphologist with an understanding of handwriting, signatures and drawings. Ms. Shweta Jha covered more than 20 types of signatures and elaborated the characteristics of each type which was a very detailed information that helped everyone. The session was open for all rotaractors and non rotaractors as well and without any doubt everybody agreed to the analysis of the signature that denoted her precision. The session was attended by 100+ Rotaractors and the session was live on Facebook at the same time. The session ended with a very informative Q&A forum.','https://www.instagram.com/p/CEQ70KTgCIE/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1212'),('E-11-August-OIj8S','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','\"World Photography Day  Nature-O-Graphy \"','PD','15','0','0','\"We asked our fellow Rotaractors , to post on their stories pictures of nature clicked by them and Tag @rotaractclubofalumni and we \nare glad to receive a lot of \npositive response.\n\"\n','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-11-August-OVibh','2020-08-23 00:00:00.000000','2020-09-02 00:00:00.000000','DIY: Feed the birds','CM','0','0','0','Festivals are the time to rejoice but to also give back to the community, by what better way than feeding nature\'s own creatures. This challenge was all about making your own bird feeder with old and recyclable material to feed the birds and provide them a place to nest and eat. The initiative was for a span of 10 days.','https://www.instagram.com/p/CE3ii_2gfVg/?igshid=1bgd2b4xfcuxt','1',0,'611556e79e9e454db666fd2832ee1169'),('E-11-August-qt200','2020-08-31 00:00:00.000000','2020-08-31 00:00:00.000000','Tiny Rotaract Tales','PD','30','10','0','Tiny Rotaract Tales','https://www.instagram.com/tinyrotaracttales/','1',0,'611556e79e9e454db666fd2832ee1145'),('E-11-August-S0hX1','2020-08-22 00:00:00.000000','2020-08-22 00:00:00.000000','Activating Leadership ','PD','12','1','0','About the Event (few lines)- Session on Leadership, jointly with RC INDIRA COLLEGE RID 3131','-','1',0,'611556e79e9e454db666fd2832ee1171'),('E-11-August-VLIEw','2020-08-28 00:00:00.000000','2020-08-28 00:00:00.000000','Quiz on Ganapati Bappa','CS','0','48','0','We had a Online Quiz on our beloved \" Ganapati Bappa \" .\nWe asked some basic questions to everyone related to our Lord Ganesha.\nMany people Participated in this.','https://www.instagram.com/p/CFJ33HUAIqE/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-11-August-y1TCT','2020-08-17 00:00:00.000000','2020-08-21 00:00:00.000000','Food-O-Graphy','CS','3','0','0','Participants sent the photograph of their favourite food decorated in a plate. The three winners were featured on Instagram Handle\n','https://www.instagram.com/p/CD_0Yv_AScy/?igshid=12n45julp41ua','1',0,'611556e79e9e454db666fd2832ee1184'),('E-11-August-y2IdT','2020-08-18 00:00:00.000000','2020-08-18 00:00:00.000000','Tuesday Twister - Managing Covid Stress','CS','63','2','0','RC Global Youth brings to you fun trivias and personally curated awareness drives through theme based posters to engage each one of you in our journey of Rotaract. The theme for the first Tuesday Twister was a curation of awareness regarding the pandemic and managing stress relating to such hard times. \nCurations by Rtr Tanya Kukade & Rtr Prachie Bedi.\nAvenue : A PR initiative.','https://www.instagram.com/p/CFOqPlsgOXN/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-11-August-YDZID','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','MEN KI BAAT','IS','11','3','0','SHIFAA Phase 2: - Men and Emotions was a joint project with Rotaract Club of Delhi Femina, RID 3011. We were honored to have with us Mr.Harshdeep Singh as the speaker of the session who besides being a Life Coach is also a NLP practitioner.He started working at the age of 18 as a network marketing professional and has never stopped exploring since then. As an influencer, his vision stands to give an insight and clarity to people. ','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-11-August-yLbvn','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer','PD','12','24','0','On the occasion of the National Sports Day, we had an interactive session with, Vahbiz Bharucha, Captain of the Indian Women\'s Rugby Team. She enlightened the audience about Rugby and how her journey was to become the captain of the Indian team.','https://www.instagram.com/p/CEWPclCgutj/?igshid=malfmtqikr7a','1',0,'611556e79e9e454db666fd2832ee1158'),('E-11-August-zUnpO','2020-08-30 00:00:00.000000','2020-08-30 00:00:00.000000','A Session on Anti-Colourism','IS','10','2','0','A session Conducted by Rotaract club of Thane Downtown with the speaker MRS. Fatima Lodhi. it was enlightening session which our club got to be a part of.','-','1',0,'611556e79e9e454db666fd2832ee1192'),('E-11-September-1X4sB','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','World Peace Day','PD','6','3','0','On International Peace Day, Rotaract Club of Pune Zenith participated in the district Peace event organized by Rotaract District 3131 along with Rotaract District 3080. It was a calming session on inner peace by TedX speaker Dr Virat Chirania on the 21st of September, 2020. The session covered some basic postures of yoga and gave us an insight on inner peace. ','https://www.instagram.com/p/CFjiiteg96U/?igshid=19q82mm0bewm7   https://www.instagram.com/p/CFjideRgDvv/?igshid=17dwxtohc0s5f   https://www.instagram.','1',0,'611556e79e9e454db666fd2832ee1143'),('E-11-September-5PvEL','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','E-RYLA ','IS','90','5','00','E-RYLA on Emerging Technologies in Cyber Securities Organized by Rotary Club of Pune  Vibrant East in Association with Rotaract Club of Pune Vibrant East,\nWith 11 Collaborative Rotaract Club and participating clubs. ','https://www.instagram.com/p/CFKH205AkF7/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1194'),('E-11-September-AhnKm','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Rising Pride','CS','12','2','0','It was a session by Gay couple - LGBTQ Community along with the session we had a CSD activity for all our attendees.','https://www.instagram.com/p/CFw3BA8AtNz/?igshid=12bkzspwci1ze','1',0,'611556e79e9e454db666fd2832ee1174'),('E-11-September-dCAWc','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','ABCD: 3:0','CS','12','2','0','ABCD: 3:0\nPDD/CSD/MDD\n-ABCD 3.0 was conducted in the same way as 1.0 and 2.0.\n- The participants in ABCD 3.0 were the BOD members and some of the new members, around 13 of them participated in the event.\n-In the beginning the president shared an inspiring story with the members to motivate them to participate in all such kinds of events etc.\n-This was concluding event of ABCD which turned out to be really fruitful and bond building','https://www.instagram.com/p/CFz-b4JARde/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-1