vi, Rotaract Club of Pune Camp Next Gen (RID3131), Rotaract Club of Pune Pristine (RID 3131), Rotaract Club of JSPMs Rajshri Shahu College of Engineering (RID 3131),  Rotaract Club of Bharati Vidyapeeth Belapur( RID 3142). ','https://www.instagram.com/p/CFxJHLbg6Pl/','1',0,'611556e79e9e454db666fd2832ee1168'),('E-11-September-NMgrA','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Photography Session','PD','60','4','0','Rotary Club of Pune Sunrise in association with Rotaract Club Of DYPIMS presented a amazing session on the topic Insights of Professional Photography by a keynote and a Celebrity Speaker Mr. Sameer Belvalkar. The session was conducted on Zoom at 5:30 pm.\nWe conducted a Photography competition for the Rotarians as well as the Rotaractors with amazing cash prizes. Received number of entries and good response from all the Rotarians and Rotaractors. On 26th of September Saturday During the session the insights was given along with the declaration of all the winners. The meeting was called to order by Mr. Bharat Patil (President, Rotary club of Pune Sunrise).\n','https://www.instagram.com/p/CFt2TDkgqbO/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1129'),('E-11-September-ONpDv','2020-09-19 00:00:00.000000','2020-09-19 00:00:00.000000','WOMEN OF MYTHOLOGY','PD','40','2','0','Rotaract Club of Pune Mid-East conducted Mythological Session on Role of Women in Indian Mythology. The session was a PD+WR Initiative. The session was taken by Mr. Vedant Pophale, who is a UI/UX Designer by Profession but has been studying about the Indian Mythology and its Nuances since last 7 years. The session witnessed more than 40 participants, where Mr. Vedant spoke about the women in Indian mythology, their stories, their origin and their contribution. We got to know various stories about the fierce and confident women in mythology and the origin of feminism which was shown by the strong women in the ancient times. The session further ended with a very informative QnA which again left us with some amazing insights.','https://www.instagram.com/p/CFXT1_PgjNM/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-11-September-Pr3Vh','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Conservation Conservation','PD','56','2','0','Session on Wildlife conservation by Resource person Mr Shubham Pande in collaboration with RC Nigdi, RCSAOE, RC Kalimati, RC People\'s Campus, RC DYPACS, RCDYPIMS, RC Indira College, RC Kota Central, RC Pune Royal. He talked about the activities undertaken by then to ensure rescue of wildlife animals and the financial backing and future endeavors of such small conservation groups. \n\n','https://www.instagram.com/p/CFkV7dlAdGX/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-11-September-RJEPs','2020-09-13 00:00:00.000000','2020-09-16 00:00:00.000000','Ozone For Life','PD','8','18','0','This was a PR event, awareness campaign as well as an E-poster making competition held on the occasion of World Ozone Day to spread awareness about ozone layer depletion and the various ways to reduce the same. A template was also circulated in which all the participants had to mention various ways to reduce ozone layer depletion and post it as a story on their Instagram Accounts as well as nominate other rotaractors to do the same.\n\n','https://www.instagram.com/p/CGFxy5nghRd/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-11-September-unwSL','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000','A Dynamic Skill','PD','85','240','0','Dr. William Kuskin is a professor at the University of Colorado Boulder was the speaker for the session.\nDr. Kuskin would enlighten us about dynamism in a presentation, body language, voice modulation, content research, practicing, etc.\nRegistrations were FREE of cost.\nRotaractors, as well as Non-rotaractors, were allowed to participate.\n','https://www.instagram.com/p/CFm7W8Zgeqs/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-11-September-UTWyj','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Blood , Sweat & Tears and The Europe','PD','40','48','0','Joint Clubs - RCA Youngistan and other 13 clubs from our district and other than our district also.\nWe had two PD sessions in one event at one platform.\n1. Blood, Sweat and Tears by Rtr. Shraddha Bhattad (A Guinness Record holder for skating dance), who taught us about life challenges and not to give up in any situation.\n2. The Europe by Rtn. Tamasso Puccio from Rotary Club of Palermo Mondello, who shared about his experience and the importance of International European Day.\n','https://www.instagram.com/p/CFw5KS9A_1n/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-11-September-VkP0o','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Trails by Indian Backpacker','PD','50','2','0','RCSAOE along with RCMitcon and RC Pioneers conducted a PD session on solo travelling, Travel queries. Rotaractors outside RID 3131 also joined us for the event. ','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-11-September-vuPyT','2020-09-12 00:00:00.000000','2020-09-12 00:00:00.000000','First - AID','CM','11','1','0','A seminar hosted by Rotaract Club Laxmi College of Optometry, where we got to know the many facts regarding first aid.','https://www.instagram.com/p/CFC5BkZgWah/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-12-August-3xShf','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer','PD','45','72','0','We, MMRCPK in Collaboration with RC Global Youth, RC Pune Camp Next Gen, RC Pune Camp Pioneers, RC Humanitas, RC UBS, RC PIT and RC Gurugram Midwest (RID 3011) Organised a Professional development, Women\'s representative & Club Service Event \"CONQUER\" where our Guest speaker was Vahbiz Bharucha.She is a physiotherapist by profession and a Rugby Player by vocation. She herself as an intimidating player on the field. We invited her to talk about her experiences, life lessons and way forward. The event was followed by a fun-filled Club Service games\n','https://www.instagram.com/p/CFJ7rYuASwm/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-12-August-42WgR','2020-08-25 00:00:00.000000','2020-08-25 00:00:00.000000','Tuesday Twister - M.S. Dhoni ','CS','47','2','0','RC Global Youth brings to you fun trivias and personally curated awareness drives through theme based posters to engage each one of you in our journey of Rotaract. The theme for the first Tuesday Twister was curation of a fun quiz on the life journey of the celebrated cricketer M.S. Dhoni. \nCurations by Rtr Tanya Kukade & Rtr Prachie Bedi.\nAvenue : A PR initiative.','https://www.instagram.com/p/CFOqPlsgOXN/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-12-August-5SKv5','2020-08-23 00:00:00.000000','0202-09-02 00:00:00.000000','Virangana','CM','0','0','0','The strongest actions for a woman are to love herself, be herself and shine amongst those who never believed she could. This event is a small token of appreciation towards women of every field who have excelled and have made a name for themselves. The span of event was 23rd August untill 2nd September. Getting to know such women, their achievements and the hardships they faced is must. This is a small effort from our side to bring such women to the limelight and give them the recognition they need. This was a womens\' representative initiation. ','https://www.instagram.com/p/CFJs-ZKAnyi/?igshid=4rjntrwd6zd9','1',0,'611556e79e9e454db666fd2832ee1169'),('E-12-August-8xhal','2020-08-22 00:00:00.000000','2020-08-22 00:00:00.000000','Charter Day Celebration','CS','110','4','0','On 22nd August 2020, we Rotaract Club of DYPIMS took initiative to organize an event under Club Service Avenue  DJ NIGHT WITH DJ SCHABIE. On Charter Day of our club We RC-DYPIMS successfully conducted this Fun Virtual Dj NightEvent.\nThe session was held on 22ndAugust 2020 from 10pm to 12 am on Zoom Meeting App.\nThe Fun event helped the participants to Dance on the energetic Beats of Dj Schabie from their Home with full safety Precaution in this quarantine Period. \nThere were total 100 + of participants who enjoyed a lot.\n','https://www.instagram.com/p/CEUXBmLABY4/? igshid=1urkhsxnx1nj','1',0,'611556e79e9e454db666fd2832ee1129'),('E-12-August-DrG2E','2020-08-20 00:00:00.000000','2020-08-30 00:00:00.000000',' - The cultural trade','IS','36','12','0','Shailee was an online cultural exchange Project pan India. under this project we collected pictures of Traditional food, clothing, festival and cultural heritage from Clubs in various states of India. ','https://www.instagram.com/p/CEV6tWDgAzt/?igshid=z71lo1qkxtq0','1',0,'611556e79e9e454db666fd2832ee1175'),('E-12-August-FIAWa','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer: Remember Why You Started ','IS','76','26','0','On the occasion of National Sports Day, we cohosted an interactive session with RC Global Youth, MMRCPK, RC Humanitas, RC Pune Camp Next Gen,  \nRCPIT, RC UBS, RC Gurugram Mid-West wherein the Captain of the Indian Womens Rugby Team Ms.Vahbiz Bharucha talked about Rugby, her past \nexperiences, life lessons and her journey to becoming the captain of the Indian Womens Rugby Team. Apart from that, we also conducted two sports themed Club Service activities for all the participants, namely Family Feud and Solve the Riddles. Family Feud was an unusual quiz where the participants had to guess the most popular answers given by the majority of the public whereas in Solve the Riddles the participants had to guess the sport by solving the riddles given to them. This was a WR event as well.\n','https://www.instagram.com/p/CFB-RfeANMS/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-12-August-HMXlE','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','Computer vision syndrome','PD','17','2','00','Pd session on computer vision syndrome with Rc laxmi college of optometry','https://www.instagram.com/p/CEa3u8sAhz9/?igshid=18skabj9ikht8','1',0,'611556e79e9e454db666fd2832ee1133'),('E-12-August-IVIlT','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','Computer Vision Syndrome','PD','15','1','0','We RCLCO had hosted our first international PD event on the topic Computer Vision Syndrome and the speaker of the session was Ms. Shruti Lad. she is working as a tutor at LCO, Panvel and handling a Vision Therapy Department at Laxmi Eye Institute,Panvel. It was a PD and ISD event. For this event 13 clubs had collaborated with us. More than 100+ participants were present in the session, from that 15 Rotractors from our club had attended the session.','https://www.instagram.com/p/CEGyYXcgqf-/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-12-August-pbubu','2020-08-14 00:00:00.000000','2020-08-16 00:00:00.000000','E-DFM','CS','5','8','0','Rotaract Club of Pune Zenith Participated in the E - DFM hosted by Rotaract club of Indira College and Rotaract Club of Pune Camp Pioneers.','-','1',0,'611556e79e9e454db666fd2832ee1143'),('E-12-August-pGckB','2020-08-17 00:00:00.000000','2020-08-17 00:00:00.000000','The Pimpri Hour #1  Youtube Journey of Rtr.Mangesh','PD','17','3','0','We started our club level PD+CSD series of sessions titled\nThe Pimpri Hour as a platform for all to present a topic that matters to them. The goal is to have at least one\nsession by every member. The very first session of these series was taken by our CMD Rtr. Mangesh Shinde, our very own Willpower Star on 17th August. He is an established YouTuber and Digital Marketing Professional, and he gave us an insight of his profession. All the doubts and misconceptions regarding Digital Marketing were cleared, leaving everyone inspired with his amazing journey.','https://www.instagram.com/p/CEonOpMgD2j/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-12-August-rffWx','2020-08-26 00:00:00.000000','2020-08-26 00:00:00.000000','Womens Equality Day','IS','0','1','0','On account of women\'s day, we thanked all the women for carrying out the tasks on social media handle.','https://www.instagram.com/p/CEWlB4IgKFO/','1',0,'611556e79e9e454db666fd2832ee1166'),('E-12-August-s8lNZ','2020-08-21 00:00:00.000000','2020-08-25 00:00:00.000000','\"WO=MEN (21Aug - 25 Aug) \"','CM','0','0','0','\"Rotaract Club of Electrical MCOE Metro \nOrganized an Event named WO=MEN for a \nweek, where we had Spread Awareness and \nShared our thoughts about Women \nEquality and their Values as well as their \nRights. The Event was Done in the Women \nEquality Week.\n\"\n','https://www.instagram.com/p/CEWANftgep8/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1185'),('E-12-August-seyzK','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer','IS','12','24','0','RC Global Youth initiated this event in collaboration with RC Humanitas, RC Pune Camp Pioneers, RC Pune Camp Next-Gen, MMRCPK, RC UBS, RC Panvel Industrial Town and RC Gurugram Mid-West (RID 3011)','https://www.instagram.com/p/CEWPclCgutj/?igshid=malfmtqikr7a','1',0,'611556e79e9e454db666fd2832ee1158'),('E-12-August-tENC9','2020-08-20 00:00:00.000000','2020-09-23 00:00:00.000000','Project Hope','IS','2','4','0','Initiated by- Rotaract Club of Maharaja Agarsain, RID 3011. We, Rotaract Club of Pune Mid-East collaborated in an initiative to create online awareness about PCOS and PCOD. Polycystic ovaries is a genetic, hormonal, metabolic and reproductive disorder that every 1 out of 10 women goes through! . It is the leading cause of female infertility. In the country there still are women who doesn\'t know what exactly it is and how to deal with it. We had to Share the posters twice a day, with following hashtags- @rotaract_ma, @fm_mshkur7, @rotaractdistrict3011, @vedii0506, @yaaminithareja','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-12-August-TuPH8','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','Rotaract Col. 1.0 KICK START YOUR FITNESS JOURNEY','IS','110','10','0','Health and fitness is the most important aspects in ones life. Keeping this in mind, Rotaract club of Patalganga conducted their second webinar of Rotaract Colloquium 1.0 on Kick start your Fitness journey by Ms Vaibhavi Kamath, for the Rotarians as well as Non-Rotaractors. The speaker is a Certified Fitness trainer, has worked with Cult Fit, has trained 70+ people, and has her own youtube channel.\nIn collaboration with 20 other clubs, we successfully hosted this event. More than 110 participants from various clubs marked their presence.\nThe session was very essential in this pandemic situation. The President of our club gave introduction about the speaker. The Speaker started the session by sharing her own fitness journey of losing 18 kg. She signified the importance of fitness in ones life, gave tips for beginners, shared common dos and donts, checked facts and busted myths. It was followed by Question and answer session. Speaker answered many queries raised by the participants.','https://www.instagram.com/p/CD1ghaeBxqK/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-12-August-Ursi7','2020-08-31 00:00:00.000000','2020-08-31 00:00:00.000000','GAME NIGHT','CS','9','1','0','ONE OF OUR ROTARACTOR, RTR. AJIT ORGANISED A GAME NIGHT FOR THE CLUB WHICH INCLUDED TONGUE TWISTERS, RIDDLES AND MANY MORE.','-','1',0,'611556e79e9e454db666fd2832ee1209'),('E-12-August-vafg0','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Success Mantra For 10th Students','CM','10','10','0','1. 40000 students watched and got guidance for SSC\n2. 225+ schools attended the event\n3. Collaboration with Flagship event of Rotary Club of Pune Yuva,  Supermind & Radio 95 BIG FM\n4. Education Minister HON. Varsha Gaikwad motivated all.\n5. DG Rtn. Rashmi Kulkarni blessed the event with her presence.\n6. Dr. Shakuntala Kale HEAD OF SSC BOARD were present for the event.\n7. RJ Bandya of 95 BIG FM was present.\n','https://www.instagram.com/p/CEkDNWLgnsA/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-12-August-w18B3','2020-08-17 00:00:00.000000','2020-08-21 00:00:00.000000','Food-O-Graphy','IS','3','0','0','Participants sent the photograph of their favourite food decorated in a plate. The three winners were featured on Instagram Handle','https://www.instagram.com/p/CD_0Yv_AScy/?igshid=12n45julp41ua','1',0,'611556e79e9e454db666fd2832ee1184'),('E-12-August-wqdfJ','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Meet up at Peter Donuts','CS','15','3','0','Meet up at Peter Donuts\nCSD\n-An unofficial casual meet was planned at peter donuts, Apte rd.\n-The event was an icebreaker and to increase the bonding amongst the members.\n-Almost 15 members showed up for the meet and it was a great experience to see new faces involving and have great bonding with everyone.\n','https://www.instagram.com/p/CFDVk41gaBj/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-12-August-wqMEh','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','SIGNATURE ANALYSIS ','PD','10','2','0','About the Event (few lines)- Insights into signature, jointly with  Rotaract Club of Poona Royal 3131','-','1',0,'611556e79e9e454db666fd2832ee1171'),('E-12-September-0xrqt','2020-09-20 00:00:00.000000','2020-10-20 00:00:00.000000','Morning Trail Walks at ARAI','CS','16','5','0','Morning Trail Walks at ARAI\nCSD\n-About 14 rotaractors along with Rtr Sumedh Gite, pres RC PHS and Akshay More joined in for a walk.\n-It was an amazing event, all the club member met after a long time.\n-We visited quarry first clicked some pictures together. Later we visited Vetal Mandir.\n-Later the club had sponsored some fellowship at Durga Cafe.\n-It was great to see the enthusiasm from all the members.','https://www.instagram.com/p/CGCGZTTgfCU/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-12-September-2NgaQ','2020-09-30 00:00:00.000000','2020-09-30 00:00:00.000000','Road Play - Corona Awareness Compaign','CM','5','3','0','Conducted our second Roadplay in collaboration with Fit n Health Club Daund on 30th Sept\'20.','https://www.instagram.com/tv/CFpDUieF2Wu/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1127'),('E-12-September-aEK8v','2020-09-15 00:00:00.000000','2020-09-15 00:00:00.000000','Charter day Celebration','CS','40','4','0','On our 5th charter day, we arranged a meet with all alumini members. In this meeting we did fun activities, heard their experiences and memories. ','https://www.instagram.com/p/CFJaPgrAZDt/?igshid=fgwi2ndls9lb','1',0,'611556e79e9e454db666fd2832ee1189'),('E-12-September-ARMBW','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000',' World travel day (Wandering minds) ','CS','10','72','0','Rotaract Club Of VIIT conducted this event on world travel day to unbox all your memories and share them with your friends and loved ones.\nFor participation, participants just had to write down their experience and all the things that remind them in Max 200 words and a memorable click.\nA certificate of participation was provided.\n','https://www.instagram.com/p/CFoTwxUAdyD/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-12-September-cjrq7','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','The idea of India ','PD','12','2','00','Pd session - Rotaract Colloquium 1.0 with Rc Patalgana','https://www.instagram.com/p/CF0Ce_Rgwcg/?igshid=1gx4u14c3sgbq','1',0,'611556e79e9e454db666fd2832ee1133'),('E-12-September-EKJL3','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Rising Pride','PD','12','2','0','A PD event by a Gay couple who have been an inspiration out there, and shared their experience and also shared their coming out story.\nAnd how they are proud to be a part of LGBTQ community.','https://www.instagram.com/p/CFw3BA8AtNz/?igshid=12bkzspwci1ze','1',0,'611556e79e9e454db666fd2832ee1174'),('E-12-September-EUs5S','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Rising Pride','PD','24','3','0','We RC-DYPIMS Collaborated with Rotaract Club of Pune Camp Horizon and Conducted an Interview session - The Rising Pride. With Rahul Malde and Sushank Chibber  (Gay Inspiration) \nThe session was been conducted on 27th September at 8:10 PM on Zoom Meeting App.\nAlong with RC-DYPIMS,  18  Other  clubs were  collaborated for this event.\n','https://www.instagram.com/p/CFt2cE5ADwR/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1129'),('E-12-September-H2Zxp','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','VIRTUAL MEDITATION ','CS','11','1','0','RCVN  conducted a session of virtual mediation (sound meditation) to help the club members take a break away from all the hassles in life ','-','1',0,'611556e79e9e454db666fd2832ee1168'),('E-12-September-kBwRN','2020-09-13 00:00:00.000000','2020-09-16 00:00:00.000000','Ozone For Life','CM','8','18','0','This was a PR event, awareness campaign as well as an E-poster making competition held on the occasion of World Ozone Day to spread awareness about ozone layer depletion and the various ways to reduce the same. A template was also circulated in which all the participants had to mention various ways to reduce ozone layer depletion and post it as a story on their Instagram Accounts as well as nominate other rotaractors to do the same.\n\n','https://www.instagram.com/p/CGFxy5nghRd/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-12-September-kuqzk','2020-09-21 00:00:00.000000','2020-10-15 00:00:00.000000','Parwaah','CS','17','2','0','A project undertaken by the RRRO of the club as a Tree Plantation with sponsoring Rotary club of Pune Lokmanyanagar. In order to create better bonding with the Rotarians and encouraging them to share their planting achievements from the lockdown time at home. \n','-','1',0,'611556e79e9e454db666fd2832ee1131'),('E-12-September-LXdqh','2020-09-23 00:00:00.000000','2020-09-23 00:00:00.000000','Introduction to Sign language','PD','12','10','0','We RAC 