212'),('E-12-September-TFYIu','2020-09-16 00:00:00.000000','2020-09-16 00:00:00.000000','COVID-19 Combat Kit Donation Drive','CM','15','8','0','Rotaract Club of Patalganga organized and completed a community service Project - \"COVID-19 Combat Kit Donation Drive\" in association with Rotary Club of Patalganga.\nAmidst the coronavirus outbreak, masks, sanitizers, face shields and hand gloves have become an essential part of our lives. Thus, Rotaract Club of Patalganga in association with Rotary Club of Patalganga pledged and donated;\n\n1.	Hand Sanitizers and Face shields to 50 Autorickshaw drivers and street vegetable vendors in premises of Mohopada.\n2.	9 PPE Kits to Mohopada Grampanchayat for Asha workers and Anganwadi workers. \n\nThe project was completed in the presence of President and few directors from the board of Rotary Club Of Patalganga.','https://www.instagram.com/p/CFUsHLlBW2-/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-13-August-avVmu','2020-08-23 00:00:00.000000','2020-09-23 00:00:00.000000','Nexus 6.0: Sales a life skill','PD','45','2','0','Nexus 6.0: Sales a life skill\nPDD\n-Nexus 6.0 was conducted by speaker Prasad Ganpule focusing on the topic of sales.\n-The speaker shared insights on some of the following points: -\na) General selling on daily basis\nb) Techniques in selling and growing business professionally\nc) How to be interested in a customer rather than being interesting\nd) How to sell attributes and develop personality\n-The session was attended by more than 45 participants','https://www.instagram.com/p/CE_2c34gD3v/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-13-August-BSmCf','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer: Remember Why You Started ','CS','76','26','0','On the occasion of National Sports Day, we co-hosted an interactive session with RC Global Youth, MMRCPK, RC Humanitas, RC Pune Camp Next Gen,  \nRCPIT, RC UBS, RC Gurugram Mid-West wherein the Captain of the Indian Womens Rugby Team Ms.Vahbiz Bharucha talked about Rugby, her past \nexperiences, life lessons and her journey to becoming the captain of the Indian Womens Rugby Team. Apart from that, we also conducted two sports themed Club Service activities for all the participants, namely Family Feud and Solve the Riddles. Family Feud was an unusual quiz where the participants had to guess the most popular answers given by the majority of the public whereas in Solve the Riddles the participants had to guess the sport by solving the riddles given to them. This was a WR event as well.\n','https://www.instagram.com/p/CFB-RfeANMS/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-13-August-f1N0x','2020-08-22 00:00:00.000000','2020-09-01 00:00:00.000000','\"Ganpati Festival (22 Aug - 1 Sep 2020) \"','CS','15','0','0','\"We asked our members to put a story of welcoming Bappa in their house, \non their Instagram And \ntag \n@rotaractclubofalumni\n\"\n','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-13-August-hJBe6','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','Rotaract Col. 1.0 KICK START YOUR FITNESS JOURNEY','CM','110','10','0','Health and fitness is the most important aspects in ones life. Keeping this in mind, Rotaract club of Patalganga conducted their second webinar of Rotaract Colloquium 1.0 on Kick start your Fitness journey by Ms Vaibhavi Kamath, for the Rotarians as well as Non-Rotaractors. The speaker is a Certified Fitness trainer, has worked with Cult Fit, has trained 70+ people, and has her own youtube channel.\nIn collaboration with 20 other clubs, we successfully hosted this event. More than 110 participants from various clubs marked their presence.\nThe session was very essential in this pandemic situation. The President of our club gave introduction about the speaker. The Speaker started the session by sharing her own fitness journey of losing 18 kg. She signified the importance of fitness in ones life, gave tips for beginners, shared common dos and donts, checked facts and busted myths. It was followed by Question and answer session. Speaker answered many queries raised by the participants.','https://www.instagram.com/p/CD1ghaeBxqK/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-13-August-HywQP','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer','CS','12','24','0','After the session, for increasing the bonding, all the participants were involved in various activities and games. ','https://www.instagram.com/p/CEWPclCgutj/?igshid=malfmtqikr7a','1',0,'611556e79e9e454db666fd2832ee1158'),('E-13-August-kBsKe','2020-08-21 00:00:00.000000','2020-08-21 00:00:00.000000','Facing The Violence 2.0','IS','0','0','0','On the 21st August 2020, the international Day of Remembrance and tribute to the Victims of Terrorism, we had joint bulletin which included various aspects related to terrorism. This joint bulletin was with RC Bombay Uptown, RID 3141 along with other 15 Clubs of various districts.','-','1',0,'611556e79e9e454db666fd2832ee1163'),('E-13-August-MRTMU','2020-08-20 00:00:00.000000','2020-09-10 00:00:00.000000','Stride with pride phase 2 ','IS','20','2','00','Walking distance was measured through an app and that specific amount we walked daily was used for social cause, amount was decided on the per km , this was collaboration event with RC COASTAL LEGACY RID 3232','-','1',0,'611556e79e9e454db666fd2832ee1133'),('E-13-August-NYLne','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Success Mantra','CM','9','10','0','1. 40000 students watched and got guidance for SSC\n2. 225+ schools attended the event\n3. Collaboration with Flagship event of Rotary Club of Pune Yuva,  Supermind & Radio 95 BIG FM\n4. Education Minister HON. Varsha Gaikwad motivated all.\n5. DG Rtn. Rashmi Kulkarni blessed the event with her presence.\n6. Dr. Shakuntala Kale HEAD OF SSC BOARD were present for the event.\n7. RJ Bandya of 95 BIG FM was present.\n','https://www.ins