lf towards Leadership ','PD','10','1','0','About the Event (few lines)- Insights about Leadership,jointly with  RC Panvel Central3131','-','1',0,'611556e79e9e454db666fd2832ee1171'),('E-13-August-sS8pQ','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer','CS','45','72','0','We, MMRCPK in Collaboration with RC Global Youth, RC Pune Camp Next Gen, RC Pune Camp Pioneers, RC Humanitas, RC UBS, RC PIT and RC Gurugram Midwest (RID 3011) Organised a Professional development, Women\'s representative & Club Service Event \"CONQUER\" where our Guest speaker was Vahbiz Bharucha.She is a physiotherapist by profession and a Rugby Player by vocation. She herself as an intimidating player on the field. We invited her to talk about her experiences, life lessons and way forward. The event was followed by a fun-filled Club Service games','https://www.instagram.com/p/CFJ7rYuASwm/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-13-August-WRBei','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','Redesign your Life','PD','9','2','0','RC Pune Kalyani nagar in collaboration with RC Global Youth and 7 other clubs organised a PD session on dealing with crisis and managing opportunities.\nIn collaboration with RC Pune Kalyaninagar, Vedanta Pune, RC UBS, RC Aundh, RC Pune Royal, RC AIMS Pune, RC Bibwewadi, RC RSCOE, RC Pimpri, RC Pune ganeshkhind.\nDay & Date : Thursday, 13th August 2020\nAvenue : A PD initiative.','https://www.instagram.com/p/CEPLjSTgCrN/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-13-August-XPyMQ','2020-08-15 00:00:00.000000','2020-08-19 00:00:00.000000','Chef de patatas ','CS','6','20','210','On account of International Potato day , we Rotaract Club of Pune Zenith successfully conducted a cooking competition; \"Chef de patatas\", with a total of 21 entries which means 21 different recipes. All the amazing chefs made various sweet and savoury recipes out of potato which are published in our bulletin.','https://www.instagram.com/p/CEJLCxagBLh/?igshid=1fkf2kixpr0du','1',0,'611556e79e9e454db666fd2832ee1143'),('E-13-August-yF5bQ','2020-08-30 00:00:00.000000','2020-09-30 00:00:00.000000','Sponsoring Rotary Installation Ceremony','CS','5','2','0','The Installation Ceremony of Rotary Club of Pune Mid-East was carried out on 30th August 2020. The chief guest at the ceremony was Assistant District Governor Rt. Dinkar Palaskar. The ceremony was attended by our President Rtr. Kedar Kadam, Secretary Rtr. Sanket Nagpure, Vice President Rtr. Pranav Tukshetti, Treasurer Rtr. Akanksha Wagh, and Rtr. Rishabh Parkhe. The ceremony went flawlessly. Introduction of the BOD\'s was given by Secretary Rtn. Suhas Chavan. The present and past Presidents and Secretaries spoke about their plans and the involvement of youth in their plans. President Rtn. Romesh Gupta spoke about the four Rotary Areas of Focus that he is going to work primarily on. RC Pune Mid-East\'s club bulletin \"MIST\" was released. AG Rtn. Dinkar Palaskar also gave his views about the project plans and also assured the active involvement in the activities of the club and helping Rotaractors in our projects as well. Lunch after the ceremony was organized.','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-13-September-1ocgQ','2020-09-23 00:00:00.000000','2020-09-23 00:00:00.000000','Whimsical Wednesday - Deaf Awareness','CS','32','2','0','A PR initiative to spread awareness about the Deaf. A thoughtful initiative to sensitize the youth about the disabilities existing amongst us in order to ensure better dealing capacity in them.','https://www.instagram.com/p/CGK-zXngvxo/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-13-September-3LT1K','2020-09-29 00:00:00.000000','2020-09-29 00:00:00.000000','World Heart Day','CM','1','1','0','Spread Awareness about Cardiovascular disease through our Instagram Post.','https://www.instagram.com/p/CFuA2UAAg5q/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1127'),