urce Person Prof William Kuskin from the University of Colorado Boulder. In collaboration with RC VIIT, RC Pune Pristine, RC DPU, RC Pune Ganeshkhind. Attended by 11 RCGY members. \n\n','https://www.instagram.com/p/CGAt8BygjEz/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-14-September-N2EFj','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','HEALTH IS REAL WEALTH','IS','10','1','0','Initiated by Rotaract Club of Roha RID 3131 The speaker was MR PRASHANT ANCHAN SIR. This session was a brief guide and helped us solve all our questions regarding Health insurance. The key points that were covered - health insurance, benefits of Health Insurance, Career in Health Insurance.','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-14-September-Ngnms','2020-09-18 00:00:00.000000','2020-09-18 00:00:00.000000','Use of Physiotheraphy in Day To Day Life','PD','50','22','0','Hosted this session on use of physiotheraphy in collaboration with Rotary Club of Pune Camp wherein the speaker, Dr. Akshata Nalawade guided the \nparticipants with all the remedies and precautions one needs to take in order to protect their joints and muscles. She also shared few exercises which one can do at home to avoid any injuries and to stay fit. This was a RRRO event as well, as we co-hosted this event with our sponsor rotary club, Rotary Club of Pune Camp.\n\n','https://www.instagram.com/p/CGF0nV0Af8T/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-14-September-pdjkn','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Blush it up','PD','10','5','0','We Rotaract club of Pune Zenith on 26th September 2020 successfully conducted a PD session BLUSH IT UP by Ms. Vidhi Oswal. We learnt different techniques for- Professional Makeup, Elegant Makeup, Skin care routine, Product choice and much more. The event was successfully carried out with an attendance of 60+ Rotaractors. ','https://www.instagram.com/p/CFrwy27ARjN/?igshid=wpe6gddxrh45','1',0,'611556e79e9e454db666fd