','On 27th August We Rotaract club of DYPIMS collaborated with Rotaract Club Of DYPACS who took the initiative to organize a PD session on  Being Mentally Healthy During Pandemic. .The speaker for the session was DeepaliBedi. She has 15+ years experience in Psychology Field. She is qualified Clinical Psychologist with RCI recognized degree in M.Phil.\nIn this session the points covered by the speaker were  how to keep brain stable, what are the main symptoms of depression. She also explained the importance between ME and WE time. The session was very knowledgeable.\n','https://www.instagram.com/p/CEdumFZgqCv/?i gshid=s54h21un63ip','1',0,'611556e79e9e454db666fd2832ee1129'),('E-15-August-HC5rU','2020-08-28 00:00:00.000000','2020-08-28 00:00:00.000000','Virtual Ganpati Bappa Aarti','CS','28','2','0','Virtual Ganpati Bappa Aarti\nCSD\n-The E-Aarti was an initiative taken by Rc Pune Warje and Rc Aundh.\n-One rotaractor from Rc Pune Warje showcased their Aarti and Rtr Janvi Motwani from rc Aundh showcased her ganeshas Aarti.\n- The event was attended by almost 17 rotaractors from Rc Aundh.\n-The total strength from both the clubs was about 28 members.\n-It was followed by informal introduction and dumb charades.\n','https://www.instagram.com/p/CFFncc9ABFS/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-15-August-hGWzy','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','Independence Day Hoisting','CM','9','2','0','RC Global Youth along with its sponsoring Rotary Club of Pune Lokmanyanagar visited Yerwada Jail for the flag hoisting on the occasion of the 74th Independence Day of India.\nParticipation by our CMD  Rtr Ajay Ghotkule \nDay & Date : Saturday 15th August 2020\nAvenue : A Community Service initiative.','https://www.instagram.com/p/CEPMASIAI0j/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-15-August-KMySM','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','Unity in Diversity','CS','24','4','0','India\'s beauty is in its diversity and we pledge to uphold its integrity and sovereignty. To give this message of unity in diversity, Rotaract Club of Patalganga took an initiative to wish everyone Happy Independence day in diverse languages of India.','https://www.instagram.com/p/CD6ddxhBWju/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-15-August-MGP5J','2020-08-30 00:00:00.000000','2020-09-30 00:00:00.000000','The Red Woman','CM','15','72','12194','Under the project of The Red Woman, we, Rotaract Club of Pune Mid-East conducted our first donation drive of Sanitary Pads and Awareness Campaign.We donated packages of sanitary pads to 60+ underprivileged women who could not afford to buy them and were completely unaware of it. These women were using unhealthy alternatives like cloths and cottons. Each sanitary pad package contained 10 sanitary pads with 10 paper disposable bags and one instruction pamphlet printed in native Marathi language.Members wore masks and were provided with gloves. Each one had their own sanitizer in case of emergency. All safety measures were taken into consideration for Covid-19 situation.\nTotal funds rose until now  12,194 INR \nPlatform used  Milap.org','https://www.instagram.com/p/CEmYIjlgB3q/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1212'),('E-15-August-ml7Sx','2020-08-29 00:00:00.000000','2020-09-29 00:00:00.000000','Project Humanity Phase 2 - Project Cure','CM','12','10','0','\"Giving is not just about making a donation, it\'s about making a difference\"\nWith the Covid situation on the rise and the medical facilities having a rather difficult time providing beds for critical patients, we, Rotaract Club of Pimpri aided our Parent Rotary on their Pancham Project Cure.\nThis project, which aims in providing around 2000 beds to Covid Isolation centers in and around Pune, is a Rotary District RID 3131 event.\nRotaract Pimpri is proud to donate 25 beds for the noble cause. The beds will be recycled and donated to orphanages around Pune once the pandemic situation is neutralised. This is part of the Project Humanity which was launched by our IPP DZR Rtr. Aniruddha Burkule.','https://www.instagram.com/p/CEyPs3lg9ZN/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-15-August-u7TLV','2020-08-22 00:00:00.000000','2020-09-01 00:00:00.000000','Ganpati Drawing and Decoration Photography Contest','IS','6','4','0','We RaC Laxmi College of Optometry conducted contests on Ganpati Drawing and Decoration Photography Competition in between the days of  Ganesha, from Ganesh Chaturthi to Anant Chaturdashi. More than 30 people were participated in this contest. We also gave the certificates to all the participated members. ','https://www.instagram.com/p/CEopgb9Aozp/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-15-August-yawS7','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Success Mantra','CM','6','10','0','1. 40000 students watched and got guidance for SSC\n2. 225+ schools attended the event\n3. Collaboration with Flagship event of Rotary Club of Pune Yuva,  Supermind & Radio 95 BIG FM\n4. Education Minister HON. Varsha Gaikwad motivated all.\n5. DG Rtn. Rashmi Kulkarni blessed the event with her presence.\n6. Dr. Shakuntala Kale HEAD OF SSC BOARD were present for the event.\n7. RJ Bandya of 95 BIG FM was present.\n','https://www.instagram.com/p/CEkDi0fgYBx/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-15-September-1pDYR','2020-09-29 00:00:00.000000','2020-09-29 00:00:00.000000','World Heart Day ','PD','15','2','00','Pd session on the occasion on world heart day with RAC GNIET','https://www.instagram.com/p/CF0DHfeAfFj/?igshid=12ynsv38izyuo','1',0,'611556e79e9e454db666fd2832ee1133'),('E-15-September-2lhLv','2020-09-26 00:00:00.000000','2020-09-27 00:00:00.000000','1st Environmental E-RYLA','IS','350','96','0','We had a E-RYLA with Rotary Club of Pune Kothrud with other 3 Rotary Clubs. \nMMRCPK had our First Environmental E-RYLA.\nA PDD++CMD+ISD+RRRO event altogether at one platform along with our Sponsoring Rotary Club - Rotary Club of Pune Kothrud.\nWe had different sessions on different topics in these 2 days. \n','https://www.instagram.com/p/CFw3Vkkgax1/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-15-September-axqja','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','A session on Inner Peace','PD','6','5','0','On the occasion of World Peace Day, our club members attended a session on Inner Peace which was conducted by Rotaract District 3131 along with  Rotaract District 3080. The speaker, Dr. Virat Chirania covered topics like Desktop Yoga postures, tendencies of inner peace and ways to find balance and keep ones sanity intact.\n\n','-','1',0,'611556e79e9e454db666fd2832ee1201'),('E-15-September-EZSVu','2020-09-01 00:00:00.000000','2020-09-30 00:00:00.000000','Myths and Folktales of the World','IS','2','4','0','Initiated by Rotaract Club of Rotaract Club of New Kingston, RID 7020 The idea would be to record the readings of traditional folklore from your country and send them to us for us to play at different story time sessions for various Earlyactors throughout the month of September. \nOur video-\nhttps://drive.google.com/folderview?id=1NkAuWkfLZDFpbEhhunJ0JcAwWfaQOqGX','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-15-September-H3rZN','2020-09-23 00:00:00.000000','2020-09-23 00:00:00.000000','Action Speaks Louder','PD','80','2','0','Action Speaks Louder\n-RC Pune Zenith along with RC Indira College and RC Aundh and 4 other clubs arranged a session on sign language day on topic of action.\n-The speaker Mr. Richard Sigamani gave insights on \na) sign language etiquettes.\nb) Deaf culture\nc) How to sign English alphabets\nd) Controversial sign language\n- Later all the CSD activities were taken in all 80 members attended the meeting and played dumb charades along with 30 members from each club .','https://www.i