ues for- Professional Makeup, Elegant Makeup, Skin care routine, Product choice and much more. The event was successfully carried out with an attendance of 60+ Rotaractors. ','https://www.instagram.com/p/CFrwy27ARjN/?igshid=wpe6gddxrh45','1',0,'611556e79e9e454db666fd2832ee1143'),('E-16-August-BKJir','2020-08-07 00:00:00.000000','2020-08-07 00:00:00.000000','Youth Exchange Move','PD','18','3','0','We RC DYPIMS along with Rotary Club of Pune Sunrise and Rotary Club of Pune Kalyani Nagar jointly hosted and Presented  Bachpan Ki Yaadein on 7th August 2020.\n                  In this event the presentation on Rotary Youth Exchange Program was given by RYE Director  Rtn. Ashok Bhandari and Zonal Chair Rtn. Mukesh Gupta. Rtn Vishnu Subang Dist. 3300 from Malaysia also spared some time and shared his insights. President Rtn. Bharat Patil(Rotary Club of Pune Sunrise), President Rtn . Megha Sharma(Rotary club of Pune Kalyani Nagar), Rtn Karan Tyagi, Secretary Rtn. Dr.Simran Jethwanigraced the occasion by their amazing Anchoring. \n','https://www.instagram.com/p/CD_LJG3AdyH/ ?igshid=1tuxiw153zuxo','1',0,'611556e79e9e454db666fd2832ee1129'),('E-16-August-EpPRl','2020-08-24 00:00:00.000000','2020-08-26 00:00:00.000000','Fearless talk','CM','60','36','00','WR INITIATIVE,  ICEBREAKING WAS DONE On the occassion of Women\'s Equality Day','https://www.instagram.com/p/CEODWoWgOJ5/?igshid=1tska4d0pq84m','1',0,'611556e79e9e454db666fd2832ee1133'),('E-16-August-nQO6f','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','The Pimpri Hour #2  Israel with Rtr. Caio Lombardo','PD','18','2','0','Second session of The Pimpri Hour, conducted by Rtr. Utkarsh Khinvasara, who did a college semester abroad in Israel. He talked about Israel with Rtr. Caio Lombardo from RaC Lisboa Belem, who is Economics Graduate and Banker by profession. Topics covered were the impression of Israel to the foreigners, Tel Aviv  the start up capital, travelling and night life in Israel, the food, Jerusalem, the conflicts and current covid situation. This was a very interesting discussion over the culture of Israel.','https://www.instagram.com/p/CEtguNbg4s5/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-16-August-OwP42','2020-08-16 00:00:00.000000','2020-08-16 00:00:00.000000','Emoji charades','CS','10','1','0','We RaC Laxmi College of Optometry did our another funny CSD event were we wanted to guess the name of the movie by just looking at emojis and sing song of that movie  is that simple as that. The event was awesome and all members and BOD\'s were enjoyed lot.','https://www.instagram.com/p/CEKLViFAjj9/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-16-August-pDzYy','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','S.A.G.A','PD','700','2','0','RC Global Youth along with RC Pune Kalyaninagar organised a live PD session on Sexuality and Gender Acceptance by resource person Ashutosh Shankar who is a member of the LGBTQ community, who talked about his life and experiences in the society \nHosted by Rtr Harshada Shinde\nIn collaboration with RC Pune Kalyaninagar\nDay & Date : Thursday 20th August 2020\nAvenue : A PD and PR initiative.','https://www.instagram.com/p/CEPMWeKAt0E/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-16-August-trNcT','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','Computer Vision Syndrome: Webinar','PD','8','2','0','A webinar on \"Computer Vision Syndrome\" by Ms Shruti lad who works as a tutor at Laxmi college of optometry and heading a vision therapy department at Laxmi eye institute, Panvel. Was organised & hosted by Rotaract club of Laxmi College of optometry.\n  Our club, Rotaract club of Patalganga along with 13 more clubs like RC Panvel, RC Pune Pristine, RC Khopoli, RC mid-east, RC Ahmedabad Midtown and many more successfully co-hosted this webinar.\nMore than 150 participants from various clubs marked their presence. This session was very essential in this pandemic situation. The speaker signified the various points of computer vision syndrome such as- \n What is CVS?\n Causes\n How it can be corrected?\nThe webinar was an interactive session and speaker answered many queries raised by the participants.','https://www.instagram.com/p/CEHocUaBquO/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-16-August-Xuw2z','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Charter Day celebration','CS','16','6','0','On 22nd August 2020 , Rotaract club of Pune Zenith completed it\'s 1 year in the Rotaract Family. The Charter Day celebration was carried out on Sunday, 23rd August 2020. The celebration began with fun CSD activities like Group Juggle and Screaming Toes . All the charter members shared the experiences about their journey in Rotaract. We also inducted 3 new members in our club. We ended with aCake Cuttingceremony followed by HomemadeFellowships brought by our own dear Rotaractors. It was indeed a fantastic evening wherein we Zenithians had a great time and everyone bonded well.\n','https://www.instagram.com/p/CERr-nWgtUd/?igshid=7977ygyyr2tg','1',0,'611556e79e9e454db666fd2832ee1143'),('E-16-August-YUV7F','2020-08-30 00:00:00.000000','2020-08-30 00:00:00.000000','Success Mantra','CM','10','10','0','1. 40000 students watched and got guidance for SSC\n2. 225+ schools attended the event\n3. Collaboration with Flagship event of Rotary Club of Pune Yuva,  Supermind & Radio 95 BIG FM\n4. Education Minister HON. Varsha Gaikwad motivated all.\n5. DG Rtn. Rashmi Kulkarni blessed the event with her presence.\n6. Dr. Shakuntala Kale HEAD OF SSC BOARD were present for the event.\n7. RJ Bandya of 95 BIG FM was present.\n','https://www.instagram.com/p/CEkDi0fgYBx/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-16-August-ZIrh6','2020-08-30 00:00:00.000000','2020-09-30 00:00:00.000000','The Wall of Dog','CM','16','2','21141','The Wall of Dogs\nCMD\n-The event started at about 3:30 pm.\nThe members of Rc Aundh and FTOB gathered together.\n-The event was initiated by both the organisations introduction followed by the BODS introduction.\n-Later the food was filled into small containers and was distributed into all cars.\n-Each car had 30 containers and in all 110 containers of food was donated to almost 115 dogs in various parts of Pune.\n- The total amount raised for the event was Rs. 21141/-\n','https://www.instagram.com/p/CFFo-9lgE1e/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-16-September-34d4H','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Masti Night ','CS','18','3','0','A Fun Filled Activity  for bonding with the club members! The event entailed a round of Dumb Charades wherein members from Iraq and Sri Lanka  were also present amongst us and had a gala time. ','https://www.instagram.com/p/CF5YPJ7gzug/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-16-September-7F17J','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','INNER PEACE','PD','12','2','0','On the Occasion of World Peace Day Rotaract Club of Pune Mid-East along with Rotaract District 3080 conducted a session on Inner Peace. The session was a joint PD+ISD Initiative. The session was delivered by Dr. Virat Chirania who is a Tedx speaker, Senior International AOL faculty and a Life Coach. The session covered some very amazing topics like- Brief on Dekstop Yoga Postures, Tendencies of inner peace as finding inner peace in the modern times is a significant challenge and the session provided us insights which can help maintain balance and keep our sanity intact.  The session witnessed more than 220 participants from various districts, and Dr. Virat gave lot of Peaceful vibes and enhanced everyones inner sanity','https://www.instagram.com/p/CFeOPNqAOXE/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-16-September-C8Y8q','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Blood Donation camp','CM','5','20','0','We, Rotaract Club of Pune Zenith organized our very first Safe Blood Donation Camp on 27th Sep, 2020 at Jankalyan Raktapedhi, Sarasbaug Road. The camp started at 10am and ended at 5pm. We are very proud to inform you that we collected 15 blood units which can save up to 30 lives. The camp was also attended by Dist. CMD Rtr. Sattyajeet Karale Patil.','https://www.instagram.com/p/CFvxVdUgePW/?igshid=16lbq4agsk5m','1',0,'611556e79e9e454db666fd2832ee1143'),('E-16-September-eWLhj','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Rising Pride','PD','110','48','0','Joint Club - RC Camp Horizon with other 18 clubs from our district and other than our district also.\nAn interview Session with Rahul Malde and Sushank Chibber (GAY INSPIRATION).\nWe also had a ice breaking game after the Session. It was a fun time with everyone. ','https://www.instagram.com/p/CFw6V7yAVK5/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-16-September-gr23X','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','A session on Inner Peace','IS','6','5','0','On the occasion of World Peace Day, our club members attended a session on Inner Peace which was conducted by Rotaract District 3131 along with  Rotaract District 3080. The speaker, Dr. Virat Chirania covered topics like Desktop Yoga postures, tendencies of inner peace and ways to find balance and keep ones sanity intact.\n','-','1',0,'611556e79e9e454db666fd2832ee1201'),('E-16-September-q9oEL','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','1 Minute Fitness by Rotaract','CS','24','3','0','Rtr. Siddhesh Bhojane enlightens viewers by the means of official instagram handle of Rotaract club of Patalganga about the exercising the bicep muscles in an elaborate, without gym equipments by improvising with household items.','https://www.instagram.com/p/CFWfHvEBJCy/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-16-September-woqau','2020-09-25 00:00:00.000000','2020-09-25 00:00:00.000000','Join Rotaract ','CS','0','1','0','Join Rotaract \nMDD/PR\n-The join rotaract initiative was taken by the MDD.\n-For this flyer and message was made.\n-The message had all the information about rotaract and pros of joining the club.\n-The flyer also depicted the focusing points of the club in a creative manner.\n-This initiative proved to be quite helpful as 5 new prospective were added.\n','-','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-17-August-6sfhp','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','Birthday Peek-a-boo (Rtr Tanya)','CS','29','1','0','A personally curated video by the club service directors for the club members is rolled out on their birthdays with a theme related to their profession. ','-','1',0,'611556e79e9e454db666fd2832ee1131'),('E-17-August-A23zx','2020-08-27 00:00:00.000000','2020-08-27 00:00:00.000000','Being Mentally Healthy During Pandemic','PD','40','2','00','Pd session on being mentally healthy during pandemic','https://www.instagram.com/p/CEV5bL7goyC/?igshid=185rzrty5m1wk','1',0,'611556e79e9e454db666fd2832ee1133'),('E-17-August-acuKP','2020-08-22 00:00:00.000000','2020-08-22 00:00:00.000000','Radio Interview with RJ BANDYA OF 95 BIG FM','CM','1','1','0','Radio Interview of SECRETARY RTR. HRISHIKESH KULKARNI with RJ BANDYA OF 95 BIG FM ','https://www.instagram.com/tv/CEkETr8AiN1/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-17-August-F1dXZ','2020-08-26 00:00:00.000000','2020-08-26 00:00:00.000000','Liberating Womanism','IS','10','4','0','We Rotaract Club of Pune Zenith along with Rotaract club of Samaritan, Rotaract club of Silver city Mohali and 19 other clubs organized a session on \"LIBERATING WOMANISM. The session effectively put a light on the unnecessary stereotypes followed till date and what all changes are needed to be achieved.\n','https://www.instagram.com/p/CEZvsqfg_GS/?igshid=1m737cwg51hns','1',0,'611556e79e9e454db666fd2832ee1143'),('E-17-August-kKPWl','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','The Pimpri Hour #2  Israel with Rtr. Caio Lombardo','IS','18','2','0','Second session of The Pimpri Hour, conducted by Rtr. Utkarsh Khinvasara, who did a college semester abroad in Israel. He talked about Israel with Rtr. Caio Lombardo from RaC Lisboa Belem, who is Economics Graduate and Banker by profession. Topics covered were the impression of Israel to the foreigners, Tel Aviv  the start up capital, travelling and night life in Israel, the food, Jerusalem, the conflicts and current covid situation. This was a very interesting discussion over the culture of Israel.','https://www.instagram.com/p/CEtguNbg4s5/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-17-August-LzkWE','2020-08-01 00:00:00.000000','2020-08-01 00:00:00.000000','Truth and Dare','CS','12','3','0','THE PROJECT  TRUTH OR DARE  WAS HELD ON 13TH JULY. IT WAS AN UNOFFICIAL CSD EVENT OF ROTARACT CLUB OF LAXMI COLLEGE OF OPTOMETRY ALONG WITH ROTARACT CLUB OF PUNE PRISTINE WHICH WAS CONDUCTED BY CSD OF RESPECTIVE CLUBS RTR. PAYAL SEN AND RTR. UTKARSH DAVE. THE AIM BEHIND THIS EVENT IS TO STRENGTHEN OUR BONDS BY INTERACTION AND TO UNDERSTAND EACH OTHER. MEMBERS FROM BOTH THE CLUBS HAD SHOWN LOT OF ENTHUSIASM AND ENERGY. THE EVENT WAS OF TWO DAYS. WE PLAYED THE GAME WITH SOME INTERESTING TRUTHS AND DARES. IN THE OF PRESENCE 24 MEMBERS FROM BOTH THE CLUBS, THE EVENT WAS TAKEN TO A NEXT LEVEL AND THE PARTICIPATION OF EACH AND EVERY MEMBER MADE THE EVENT EVEN MORE MEMORABLE.','-','1',0,'611556e79e9e454db666fd2832ee1126'),('E-17-August-Pegl1','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','Youth Skill Day','IS','21','3','0','ON 12th AUGUST,2020 WE RC-DYPIMS  DONE WITH THE EVENT \"YOUTH\'S MOVE\"  ON THE OCCASSION OF \"INTERNATIONAL YOUTH DAY\" WITH THE AIM OF \"YOUTH ENGAGEMENT IN GLOBAL ACTION.   \nTHE EVENT WAS HOSTED BY ROTARACT CLUB OF BADULLA AND ROTARACT CLUB OF XALLITIC\nTHE EVENT WAS ORGANIZED UNDER THE INITIATIVE OF RTR. GAURAV AGRAWAL (COMMUNITY SERVICEDIRECTOR, RC-DYPIMS) ALL THE CLUB MEMBERS ACTIVELY TOOK INITIATIVE IN THIS EVENT.\nTHE EVENT WAS VERY IMPACTFUL AND HELPFUL FOR THE PARTICIPANTS AS WELL AS SOCIETY. EVERY CLUBS AND MEMBERS TOOK ACTIVE INITIATIVE IN THE SESSION.\n','https://www.instagram.com/tv/CEUKXeHguun/?i gshid=3swss3367h57','1',0,'611556e79e9e454db666fd2832ee1129'),('E-17-August-XV9Wi','2020-08-22 00:00:00.000000','2020-08-24 00:00:00.000000','We Celebrate','CS','24','6','0','Rotaract Club of Patalganga on the occasion of Ganesh Chathurti conducted a CSD\nactivity of sharing the art, shlok and sharing the pictures of the Bappa on the\ninstagram mentioning our Club with a hashtag #wecelebrate, the shared pictures were highlighted on the story of the official club instagram handle.\nMany members participated and shared their creativity on the occasion of Ganesh Chathurti.','https://www.instagram.com/p/CER3E-sh8KN/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-17-September-A6IOn','2020-09-11 00:00:00.000000','2020-09-21 00:00:00.000000','New Roots Around The World','CM','11','20','0','Our club actively participated in a global tree plantation drive held by the Rotaract Club of Itapolis, Brazil. This tree plantation drive was conducted in light of the recent Amazon wildfires and aimed at compensating for the environmental loss in these wild fires. The target given was to plant at least 5 trees but our club planted a total of 11 trees. For this, we also received a special appreciation certificate from the Rotaract club of Itpolis, Brazil. Adding to this, we also successfully completed their twin club criteria for which again we revived a twin club recognition.','https://www.instagram.com/p/CGF2xEYg1hy/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-17-September-ARh18','2020-09-25 00:00:00.000000','2020-09-25 00:00:00.000000','FINANCIAL AWARENESS PROGRAM','PD','40','2','0','Rotaract Club of Pune Mid-East along with Rotary Club of Pune Mid-East presented a digital program on Financial Awareness by Board of Industry Academia Partnership (BIAP). BIAP is a youth organization and aims to create a platform that promotes and enhances the collective potential of students, the industry and academia and helps bridge the gap between Industry and Academia. The session was delivered by Mrs. Priyanka Acharya, who has completed her Mcom, MMS in Financial management and is currently into learning and development. Mrs. Priyanka provided us with a lot of insights about the financial matters, cleared out misconceptions about investors and created awareness on how to be financially safe. The session was attended by 40+ participants and ended with an amazing knowledge point:- Financial Meditation','https://www.instagram.com/p/CFhZfrJAIva/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-17-September-cNg4G','2020-09-27 00:00:00.000000','2020-10-07 00:00:00.000000','Hot Mess','CS','20','2','0','An event by the WR of the Club which entails making a special dish from any country for a woman of the house as an appreciation gesture. ','-','1',0,'611556e79e9e454db666fd2832ee1131'),('E-17-September-eGsOd','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','The Idea of India','PD','50','12','0','The Idea of India webinar emphasis on the current political scenario and the role that youth plays in it.\nSpeaker for the webinar was Mr. Fahad Ahmad he is Social Activist, TedX Speaker, Senior Research fellow (PHD), General Secretary TISS- SU 2017-18, Influencer under 39- mid day 2018.\nWebinar was hosted by our club Rotaract club of Patalganga with collaboration of RC DYP ACS, RC DYPIEMR, RC Alibag Seashore, RC AIT, RC Panvel Central, RC Shaniwarwada.\nMore than 50 participants joined the webinar it was interactive session followed by the Q&A at the end of webinar. Speaker gave the brief idea about role of youth in current Indian politics and answered all the question asked by the participants.','-','1',0,'611556e79e9e454db666fd2832ee1160'),('E-17-September-oeSLE','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Rising Pride','IS','110','48','0','Joint Club - RC Camp Horizon with other 18 clubs from our district and other than our district also.\nAn interview Session with Rahul Malde and Sushank Chibber (GAY INSPIRATION).\nWe also had a ice breaking game after the Session. It was a fun time with everyone. ','https://www.instagram.com/p/CFw6V7yAVK5/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-17-September-Una0e','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Dog Feed Drive 4.0','CM','20','5','0','Dog Feed Drive \nCMD\n-RC Aundh along with FTOB has taken an initiative to feed on an average 200+ dogs daily and collaring of about 100 dogs.\n-On Sunday both the organisations carried out donations at various localities like SPPU, Old Sangvi, Vishrantwadi, Kondhwa, Pimpale Gurav, Pimpale Nilakh, Lohegaon and Aundh.\n-The event was volunteered by about 15 Rotaractors and various Volunteers from FTOB.\n-It was a great experience for both the organisations to carry out this noble work.','https://www.instagram.com/p/CF0NdUVgT9T/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-17-September-xV5zV','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Cultural Exchange','IS','12','2','0','We Rotaract Club of Pune Zenith in collaboration with : Rotaract Club of Pune Prestine, Rotaract club of Pune Sinhgad Road, Rotaract Club of Sahel Metn and Rotaract Club of Cacique Baruta had successfully conducted a cultural exchange program beyond the boundaries on 27th September 2020 (Sunday). It was a fun filled evening wherein we conducted various ice breaker sessions, sang songs and showcased our culture in the form of PPT.','https://www.instagram.com/p/CFzULbug4IF/?igshid=1dx86oaszddyy','1',0,'611556e79e9e454db666fd2832ee1143'),('E-18-August-5J84I','2020-08-22 00:00:00.000000','2020-09-01 00:00:00.000000','Ganpati Darshan and Aarti','CS','16','48','0','This year, Rotaract Club of Pimpri organised an in house Ganpati Darshan for our Rotaractors. \nWe were hosted by our Rotaract club members in their respective homes to come witness the celebration of Ganpati Bappa and join in togetherness as we pray for everyone\'s health and safety. \nDelcious sweets and warm house puja was something which made each of us happy in this difficult times.','https://www.instagram.com/p/CEtLjPBgfJz/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-18-August-ArnWA','2020-08-22 00:00:00.000000','2020-09-22 00:00:00.000000','Go-Green with Ganesha','CM','24','18','0','The project Go Green with Ganesha aimed of to promote eco friendly practices during Ganpati celebrations, it also promoted awareness and understanding about spiritual and cultural practices during the festival. We contacted various artists who utilize eco friendly means (clay & paper mashe) for making the idols, so as we would be provide the devotees with alternatives.\nCelebrating the festival in an eco friendly way can help avoid adverse effect on environment\nEco friendly Ganesh festival promotes to preserving the city water bodies and environment\nMaking people aware about issues of environment degradation occurred during Ganesh festival encourage people to adopt environment friendly celebration of this festival.','-','1',0,'611556e79e9e454db666fd2832ee1160'),('E-18-August-c26sM','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Black Ribbon Day','CS','20','1','0','RC Global Youth curated an Awareness campaign in light of Black Ribbon Day in memory of the victims of Nazism and Stalinism. \nCurated by Rtr Vidisha Nayak (Editor, RCGY)\nDay & Date : Sunday 23rd August 2020\nAvenue : A PR & Editors initiative.','https://www.instagram.com/p/CFOpzG3gKb4/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-18-August-E7Rbe','2020-08-26 00:00:00.000000','2020-08-26 00:00:00.000000','Liberating Womanism','PD','10','4','0',