00000','2020-08-12 00:00:00.000000','Decoding Job via LinkedIn','PD','24','1','0','  Mr.Gaurav is member of Global Host Community at LinkedIn and Head Organizer of LinkedIn Local Kolhapur Chapter which believes in networking and building meaningful connections. He will be with us to clear our doubts on how to find jobs on LinkedIn? How to increase *360 connections* ? *Self-branding* on LinkedIn?\nSo lets work on our network.','https://www.instagram.com/p/CEcAQ81A34N/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-2-August-fT21D','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Finding your Ikigai','CS','','','','Speaker Rajitha Vipparthi will give a talk about how to find your Ikigai, and share her experience with choosing a career as well. ','','2',0,'8c865236269d494aa157d2f4474cae02'),('E-2-August-fyxSq','2020-09-12 00:00:00.000000','2022-05-14 00:00:00.000000','Book Club','PD','','','','Weekend sessions to be conducted for book clubs','','2',0,'611556e79e9e454db666fd2832ee1149'),('E-2-August-G0oHY','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','SWOT Workshop','PD','49','2','0','In the journey of life, self-knowledge is one of the most important assets one can possess. We all set goals and strive to achieve them, but it\'s not always that we\'re able to gain a clear picture of circumstances surrounding them, whether they\'re a hindrance or help. SWOT (Strengths, Weaknesses, Opportunities and Threats) analysis is an important tool that can help us uncover those. Rotaract Club of Amanora Youngistan, along with Rotaract Club of Pune Camp Next Gen RID 3131 and Rotaract Club of Guzelyali RID 2440, our PAO Rtr. Akshay Ghatol, organized a workshop about SWOT analysis. Participants were walked through an exercise of the SWOT analysis regarding a specific goal they had in mind and made to uncover the Strengths, Weaknesses, Opportunities and Threats concerning them. It was followed by an illuminating round of Q&A from the participants.\n','https://www.