020-08-08 00:00:00.000000','2020-08-08 00:00:00.000000','Law of corporate sucess.','PD','17','1','0','It was a collaborated event with RC Pune mid-east,tje event was a session based on law of corporate sucess by Mrs. Snehal Sarkar.','https://www.instagram.com/p/CE6YHWvg51d/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1152'),('E-2-August-LcmuJ','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','INDEPENDECE DAY POTLUCK','CS','8','6','0','We had an Independence Day Potluck on 15th August 2020. Members brought homemade Misal Pav, Vada & Jalebi. The venue was a serene farm house and it was a very refreshing meet after a long lockdown break.','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-2-August-M1B9L','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Parvarish','PD','25','2','0','We RAC Modern College GK initiated this project \"Parvarish\" for our sponsor Club Rotary Club of Pune Uptown, in which a team of rotaractors from our club will Volunteer to help our sponsor club to make their social presence.','https://www.instagram.com/p/CErjulkA-pf/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-2-August-MjKQb','2020-08-03 00:00:00.000000','2020-08-03 00:00:00.000000','Beyond the Boundaries','CS','25','72','0','We MMRCPK had an event named \"Friendship beyond boundaries\" on the occasion of Raksha bandhan.\nWe did this project with three other countries. They are Costa Rica, Brazil and Venezuela.\nWe also had Cultural exchange with them. In that ,We learnt about different regions people, food, language, customs.\nIn short we built enduring friendship with the people around the globe.','https://www.instagram.com/p/CEGf_J-Aj4T/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-2-August-mrlDD','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','AABHAR','CS','1','1','0','The project Aabhar was an initiative of Rotaract Club of Silver City Mohali. RC Patalganga was in collaboration for this project. Aabhar as the name suggests to thank. The project aimed to express gratitude to the Rotaract leaders for the work they had done for the society and the organisation. The clubs in collaboration were required to express gratitude to at least one Rotaract leader who is an epitome of inspiration, motivation and guidance, by just making a call, video call, online card posters, hand gifts, cooking for them or by giving flowers or in any way of expressing gratitude. Rtr Mohammad Shayan Usmani, President, Rotaract Club of Patalganga, participated and completed the project by expressing gratitude through a text message to the IPP Rtr Anil Kumar Saini, Immediate Past Secretary Rtr Siddhesh Bhojane and Immediate Past Treasurer Rtr Sorubasona Harikrishnan, the senior most members of the club for being crusaders of every situation.','-','1',0,'611556e79e9e454db666fd2832ee1160'),('E-2-August-msKvi','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','RCSDH- Online Chess Tournament','CS','','','','A online chess tournament would be conducted on Lichess application were we would invite other Rotaracters and Rotarians and we would share the link and password accordingly','','2',0,'611556e79e9e454db666fd2832ee1197'),('E-2-August-MUCMJ','2020-08-02 00:00:00.000000','2020-08-08 00:00:00.000000','Friendship Week','CS','18','30','0','This pandemic it cannot stop us from making new bonds and hence we, Rotaract club of Pune Zenith celebrated the friendship week from 2nd August 2020 to 8th August 2020 with 6 different clubs from India and abroad. A fun filling week with talks, joint e-meetings, ice breaker games, music and much more. The 6 clubs joining us were  Rotaract club of Chunakkam (Srilanka), RAC E-Club of greater Nigeria, RC Kota Central, Rotaract Club of Banashankari, RAC Sukedhara, Rotaract Club of Grand Baie (Mauritius).','https://www.instagram.com/p/CDvqiOSgF-G/?igshid=ntnzdctx8dl7','1',0,'611556e79e9e454db666fd2832ee1143'),('E-2-August-N04ei','2020-08-06 00:00:00.000000','2020-08-08 00:00:00.000000','knot the tree','CM','15','12','0','this event was an initiative to protect the trees. keeping the idea of rakshabandhan this was carried out. in this we tied rakhi to trees to take care of it. Rotaractors tied knots and clicked pictures with the trees to help spread awareness for it. ','-','1',0,'0fd27714b7994a42a0fd4166cc094505'),('E-2-August-N5Wcw','2020-08-03 00:00:00.000000','2020-09-08 00:00:00.000000','CHOLO SOBUJ MAKHI 3.1','IS','6','6','0','Initiated by- Rotaract Club of Geetanjali Kolkata. RID 3291.It was a tree plantation drive where we were required to send 6 pictures of 6 different plantation. Then make a collage of these pictures along with club logo mentioned on it. As there\'s a global pandemic going on the plantation can be done in your home, residential gardens or terrace.','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-2-August-OOL0F','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Serenity Peace of Mind','PD','50','100','0','SERENITY, Peace of Mind workshop was conducted by Rota facts in collaborations with ART OF LIVING FOUNDATION. In this workshop total 7 DISTRICTS,11 CLUBS AND 3 NGOs were participated.','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-2-August-oQ1tK','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Paw-Fi','PD','9','3','0','RC Global Youth along with RC Pune Salisbury Park & RC Koregaon Park had a cheery and fun filled weekend with a digital scavenger hunt and soulful PD session on fauna & their selfless friendship. Resource person Mrs Vijaya Tecksingani who is an author, a poetess and loves animals and supports various organisations meant for their welfare.\nDay & Date : Sunday 2nd August 2020\nAvenue : A PD & Club Service initiative.','https://www.instagram.com/p/CDcPznZA25h/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-2-August-oVwrJ','2020-08-03 00:00:00.000000','2020-09-03 00:00:00.000000','Rakshabandhan ','CM','5','1','0','We celebrated Rakshaba