ending members.','https://www.instagram.com/p/CDySgXLAfih/?igshid=1gsixg3jsnggr','1',0,'611556e79e9e454db666fd2832ee1213'),('E-2-August-sP62l','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Cycling ','CS','','','',' we are participating in a cycling event with Pune cantonment','','2',0,'611556e79e9e454db666fd2832ee1165'),('E-2-August-T9uo0','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Club Bonding Activity','CS','','','','Plannig for the scanvanger hint to enhance the team bonding and put efforts towards team building','','2',0,'eb9670d295cc4f6e929bdf0c2e29fddf'),('E-2-August-taEfd','2020-08-01 00:00:00.000000','2020-08-31 00:00:00.000000','The Red Woman','CM','','','','We, Rotaract Club of Pune Mid-East are coming up with a Sanitary Napkin donation drive project named \'The Red Woman\';. In this project we will be spreading awareness in the society regarding Menstrual Cycle and so breaking the Tabboo in the society while keeping up with the donations. ','','2',0,'611556e79e9e454db666fd2832ee1212'),('E-2-August-tLiJu','2020-09-06 00:00:00.000000','2020-09-27 00:00:00.000000','Caring Connections','CM','','','','Sometimes life is tough, and not everyone has a listening ear for their problems. This project is aimed to correct that with the help of our parent Rotary Club - Rotary Club of Amanora. There will be anonymous sessions where participants can vent and talk about their troubles to volunteers from Rotary Club of Pune Amanora. It is a year long project and has the potential to help plenty of people through mental and emotional support. Each slot will consist of maximum 5 people and our 2 counselors.','','2',0,'611556e79e9e454db666fd2832ee1162'),('E-2-August-Ty2Lc','2020-08-02 00:00:00.000000','2020-08-08 00:00:00.000000','Fellows Amity','IS','150','72','0','We did this event in collaboration with RC Soch (RID 3080), RC Coimbatore Main (RID 3201), RC Hosur (RID 2982) and RC Sahyadri Pashan (RID 3170)','https://www.instagram.com/p/CDOopq9AGiy/?igshid=f4awqiiellqq','1',0,'611556e79e9e454db666fd2832ee1158'),('E-2-August-tZOoz','2020-08-08 00:00:00.000000','2020-08-08 00:00:00.000000','Keynotes with Keagan','CS','12','2','0','The speaker for the evening, Mr. Keegan Pereira, a creative director by profession, inspired us with his experience from screen writing to becoming a creative director. We had a fun ice breaker session as well after the PDD session to interact with all the participating clubs!','https://www.instagram.com/p/CDoctdoAFHS/?utm_source=ig_web_copy_link','1',0,'8c865236269d494aa157d2f4474cae02'),('E-2-August-U10fN','2020-08-23 00:00:00.000000','2020-09-23 00:00:00.000000','PD session - Signature analysis','PD','11','3','0','Conducted a joint PD session on signature analysis by Ms Shweta Jha followed by an ice - breaker session which was hosted by \nRC Poona ROyal in collaboration with RC shaniwarwada , RC mideast , RC Universal Business school , RC kalyaninagar , RC alumni','https://www.instagram.com/p/CEOzN5kA9xM/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1167'),('E-2-August-U5JkE','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Project Ecobandhan','IS','7','1','0','On the occasion of Rakshabandhan, Rotaract Club of Pune Renaissance collaborated with Project EcoBandhan by Team Meraki on 2nd August, 2020 \nProject Meraki is a District Project of RID 3012 which aims at spreading awareness about plastic outbreak and shares steps of reusing and reducing plastic at individual level.\nOn the occasion of Rakshabandhan, Team Meraki initiated Project Ecobandhan that promotes making biodegradable rakhis instead of the plastic rakhis, and later growing them into beautiful plants to preserve our bond.','https://www.instagram.com/p/CEBQh0aAa67/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-2-August-udh9D','2020-08-16 00:00:00.000000','2020-09-16 00:00:00.000000','Bonding Activity Rotaractors vs Dare','CS','18','3','0','In this event, Rotaractors were asked to choose a number and they had to perform a dare associated with the number.','','1',0,'eb9670d295cc4f6e929bdf0c2e29fddf'),('E-2-August-VO66H','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Talk about PCOD','CM','40','2','0','This event is hosted by rotaract club of dypims.','-','1',0,'611556e79e9e454db666fd2832ee1132'),('E-2-August-w2ubJ','2020-08-05 00:00:00.000000','2020-08-05 00:00:00.000000','Stress Management by Pratik Surana','PD','35','2','0','Stress Management\nRRRO/PDD\n-This session was conducted under RRRO initiative & PDD initiative focusing on the topic of stress management.\n-The session was conducted by speaker Dr. Pratik Surana.\n-The three main topics covered in the session were:\na) Impact of emotions on product\nb) How to be emotionally stable during difficult times.\nc) The time ahead.\n-Rtr. Akash Gaikwad was appointed as the host and anchor of the session.\n-The session was attended by more than 35 participants including 17 rotaractors.\n','https://www.instagram.com/p/CDj6m7pg_mN/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-2-August-xNxTn','2020-08-08 00:00:00.000000','2020-08-08 00:00:00.000000','E-Meeting with Rc Davim 3011','IS','10','1','0','We had a virtual meeting with Rc Davim 3011 where we got to know about the events they conducted and it was quite a bonding meet.','https://www.instagram.com/p/CEUe1HdA9HR/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-2-August-xRJRi','2020-09-14 00:00:00.000000','2020-09-21 00:00:00.000000','Shayari Competition','CS','','','','To find out the hidden talent between club members we have arranged Shayari Competition.','','2',0,'611556e79e9e454db666fd2832ee1166'),('E-2-August-Xt3ny','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Chalk Carving','PD','','','','Learning and Practicing the art of chalk carving.','','2',0,'611556e79e9e454db666fd2832ee1143'),('E-2-August-yaaxV','2020-08-03 00:00:00.000000','2020-09-03 00:00:00.000000','Rakhi- The Thread of Love','CS','6','2','0','We Rotaract Club of Laxmi College of Optometry hosted a zonal event within zone-1 RAKHI- THE THREAD OF LOVE on the occasion of Rakshabandhan. ','https://www.instagram.com/p/CEPUsKHA1_I/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-2-August-yf2Zv','2020-08-03 00:00:00.000000','2020-08-03 00:00:00.000000','RAKHEE - THE THREAD OF LOVE','CS','1','1','0','On 3rd August 2020, Rotaract Club of LCO hosted an event Rakhi: the thread of love, which\nwas also the first zonal event of Zone 1. Members from eleven clubs participated in making\nrakhis for their brothers. The event was organized by DZR Rtr. Tejal Naik and AZR Rtr.\nKedar Mitkari. Our Club member Ms Mitali Munot participated on behalf of Rotaract Club of\nPanvel Elite. All the eleven clubs participated enthusiastically which resulted in creative\nrakhis. We are thankful to the host club and we surely look forward towards more zonal\nevents.','https://www.instagram.com/p/CDbpvRXAEVA/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-2-August-YhK0D','2020-08-01 00:00:00.000000','2020-08-30 00:00:00.000000','TREE PLANTATION','CM','7','7','0','Trees planted by members','-','1',0,'611556e79e9e454db666fd2832ee1181'),('E-2-August-yROea','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Soul Science','PD','18','2','0','A PD session named as soul science hosted by Tehrin Shaikh our speaker in association with Life is Art. The session was an experience of a lifetime.','https://www.instagram.com/p/CDqXO6mAluv/?igshid=2dw9otbofnnj','1',0,'611556e79e9e454db666fd2832ee1174'),('E-2-August-YudVS','2020-08-08 00:00:00.000000','2020-08-08 00:00:00.000000','Rotaract Colloquium 1.0','PD','86','1','0','The event being in collaboration with RC Patalganga. It was led by Mr. Aditya Lele, law student at the Government Law College and founder of Bharat Bhagya Vidhata, channel over youtube. He discussed the concepts of Atmanirbhar Bharat and reduction of Chinese imports.','-','1',0,'611556e79e9e454db666fd2832ee1150'),('E-2-August-zOekN','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Oblivion','IS','50','10','0','This event was organised on 2nd August 2020 on the occasion of friendships day. Various national and international clubs were a part of this occasion. The speaker Mr. Shabaz Khan beautifully explained the meaning of friendship and the changing facets of friendship in the times of social and virtual media. He also explained the changing expectations of millennias from the concept of friendship','https://www.instagram.com/p/CDypzaXg6SU/?igshid=htmhvaqi410r','1',0,'611556e79e9e454db666fd2832ee1169'),('E-2-August-zPn7P','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Club Bonding Activity','CS','34','2','0','On the occasion of Friendship Day, we arranged a small activity\nto increase the bonding between the Board Of Directors and\nClub members.\nThis activity started with the Introduction of the Board of Directors\nand new club members.\nAfter the introduction, there was a fun rapid-fire session in which\nevery club members actively participated.\nIn the end, some of the club members flaunt their talent by\ndoing Shayaris and Poems on friendship.','https://www.instagram.com/p/CDYrnzFAn-A/','1',0,'611556e79e9e454db666fd2832ee1166'),('E-2-August-zsO1V','2020-08-02 00:00:00.000000','2020-09-22 00:00:00.000000','ECO BAPPA','CM','14','1','0','*\'Eco - Bappa\' an Eco friendly Ganesha festival celebration 2020* initiated by @thedreamforlifefoundation in collaboration with @matrix_warriors & @rc_dpu\nLet\'s welcome Ganeshji with Home made Eco-friendly Decoration,follow the tutorial given above \nHappy learnings!!\nWe hope you all will create your own beautiful decoration','https://www.instagram.com/tv/CDyo0k0gjOG/?igshid=1er45z0iol6qu','1',0,'611556e79e9e454db666fd2832ee1196'),('E-2-September-0C9f3','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Inner peace','PD','290','3','0','The session covers:\n Brief Desktop Yoga Postures\nThe participants will get an insight into tendencies of inner peace.','https://www.instagram.com/p/CFZ3nsBgPUf/?igshid=10hue214pwi24','1',0,'611556e79e9e454db666fd2832ee1197'),('E-2-September-0dEUi','2020-09-04 00:00:00.000000','2020-09-04 00:00:00.000000','Breast Cancer Awareness Event','PD','100','5','0','We Rotaract Club of Poona Royal along with Rotaract Club of Pune Hillside, Pune Renaissance and VIIT along with 17 collaborating clubs organized the WR session. The speaker Chaitanyanand Koppi created awareness on Brest Cancer its causes and preventive she also displayed a wide number of statistics of cases across the world and also demonstrated the self assissment techniques. This session was attended by 100+ girl rotaractors and it was a huge success.','https://www.instagram.com/p/CF6ffJsAgIr/?igshid=97ncovqtsk2j','1',0,'611556e79e9e454db666fd2832ee1169'),('E-2-September-0iuWo','2020-09-03 00:00:00.000000','2020-10-03 00:00:00.000000','Any Buddy Can Do 1.0','CS','15','2','0','Any Buddy Can Do 1.0\nMDD/PDD/CSD\n-ABCD was conducted in order to build bond and improve the public speaking skills of the members.\n- The session was conducted only for the club members.\n-Certain no of members were invited for the activity in order to focus on each member.\n- ABCD 1.0 had 15 members participating in the events who were all the newbies of our club.\n-The activity had two rounds wherein the first round was about talking about any product near you for one minute and in the second round A team of two members was made where in they were given one minute to interact with each other personally and in the next 45 seconds the two of them had to introduce each other.\n- Later some unofficial conversation took place between the members and certainly everyone had a great time.\n','https://www.instagram.com/p/CFz-XR0A9jL/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-2-September-2T5ua','2020-1