 everyone was given a chance to share there story of harrassment.','https://www.instagram.com/p/CFmT-WxgjU9/?igshid=yk9ghc9yzaxo','1',0,'611556e79e9e454db666fd2832ee1152'),('E-2-September-6CjyG','2020-09-13 00:00:00.000000','2020-09-27 00:00:00.000000','Empty D\'Closet','CM','8','0','0','Collected clothes from across Pune city and donated them to 2 orphanages and 2 old age homes.\nFinal collection count was 1000 ITEMS OF CLOTHING.','-','1',0,'611556e79e9e454db666fd2832ee1183'),('E-2-September-8ejFI','2020-10-10 00:00:00.000000','2020-10-10 00:00:00.000000','InJoy (Saturday game night)','CS','','','','Internal bonding event in which fun activities will be conducted. ','','2',0,'611556e79e9e454db666fd2832ee1152'),('E-2-September-Ag8pC','2020-09-08 00:00:00.000000','2020-10-01 00:00:00.000000','Project AAINA','PD','0','72','0','Jointly with RID 3012 ( Initiated by RC Vision Institute, RID 3012)\nIt\'s a ongoing project, which we will continue for the coming months.\nIt is a Project under the Rotary Focus Area: Basic Education and Mother and Child Health:PROJECT AAINA. An initiative to spread sex education, remove the myths and taboos in the society, and change the mindset of people!\nWe are doing this project on Social Media to spread the awareness about sex education. ','https://www.instagram.com/p/CFwTDM-Awyz/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-2-September-BQYfq','2020-09-06 00:00:00.000000','2020-09-09 00:00:00.000000','Ready to Revolutionise','IS','6','2','0','\"Knowing yourself is the beginning of all wisdom\" Says, Aristotle.. \nAnd to know oneself, one needs support of one such person who can really guide us to realise the best out of us! And none other than Shri Braj Mohan Das Ji can encourage and enlighten our inner self. The Rotaract Club of Panvel Central organized a Grand Talk: \"Ready to Revolutionise\" were we are in collaborated with them.','https://www.instagram.com/p/CE09jmXA6ML/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-2-September-C2wOY','2020-09-08 00:00:00.000000','2020-09-08 00:00:00.000000','Role of Rotaractors in Literacy Mission','IS','14','8','0','On occasion of World Literacy day, RCP Urja hosted the event \" Role of Rotaractors in Literacy Mission\" along with  RaC Itahari (RID 3292) along with co-host RaC Noida youth(RID 3012), RaC Bhubaneshwar(RID 3262) and collaboration with 35 Rotaract Clubs organized an International Webinar where delegates from each country spoke about Rotary Literacy mission in their respective countries and role of rotaractors in this mission.','https://www.instagram.com/p/CE1TswEgXMR/?igshid=1q6rh850yfwje','1',0,'611556e79e9e454db666fd2832ee1151'),('E-2-September-CzKWb','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Knowing About Beauty Standards And Mental Health','PD','90','2','0','We collaborated for a PD and ISD session on 13th September, 2020 on Knowing About Beauty Standards and Mental Health conducted by Natural is Beautiful Foundation, NiB, initiated by Rotaract Club of Pune Royal. We also had an icebreaker session where all the collaborating clubs CSDs and 90+ members participated in it and had a joyous session. ','https://www.instagram.com/p/CFJNrRIgJFR/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-2-September-Di1Lh','2020-10-03 00:00:00.000000','2020-10-03 00:00:00.000000','Sanitizers and Mask Donation','CM','4','4','0',' On the date of 3rd September, Rotaract Club of Pune Mid-East along with our sponsor rotary, Rotary Club of Pune Mid-East visited Poona Hospital. Poona hospital had a section for covid centre. We donated 50 masks and 5Ltr of hand sanitizer. This is the sensitive time where people should reach out to help each other while taking precautions.  Hospital staff was very happy with our initiative as this was considered as essential need of the time in COVID-19 situation. Also it was a memorable experience for club members to reach out and help the volunteers who are fighting against COVID-19 situation. ','https://www.instagram.com/p/CEuL6tEAaDN/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-2-September-dm9Sq','2020-09-14 00:00:00.000000','2020-09-14 00:00:00.000000','Hindi Diwas quiz','CS','70','24','0','Quiz on the Hindi language conducted on the story of Instagram handle and announced the winner on the next day ','https://www.instagram.com/s/aGlnaGxpZ2h0OjE3ODUzMjc5MjY5MjM4NDU5?igshid=1iqzkuunah85z&story_media_id=2397843849327185512_8695258746','1',0,'611556e79e9e454db666fd2832ee1184'),('E-2-September-ECCm2','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Ready to Revolutionise','PD','100','3','0','Ready to Revolutionise was a joint event with Rotaract Club of Panvel Central, It was conducted by Shri Braj Mohan Das Ji. It was the Grand Talk by His Holiness on living life.','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-2-September-ePath','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000','presentation: a dynamic skill ','PD','5','15','0','The session encompassed different things which are required in the making and dynamic delivery of a successful presentation - by Prof. William Kusk','-','1',0,'611556e79e9e454db666fd2832ee1181'),('E-2-September-f7qhf','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000',' The Olive Branch ','IS','1','1','0','-','https://www.instagram.com/p/CFZpNCng1HP/','1',0,'611556e79e9e454db666fd2832ee1166'),('E-2-September-fGe2F','2020-10-11 00:00:00.000000','2020-10-11 00:00:00.000000','Mental Health on World mental health we','PD','','','','In this event there will be two sessions one will be about art therapy which will be delivered by Ms. Spriha Mukherjee and second session will be about Clownselling which will be delivered by Ms. Sheetal Agarwal','','2',0,'eb9670d295cc4f6e929bdf0c2e29fddf'),('E-2-September-g4EfP','2020-10-10 00:00:00.000000','2020-10-10 00:00:00.000000','Suicide prevention day','CM','2','1','0','World Suicide Prevention Day (WSPD) is an awareness day observed on 10th of September every year in order to provide worldwide commitment and action to prevent suicides. Let\'s talk about suicide. An initiative by Rotaract Club of Nigdi, RID 3131','https://www.instagram.com/p/CE8t7Pfg8Th/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-2-September-Gc86E','2020-10-06 00:00:00.000000','2020-10-12 00:00:00.000000','Shameless ','CM','12','0','0','We Made a Video on Shameless song by Famous Youtuber Prajakta Kohli. It was initiated by Club Women\'s Representative Rtr Vaishnavi Saraf,\nwhere we made videos on body shaming for girls (our aim of making that video was to make people understand that it does not matter whatever shape size color a girls is you should respect her \nand the Videos was edited by Club Secretary Rtr Tulna Gupta ','https://www.instagram.com/tv/CFBx5FDATxv/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1136'),('E-2-September-GR79h','2020-09-10 00:00:00.000000','2020-09-10 00:00:00.000000','Suicide Prevention Awareness Camp','CM','30','00','00','On the occasion of world suicide Prevention day (10 September )  we ran a Suicide Prevention Awareness drive on the Instagram initiative taken by the Rotaract Club of Nigdi.','https://www.instagram.com/p/CE7glTdgr5l/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1194'),('E-2-September-h90xq','2020-09-11 00:00:00.000000','2020-09-11 00:00:00.000000','Debate Competition','CS','6','3','0','Rotaract Club of Pune Zenith, along with it\'s sibling clubs participated in a Debate competition organized by the Parent Rotary club. The topics for the debate were GDP and Love marriage vs Arrange Marriage. We, not only participated in the competition but bagged 3 out of 4 prizes.','-','1',0,'611556e79e9e454db666fd2832ee1143'),('E-2-September-hCoyw','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','World Peace Day','','80','03','00','On The Occasion Of World Peace Day The Joint Event Was Arranged In Collaboration With Rotaract District 3131 And Rotaract District 3080 . The Real Meaning of Peace Was Explained in a Unique way.  ','-','1',0,'611556e79e9e454db666fd2832ee1146'),('E-2-September-HeBfF','2020-10-17 00:00:00.000000','2020-10-26 00:00:00.000000','KEMM CHOO','CS','','','','IT GONNA BE 10 DAYS EVENT IN WHICH EVERY DAY THEIR IS A NEW ACTIVITY','','2',0,'611556e79e9e454db666fd2832ee1196'),('E-2-September-HyppK','2020-10-11 00:00:00.000000','2020-10-22 00:00:00.000000','Gift a book','CM','','','','Collecting books which we will be donating to darode school','','2',0,'611556e79e9e454db666fd2832ee1167'),('E-2-September-Ij1sb','2020-10-10 00:00:00.000000','2020-10-10 00:00:00.000000','Content Writing ','CS','','','','to explore.','','2',0,'611556e79e9e454db666fd2832ee1162'),('E-2-September-K3qYm','2020-09-05 00:00:00.000000','2020-09-05 00:00:00.000000','Teacher\'s Day','CS','34','1','0','On the occasion of teachers day, the PR team introduced an activity to share a picture of your role model on Instagram and to tag the club to share their stories. As a teacher can wear many hats, that of a mother, professor, mentor, etc. \nA PR Initiative. ','https://www.instagram.com/p/CE36YkpggE-/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-2-September-KLPj8','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Art Beat','CS','14','28','0','Art beat was an Origami session wherein our own member were teaching us the art which was very joyful and due to which our bonding got stronger. Our ZRs were also there with us and we could also bond with tem.','https://www.instagram.com/p/CFpaubogWOW/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1158'),('E-2-September-MIt4y','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Braj Mohan Das','PD','12','2','0','Shri Braj Mohan Das is a monk, an IITian and a motivational speaker who provided insights on how to discover or revolutionize yourself on the basis of 5 basic principles of life. ','https://www.instagram.com/p/CFR-m_tg7yW/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-2-September-MRXCv','2020-09-07 00:00:00.000000','2020-09-07 00:00:00.000000','How To Be a News Anchor','PD','50','1','0','Most of the public is influenced and believes what the news channel telecasts. News anchors play a vital role in shaping the mind of people. This was a session conducted by Mr. Pankaj Ingole . He is a Freelance Journalist /TV Anchor and Director of Callidus International Media & Arts Academy. \n','-','1',0,'611556e79e9e454db666fd2832ee1150'),('E-2-September-mT0Vi','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Identify and Prevent Workplace Diseases','CS','31','4','0','Whether you are a student, entrepreneur or an employee of any domain, hazardous working condition brings numerous health risks. Dr. Sanat Kulkarni provided guidance on simple interventions that can be adopted by us to ensure occupational safety in any domain. This event was co-conducted by 6 clubs.','-','1',0,'8c865236269d494aa157d2f4474cae02'),('E-2-September-Ndg7v','2020-09-04 00:00:00.000000','2020-09-04 00:00:00.000000',' Breast Cancer Awareness','IS','96','240','0','It was an online event for girls, it was a session for spreading awareness of breast cancer, by CEO Of Prashanti Cancer care Mission Laleh Busheri took place on 4th September, under WR  CMD and ISD avenue.\nRCVIIT, Rotaract club of Hillside, Rotaract club of Poona Royal, and Rotaract club of Pune Rennaisance collaborated with 17 other clubs for this event.\nIT was a great session, got a huge response.','https://www.instagram.com/p/CEwVTjQgd7c/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-2-September-NSZUT','2020-09-05 00:00:00.000000','2020-09-05 00:00:00.000000','Teacher\'s Day celeberation','CS','20','2','0','Teacher\'s Day awareness was carried through Instagram stories.','https://www.instagram.com/rc_pune_heritage/','1',0,'611556e79e9e454db666fd2832ee1203'),('E-2-September-Nu9Jk','2020-10-02 00:00:00.000000','2021-05-31 00:00:00.000000','Adore India project ','CM','','','','We are planning to teach the needy by collaborating with Adore India ','','2',0,'611556e79e9e454db666fd2832ee1149'),('E-2-September-NxDW6','2020-09-05 00:00:00.000000','2020-09-05 00:00:00.000000','EXPRESS ','CM','9','1','0','RCVN started this small initiative to show gratitude for the guiding force, The Teachers in our lives.\n','https://www.instagram.com/p/CEzWojvAeou/','1',0,'611556e79e9e454db666fd2832ee1168'),('E-2-September-o502P','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','DRAWING KITS DISTRIBUTION','CM','5','6','0','The pursuit of knowledge provides for one of the most sublime experiences one can come across in life. It is a privilege, not just a capability, to read, write, articulate, think, draw, and express. We are introduced to different colours and are allowed to colour this world the way we like. It is one of the greatest treasures the human mankind is gifted with and we at Rotaract Club of Panvel Elite believe that every child should have access to the happiness and satisfaction one experiences when the hunger for learning is gratified.\nHence, the Rotaract Club of Panvel Elite organized a Drawing Book Donation project under the Goodwill Projects Initiative on 27th September 2020. We donated 100 drawing and colouring books, and 100 crayon sets to underprivileged children in Pen.','https://www.instagram.com/p/CF89AZRAkuL/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-2-September-OlQMC','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Feel To Heal','IS','22','4','0','This event was organised under Community Service Avenue by our CMD Rtr. Roshni Wadiwala, we collaborated with RC Mumbai Downtown, RC Calcutta Endeavour, RC Palmville, RC  Kelaniya. We invited Mrs. Shadi  Razavian to talk to us about ways to cope up with the anxiety and stress which the past few months of quarantine have brought. She helped us understand the importance of recognizing and accepting our emotions and the need to vent them out every now and then. At the end of the session we had an activity where we wrote letters to ourselves penning down all the negative emotions we\'ve fostered and then destroyed the letters. The aim of the session was to get members to connect with their inner selves and let go of all negativity. ','https://www.instagram.com/p/CE1NXvdA4he/?igshid=1y0rvod8e77sr','1',0,'611556e79e9e454db666fd2832ee1213'),('E-2-September-OUoF3','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Uphaar','IS','7','3','0','On the occasion of Hindi diwas, poetry competition was conducted jointly with Rotaract club Chandigarh Midtown (rid 3080)','https://www.instagram.com/p/CFKn5Mmg2Ad/?igshid=1akphw0n63v67','1',0,'611556e79e9e454db666fd2832ee1171'),('E-2-September-OURYf','2020-09-04 00:00:00.000000','2020-09-04 00:00:00.000000','Club Orientation ','CS','40','2','00','Club orientation with RSCOE','https://www.instagram.com/p/CEzP7hOgSxW/?igshid=1ww1qyuytpqqv','1',0,'611556e79e9e454db666fd2832ee1133'),('E-2-September-OuTkr','2020-09-11 00:00:00.000000','2020-09-11 00:00:00.000000','Suicide prevention - Stay connected Stay Alive ','PD','200','3','0','This was PD initiative on the occasion of world suicide prevention day. The speaker for the event was Ms. Keertisudha Rajput, Dr. Saroj Arya, Dr. Mohan Agashe, Ms. Sandy Andrade. The event was attended by 200+ people.','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-2-September-OXDhM','2020-09-08 00:00:00.000000','2020-10-08 00:00:00.000000','international literacy day','IS','0','0','0','Where our club released our very first joint bulletin in IS.','https://www.instagram.com/p/CE5Mh9GgSMu/?igshid=eqb27t3rj71y','1',0,'611556e79e9e454db666fd2832ee1162'),('E-2-September-OYFLT','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Club Assembly','CS','20','3','0','Club Assembly- Presentation of events and budget by all avenue directors. Club assembly was graced by DZR,AZR Zone 5 