 speaker encouraged girls to join the armed forces, explained special entry schemes for girls and cleared doubts and taboos regarding the same.\n\n','https://www.instagram.com/p/CFzVD7PAR4T/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-2-September-RrWVY','2020-09-10 00:00:00.000000','2020-09-10 00:00:00.000000','ANTAKSHARI','CS','10','0','0','ANATAKSHARI NIGHT ON THE OCCASSION SAA\"S BIRTHDAY','https://www.instagram.com/p/CE1SR9yA-mY/?igshid=mn909vqq2cb0','1',0,'611556e79e9e454db666fd2832ee1154'),('E-2-September-RZYEo','2020-09-14 00:00:00.000000','2020-09-14 00:00:00.000000','HINDI DIWAS','CS','346','0','0','All the senior BOD member participated and make a combined video and give a tribute to hindi diwas','https://www.instagram.com/tv/CFGnuXLgHBO/?igshid=h47rm10jyjdy','1',0,'611556e79e9e454db666fd2832ee1196'),('E-2-September-sf22B','2020-09-14 00:00:00.000000','2020-09-14 00:00:00.000000','Hindi Diwas - ummid ki udan','IS','49','8','0','Rotaract club of Pune Salisbury park along with 12 collaborating clubs initiated this event which inspired women across India to rediscover self-love on the occasion of Hindi Diwas through a heartfelt poem recitation.\n\nIGTV Link: https://www.instagram.com/tv/CFSHw2HgDUG/?utm_source=ig_web_copy_link.,','https://www.instagram.com/tv/CFSHw2HgDUG/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1172'),('E-2-September-STOte','2020-09-21 00:00:00.000000','2020-09-27 00:00:00.000000','Pick a rotaractor ','CS','17','7','0','We had organized a club bonding event for a week  between the members where we had paired them and then assigned some task for each day for one week. \nPoints were given for completing the task and the winner  with highest point was given a gift was given a gift card   .','https://www.instagram.com/p/CFh6vwaAw_M/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1167'),('E-2-September-tjazn','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Club Orientation','PD','16','3','0','