www.instagram.com/p/CE4bZq_A9lV/?igshid=1n0b646wcbvef','1',0,'611556e79e9e454db666fd2832ee1132'),('E-2-September-WXWaa','2020-09-19 00:00:00.000000','2020-11-02 00:00:00.000000','IPL Quiz','CS','14','10','0','in this IPL we conducting a quiz throughout the season. We will be posting Various Questions Regarding IPL teams so that our Fellow Rotaractor can brush up their Knowledge of IPL.','https://www.instagram.com/rc_modern_gk/','1',0,'611556e79e9e454db666fd2832ee1192'),('E-2-September-Z8NxZ','2020-09-12 00:00:00.000000','2020-09-12 00:00:00.000000','The Bull\'s Market','PD','5','6','0','Rotaract Club of Pune Hillside was in collaboration with RCSCOE, RC Warje, RC Kolhapur, RC Vizag city and RC united Alahbad and RC Surat East. The Speaker of the event was Nimesh Babariya, who spoke about share market  and investment.','-','1',0,'611556e79e9e454db666fd2832ee1155'),('E-2-September-zdDan','2020-09-12 00:00:00.000000','2020-09-12 00:00:00.000000','Cycling with Cantonment and Camp Next Gen','CS','15','3','0','Rotaract Club of Pune Camp Next Gen along with Rotaract Club of Cantonment went for a cycling ride as a CSD activity.','https://www.instagram.com/p/CFEGhtugV-y/?igshid=zrjj8m97mu09','1',0,'611556e79e9e454db666fd2832ee1174'),('E-2-September-ZN8fd','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Club Assembly','CS','21','2','0','Rotaract Club had it\'s Club assembly on 20-09-2020 via semi-virtual format most of BOD were present physically along with DZR, AZR, DISD  ','https://www.instagram.com/p/CFZ7tn8ghan/','1',0,'611556e79e9e454db666fd2832ee1140'),('E-20-August-09mlG','2020-08-23 00:00:00.000000','2020-09-23 00:00:00.000000','CLUB-BONDING SESSION','CS','16','3','0','In this session we played different games members of  council DZR (Adv.Tejal Naik) & AZR (Kedar Mitkari) of our zone -1 joined the session.\nWe first had an introduction for 10 mins, after that the members were divided in teams then we played a game called Guess the Gibberish where the member of the team had to explain the given sentence to his/her partner. Then we played a rapid fire round where the members had to answer maximum questions in 1 minute, the one who answered maximum was termed as the winner.','-','1',0,'611556e79e9e454db666fd2832ee1160'),('E-20-August-B4MLd','2020-08-26 00:00:00.000000','2020-08-26 00:00:00.000000','FE-MEN-IST','CS','25','2','0','In this prejudiced world, we all undergo a gender specific social pressure. There are a set of dialogues for girls and for boys which becomes very frustrating at times. On Women\'s Equality Day we, Rotaract Club of Pune Zenith came up with another event FE-MEN-IST where we got to hear the gender specific opinions and we will provided rebuttal to it on our Instagram story.\n','https://www.instagram.com/p/CEWDKFBgbDE/?igshid=ul72j0kgozj9','1',0,'611556e79e9e454db666fd2832ee1143'),('E-20-August-FApeq','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Self Discovery ','PD','12','2','0','The project SELF -DISCOVERY was hosted by our club RCLCO. The thought behind this project was DISCOVERING WHO YOU ARE TODAY IS THE FIRST STEP TO BEING WHO YOU WILL BE TOMORROW. MR.SYLVESTER JAMES was the speaker. The event was mainly focused on discovering ourselves and it helped all the participants to know our self better and become a better person.\nThis event was collaborated with other 5 clubs and 45 participants were present in this event.','https://www.instagram.com/p/CEec_TpAgVX/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-20-August-NcDvD','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer','PD','78','5','0','RC Global Youth along with 7 Rotaract clubs conducted an inspirational PD session by Vahbiz Bharucha. She is a physiotherapist by profession and a rugby player by vocation. She has led the Indian womens rugby team worldwide and has always made us proud. \nThe event was followed by fun-filled Club Service activities!\nIn collaboration with RC Pune Camp Next Gen, RC Pune Pioneers, MMRCPK, RC UBS, RC Humanitas, RAC PIT, RC Gurugram Midwest.\nDay & Date : Saturday 29th August 2020\nAvenue : A PD, WR & Club Service initiative.','https://www.instagram.com/p/CEhgF2DgNi4/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-20-September-07jRn','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Health Insurance Webinar','IS','90','15','0','Collaborated with ROTALAND and 20+ clubs from various districts for this session on Health Insurance which was conducted by Mr. Prashant Anchan who has 13+ years experience in Insurance industry. He covered topics like types of Insurance, benefits of Insurance and opportunities in this sector.\n','https://www.instagram.com/p/CGF3NSKAju8/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-20-September-VhVz8','2020-09-29 00:00:00.000000','2020-09-29 00:00:00.000000','Prevention of sexual harassment at work','PD','40','48','0','Joint Club - Rotary Club of Pune Kothrud\nA PD session on Prevention of Sexual Harassment at Work.\nThis event was conducted by Adv. Sayali Dabake.\nShe talked about the Sexual Assault Law and enlightened us with the power of women\'s voices. She discussed about the cases happened everytime in a firm, institute or anywhere.\nIt was a PDD+RRRO+WR event. ','https://www.instagram.com/p/CFxGojqgNH4/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-21-August-BKaK5','2020-08-01 00:00:00.000000','2020-08-27 00:00:00.000000','Seed Ball Project','IS','25','5','0','Rotaract club of Pune Zenith completed the SEED BALL PROJECT in collaboration with RAC Latur midtown by bombing more than 5000 seed balls. Seeds were collected from 13th July to 30th July of various fruits and vegetables and mixed up with soil to make small balls which were thrown at various places. (From 1st august onwards)','https://www.instagram.com/p/CEj9zY4AJVe/?igshid=wdhgbi8u50x4','1',0,'611556e79e9e454db666fd2832ee1143'),('E-21-August-e2RA1','2020-08-30 00:00:00.000000','2020-08-30 00:00:00.000000','Club Assembly','CS','24','4','0','Club Assembly in the presence of the assigned panel for the discussion of the club\'s administration and bylaws, Followed by a discussion of the annual budget and avenue wise plan presentation. ','https://www.instagram.com/p/CE7Wj97gp1v/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-21-August-YOOyn','2020-08-25 00:00:00.000000','2020-08-26 00:00:00.000000','ROTANOVATION','PD','18','12','0','Rotaract club of Patalganga co-hosted a PDD-CSD event named Rotanovation for the Rotaractors. It was a two-day event in which there were CSD activities conducted on the first day and PDD event on the second. In this event, all the members from different club who participated were teamed up randomly. There were a total of 13 groups consisting 3 to 4 members per group. Each group were allotted with a time frame of 12 hrs wherein all the pairs have to come up with an MVP of a sustainable event which can be organized at an Inter-club level before lockdown ends. \nThe Judging panel consisted of all the presidents from various clubs. The team with best idea and best presentation won! \nRC Pune Yuva in collaboration with 3 clubs, which are RC MITCON, RC Pristine, RC Patalganga successfully co-hosted this event. More than 40 Rotaractors participated in the competition.\nThe session was a Core Professional Development event which covered all the professional aspects.','https://www.instagram.com/p/CEYrlfYBkpH/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-21-September-TEuBi','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000','Health and Hygiene Talks','PD','34','24','0','Collaborated with Learning Resource Center, Pune for this session on Health and Hygiene Talks which was conducted by Dr. Manjeet Sudade. She guided the female senior citizens on ways to maintain good health and hygiene in this pandemic situation. The speaker also shared some exercises which will help the senior citizens stay fit. After this session, Antakshari was conducted so that the attendees could bond with each other. This was a WR event as well.\n\n','https://www.instagram.com/p/CGIFSPMASer/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-21-September-TUgxR','2020-09-23 00:00:00.000000','2020-09-23 00:00:00.000000','Action Speaks Louder','CS','30','2','0','Action Speaks Louder\n-RC Pune Zenith along with RC Indira College and RC Aundh and 4 other clubs arranged a session on sign language day on topic of action.\n-The speaker Mr. Richard Sigamani gave insights on \na) sign language etiquettes.\nb) Deaf culture\nc) How to sign English alphabets\nd) Controversial sign language\n- Later all the CSD activities were taken in all 80 members attended the meeting and played dumb charades along with 30 members from each club .','https://www.instagram.com/p/CGBC3veABA_/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-22-August-csWE5','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Conquer','CS','78','5','0','RC Global Youth along with 7 Rotaract clubs conducted an inspirational PD session by Vahbiz Bharucha. She is a physiotherapist by profession and a rugby player by vocation. She has led the Indian womens rugby team worldwide and has always made us proud. \nThe event was followed by fun-filled Club Service activities!\nIn collaboration with RC Pune Camp Next Gen, RC Pune Pioneers, MMRCPK, RC UBS, RC Humanitas, RAC PIT, RC Gurugram Midwest.\nDay & Date : Saturday 29th August 2020\nAvenue : A PD, WR & Club Service initiative.','https://www.instagram.com/p/CEhgF2DgNi4/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-22-August-zR5km','2020-08-25 00:00:00.000000','2020-08-26 00:00:00.000000','ROTANOVATION','CS','18','12','0','Rotaract club of Patalganga co-hosted a PDD-CSD event named Rotanovation for the Rotaractors. It was a two-day event in which there were CSD activities conducted on the first day and PDD event on the second. In this event, all the members from different club who participated were teamed up randomly. There were a total of 13 groups consisting 3 to 4 members per group. Each group were allotted with a time frame of 12 hrs wherein all the pairs have to come up with an MVP of a sustainable event which can be organized at an Inter-club level before lockdown ends. \nThe Judging panel consisted of all the presidents from various clubs. The team with best idea and best presentation won! \nRC Pune Yuva in collaboration with 3 clubs, which are RC MITCON, RC Pristine, RC Patalganga successfully co-hosted this event. More than 40 Rotaractors participated in the competition.','https://www.instagram.com/p/CEYrlfYBkpH/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-22-September-LgaR1','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Digital Investors Awareness .','CS','65','2','0','PDD/CSD\nDigital Investors Awareness .\n-RC Aundh along with RC VIIT in collaboration with BIAP conducted a session on Digital Investors Awareness\n- Speaker Mr Sarvottam Rege gave his insights on how to build a strong foundation of financial literacy that can help support various life goals such as saving for education or retirement, to run a business etc.\n-He also gave insights on the upcoming opportunities in the share market.\n-Later a fun session of dumb charades was taken to build bond between both the clubs.','https://www.instagram.com/p/CGAl-16AgC1/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-22-September-VXKbx','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000','Health and Hygiene Talks','CS','34','24','0','Collaborated with Learning Resource Center, Pune for this session on Health and Hygiene Talks which was conducted by Dr. Manjeet Sudade. She guided the female senior citizens on ways to maintain good health and hygiene in this pandemic situation. The speaker also shared some exercises which will help the senior citizens stay fit. After this session, Antakshari was conducted so that the attendees could bond with each other. This was a WR event as well.\n\n','https://www.instagram.com/p/CGIFSPMASer/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-23-August-TauXP','2020-08-26 00:00:00.000000','2020-08-26 00:00:00.000000','Equality has no Gender','CS','24','6','0','Rotaract Club of Patalganga executed an activity, Equality has no gender to celebrate Womens Equality day on 26th August, 2020. \nIndividuals (Rotaractors & others) were asked to share content (i.e posters, drawings, quotes, photos, thoughts, articles, etc) related to gender equality which was later shared on the clubs official Instagram handle. \nWe received an overwhelming response for this activity.','https://www.instagram.com/p/CEW4u2Ph4Nf/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-23-September-d9SMv','2020-09-08 00:00:00.000000','2020-09-08 00:00:00.000000','Career in Armed Forces','CS','77','2','0','Career in Armed Forces\nPDD/CSD\n-RC Pune Camp Pioneers along with RC Aundh, RC Patalganga and RC Yuva Next came up with a session on how to build career in armed forces by Capt. Tanuja Kabre.\n-Each one has a dream of serving to the nation in whichever way possible but are not aware about the right path which can lead them to the desired destination.\n-Capt. Tanuja guided us on the same path and what are different opportunities for everyone in the armed forces covering the core ones liked air force, navy and army.\n-The session was followed by a CSD activity which was Complete the phrases quiz.\n-Total 77 rotaractors attended the session out of which 19 were from RC Aundh','https://www.instagram.com/p/CGAq_1OgvEK/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-23-September-GAZRF','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000','Health and Hygiene Talks','CM','34','24','0','Collaborated with Learning Resource Center, Pune for this session on Health and Hygiene Talks which was conducted by Dr. Manjeet Sudade. She guided the female senior citizens on ways to maintain good health and hygiene in this pandemic situation. The speaker also shared some exercises which will help the senior citizens stay fit. After this session, Antakshari was conducted so that the attendees could bond with each other. This was a WR event as well.\n\n','https://www.instagram.com/p/CGIFSPMASer/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-24-September-9FJ6W','2020-09-10 00:00:00.000000','2020-09-10 00:00:00.000000','The LGBT+ Community and their Struggles during loc','PD','15','2','0','The LGBT+ Community and their Struggles during lockdown\nPDD/ISD: Project Bandhan\n-Project Bandhan was conducted by RC Indira College in partnership with Elixir foundation; Castro Lextedu Edu & Relief Foundation along with RC Aundh and 6 other clubs.\n-The session was conducted by speaker Mr. Peter Cook & Ms Ria Sharma.\n-They highlighted the problems faced by the LGBTQ community in day to day life and how difficult it has been for them in the lockdown period.\n-They also showcased how various communities came forward for their help & to give them proper aid in this pandemic.\n-The session was attended by 15 rotaractors from RC Aundh.','https://www.instagram.com/p/CGAqDyQAfaM/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-24-September-oawoQ','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','RotaLingo','PD','76','40','0','Co-hosted this session with RC Viman Nagar and in collaboration with 10 other clubs from all over the world on the occasion of European Day of Languages. Four activities were conducted as a part of this event:\n1.	Cultural Showcases: Clubs from all over the world showcased their respective countrys culture, traditions, etc.\n2.	Cultural Quiz: Quiz was conducted on basic facts about each country.\n3.	Slang Shang: Rotaractors from various countries taught each other basic slangs and senten