s, still today, most people in rural areas are deprived of it.\nHence, the Rotaract Club of Panvel Elite distributed 2000 biodegradable sanitary napkins to the natives of the village on 27th September 2020. The pads were eco-friendly and easily disposable. We are thankful to everyone who helped us complete this project.\nEvery time we extend our hands to lift someone, we lift a lot of people with them and hence begins the chain of change.','https://www.instagram.com/p/CF89lwkgA98/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-3-September-Xdo2z','2020-09-05 00:00:00.000000','2020-09-05 00:00:00.000000','Gunadnyata: A Teachers Appreciation Program','CM','10','3','0','Teachers play one of the most important role in our life. They guide us, instil confidence and give hopes to new minds. Not only that sometimes teachers also have to carry government duties. A life of a teacher is truly significant. This year we celebrated teachers day in collaboration with our sponsor rotary, Rotary Club of Pune Mid-East at Pune Municipal Corporation(PMC) Kothrud Kshetriya Karyalaya, where some teachers were on duty of covid test centre. They played big role in fight against corona. We gifted them a framed appreciation letter and thanked them for their remarkable efforts. After event teachers were observed happy and motivated. ','https://www.instagram.com/p/CEyrOmkgA1Z/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-3-September-yOZWp','2020-09-08 00:00:00.000000','2020-09-08 00:00:00.000000','HOW TO HAVE CAREER IN INDIAN ARMED FORCES?','PD','6','2','0','In everyones mind there is a question that is there any opportunity in Indian armed forces? In this webinar speaker Capt. Tanuja Kabre gives an idea about all the career opportunities in Indian army. The webinar was organized and hosted by Rotaract club of Pune Camp Pioneers.\nOur Rotaract Club of Patalganga, along with RAC Aundh, and RAC Yuva Next, successfully Co-hosted the webinar.\nCaptain Tanuja Kabre is a retired officer of the Corps of Engineers, Indian army. She also served in counter insurgency areas of Jammu and Kashmir and also was coordinator of flood rescue operation in Binnaguri.\nMore than 80 Rotaractors attended the webinar it was interactive session followed by the Q&A at the end of webinar. Speaker answered the entire question which was asked by the participants. It was great to see that there is so many career opportunity in Indian armed force.','https://www.instagram.com/p/CE7AH27BDOe/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-3-September-zr9K3','2020-09-10 00:00:00.000000','2020-09-10 00:00:00.000000','LGBT+ Community and there struggles during lockdow','IS','17','2','0','It was a PD session on the challenges faced by LGBT community in the lockdown situation. ','https://www.instagram.com/p/CE_PpH_gQe9/?igshid=1p6m2xei8zxz1','1',0,'611556e79e9e454db666fd2832ee1152'),('E-30-September-pTcUA','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Rising Pride','PD','15','5','0','Collaborated with RC Pune Camp Horizon and 20+ other clubs from various districts for an interview with Mr. Rahul Malde and Mr. Sushank Chibber wherein they shared their story from childhood till now, talked about their relationship struggles, taboos surrounding the LGBTQ+ community and their journey to getting engaged. After this session, Dumbcharades was also conducted as a Club Service activity for all the participants to bond with each other.\n\n','https://www.instagram.com/p/CGIZ-elg2QS/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-31-September-OWKBE','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Rising Pride','CS','15','5','0','Collaborated with RC Pune Camp Horizon and 20+ other clubs from various districts for an interview with Mr. Rahul Malde and Mr. Sushank Chibber wherein they shared their story from childhood till now, talked about their relationship struggles, taboos surrounding the LGBTQ+ community and thei