','It was a fun Scavenger Hunt game with a small twist wherein the participants had to find out the objects on the theft list of the hosts. Few objects were shoe box, toothbrush, lipsticks, guide books, dictionary, masks etc.\nThe winner of this event was Rtr. Ishika Shejwal who also ended up in the jail since the only person who could have all the objects on the theft list had to be the thief. Everyone enjoyed this event.  ','https://www.instagram.com/p/CEXMh93gZ29/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1155'),('E-4-August-39SMi','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000',' Fort Preservation','CM','','','','Visit nearby hillock or fort and either clean or plant trees so as to preserve the natural beauty  ','','2',0,'611556e79e9e454db666fd2832ee1172'),('E-4-August-4qgc0','2020-08-12 00:00:00.000000','2020-09-12 00:00:00.000000','Decoding Job Via LinkedIn','IS','9','18','0','This event was initiated by RC MITCON and collaborated by RC Humanitas.','https://www.instagram.com/p/CDwLdhiAapO/?igshid=32qpo4qtxpsc','1',0,'611556e79e9e454db666fd2832ee1158'),('E-4-August-5NIWa','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Letterhead Exchange with RC Jalna RID 3132','IS','16','1','0','Letterhead Exchange with RC Jalna RID 3132','https://www.instagram.com/p/CEhkxikgD2E/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-4-August-63tdf','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','tour de culture','PD','16','11','0','The project was to learn about the lifestyles of different countries. 3 more countries did took part in the\nsame. The clubs prepared a presentation and explained about their countries culture. This showed how\ndiversed the world is. We learnt aboout culture, food, tourist attractions in thier country.','-','1',0,'0fd27714b7994a42a0fd4166cc094505'),('E-4-August-6CqmQ','2020-08-10 00:00:00.000000','2020-09-10 00:00:00.000000','Dear Soldier','IS','8','8','0','Initiated by  Rotaract Club of Pune Pashan, RID 3131 We, Rotaract Club of Pune Mid-East collaborated with the host club for Dear Soldier where we had to make letters, cards, drawings or poems for the Indian army Soldiers. We collected them from our club and gave it to the hosts, who posted to the Indian Army. We had sent a total of 8 letters/cards and 8 rakhis.','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-4-August-AsAK6','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','An interactive Meet','CS','12','5','0','We had an interactive meet with our members. We had a lot of  fun interacting with each other. We also discussed about E-District fellowship meet in this meeting.','-','1',0,'611556e79e9e454db666fd2832ee1182'),('E-4-August-BHogS','2020-08-08 00:00:00.000000','2020-08-08 00:00:00.000000','CLUB INSTALLATION','CS','40','2','0','CLUB INSTALLATION','https://www.instagram.com/p/CDrDzf7gzmh/?igshid=19lkzl4wmhtjg','1',0,'611556e79e9e454db666fd2832ee1154'),('E-4-August-C7U6g','2020-08-13 00:00:00.000000','2020-08-25 00:00:00.000000','Click-O-Mania','CS','112','2','0','On the occasion of World Photography Day, we had arranged a CSD\nevent called Click-O -Mania. In this event, we provided a platform for\nour fellow rotaractors to showcase their photography skills.\nFor this event, we asked our contestants to send their photo via\nGoogle form in the period of 13th August to 18th August. On 19th\nAugust we posted all these pictures on our official Instagram handle\nthat is @rc_rscoe. After posting all these pictures we gave them\nthe time of 7 days which lasted from 19th July to 25th July to share their\npicture and to get maximum likes on their post. The winner was\nadjourned on the basis of likes that they received for their photos.\nFor this event, we got an overwhelming response with whooping count\nof more than 100 contestants from various clubs as well as districts.','https://www.instagram.com/p/CD6Pru3guZL/','1',0,'611556e79e9e454db666fd2832ee1166'),('E-4-August-dfeWP','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Badlapur - The dare game','CS','21','8','0','From the name of the game Badlapur - The Dare Game, we come to know its going to be\nsomething about doing certain dares or perform some tasks. For the game CSD had prepared a\nlist of 52 dares. CSD and President randomly selected people and asked them to select a random number from 1 \n52. Whatever number they select; they had to complete that dare for the given number.\nAt the end we selected 1 person who did their dare really good and gets an opportunity to\ngive a dare or ask anything to the person of their choice.\nOverall it was a fun activity and an amazing icebreaker since we had funny questions and\ndares to do where everyone got involved.','https://www.instagram.com/p/CEokzqdg0UJ/?igshid=hep64vfkn32q','1',0,'611556e79e9e454db666fd2832ee1172'),('E-4-August-DksWB','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','Decoding job via LinkedIn ','PD','8','1','0','Rotaract Club of Viman Nagar in collaboration with Rotaract Club Of MITCON hosted a PD session to help the rotaractors build a strong and impactful LinkedIn profile. Gaurav Ghewade was invited as the guest speaker. ','https://www.instagram.com/p/CD7DtlkAmdy/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1168'),('E-4-August-F8Pg6','2020-08-03 00:00:00.000000','2020-09-03 00:00:00.000000','Rakshabandhan ','CM','8','6','0','The event Rakshabandhan was a CS and CM initiative where Rotaractors made Rakhi and greeting cards for police officers in our area for the occasion of Rakshabandhan. We collected all rakhis and greeting cards from the Rotaractors and presented them to the police station and celebrated Rakshabandhan by maintaining social distancing.','https://www.instagram.com/p/CDdYNvvBBuk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-4-August-FJ0Ij','2020-08-10 00:00:00.000000','2020-08-11 00:00:00.000000','Canva session.','CM','10','3','0','It was basically a WR collab with Rotaract club of VIIT. the event was only for girls where they were thought create postes,flyers,resumes using canva.','https://www.instagram.com/p/CD8bWiPA5Jn/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1152'),('E-4-August-gpxQO','2020-08-14 00:00:00.000000','2020-08-14 00:00:00.000000','What\'s your superpower?','IS','10','24','0','About the Event: The frame provided--normal mode and Rotaract mode , jointly with  rotaract club of Calcutta Old City, 3291','https://www.instagram.com/p/CD1kVQPA50u/?igshid=164dkob0yozm0','1',0,'611556e79e9e454db666fd2832ee1171'),('E-4-August-GsfpZ','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','International Youth Day','PD','24','1','0','The Youth of a Nation are the trustees of Posterity. International Youth Day is celebrated on 12 August every year to create awareness on various issues and challenges faced by the youth of the world. The theme of International Youth Day 2020, Youth Engagement for Global Action seeks to highlight the ways in which the engagement of young People at the local, national and global levels is enriching national and multilateral institutions and processes. ','https://www.instagram.com/p/CDyhL97J6eE/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1150'),('E-4-August-hf0HZ','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','Prendre-En-Photo','IS','7','1','0','We celebrated world Photography in Collaboration with Rotaract Club of Mumbai Mulund South, RID 3141 by sharing our best memories with each other.','-','1',0,'611556e79e9e454db666fd2832ee1192'),('E-4-August-hnb96','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Sukhkarta','CM','10','3','0','An Eco-friendly Ganesh Idol making workshop led by Ar. Shraddha Bhise. She taught us how to make the Ganesh idol with shadu-mati.','https://www.instagram.com/p/CD3ug3UgxdW/?igshid=coe5mj2bfp46','1',0,'611556e79e9e454db666fd2832ee1184'),('E-4-August-i439w','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Dissolve your conflict','PD','13','0','0','This event was organised in collaboration with Rotaract Club of Pune Warje on 9th August 2020. The speakers Dr. Chandrasekhar DP highlighted the conflicts present in our lives and how resolve them and balance personal and professional lives. He explained the concept beautifully by giving references of our freedom struggle and freedom fighters. The ice breaker session too was quite interesting. The event received an overwhelming response with 70+ rotaractors in attendance.','https://www.instagram.com/p/CDvFy1lgQvm/?igshid=hfe6i9yq0a4a','1',0,'611556e79e9e454db666fd2832ee1169'),('E-4-August-igBYG','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Maskie\'s Contest','CM','20','24','00','We posted individually our pictures in mask with Rotaract club of Kota Central RID 3054','https://www.instagram.com/p/CD3WLH6AxoC/?igshid=wowe78zcd5ws','1',0,'611556e79e9e454db666fd2832ee1133'),('E-4-August-ihkB5','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','BRAND YOU P.D. SESSION','PD','30','2','0','Rotaract Cub of Panvel Elite organized a session Brand You- The Power of Appearance which was conducted by Ms Neha Bhandare, who is an image, style, and colour specialist. Ms Bhandare very well explained the power of a good appearance,\ncommunication and emphasized the significance of it. With examples, she made the concept\nclear to us and gave us some tips as well.','https://www.instagram.com/p/CEdh3NIA6yt/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-4-August-j14Po','2020-08-07 00:00:00.000000','2020-08-07 00:00:00.000000','Donut Making Session','PD','26','3','0','On 7th August We Rotaract club of DYPIMS collaborated with Rotaract Club Of MITCON andtook the initiative to organize an Intresting Sesssion on The Donut Baking Session. The session was been organized by our beloved Miss.Ankita Dhamale. Miss.Ankita Dhamale has her firm, Chocoreverie. ','https://www.instagram.com/p/CD_KxjdgW44 /?igshid=tllg2yuadj3u','1',0,'611556e79e9e454db666fd2832ee1129'),('E-4-August-jpQvH','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Nutrition Dietics','PD','12','1','0','We had a very informative session for all our club members where Miss Richa talked about nutrition and diet & gave us tips and tricks on how to keep ourselves healthy by eating right','https://www.instagram.com/p/CEWLNB9Ag-o/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-4-August-K6E66','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','Happy You','PD','21','120','0','(1) Rtn. Sonia Menghani is a certified happiness coach from the Wellness Institute of Berkeley, California.\n(2) Common pitfalls encountered in the pursuit of happiness.\n(3) Questions like How to tackle labels which are put on us since our birth? or How to believe in oneself? were covered.\n(4) Hosted with Rotaract club of  Amanora Youngistan and Rotaract Club of Pune Yuva.\n','https://www.instagram.com/p/CErnkKIgeQ1/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-4-August-krlKE','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Soul Science','PD','12','3','0','We conducted a professional development session called as \'Soul Science\', in collaboration with Tehrin Shaikh ~ Life is Art. She spoke about how the heart and the associated nervous system in our body, our soul, affects our decisions. The session was an eye-opener for us.','https://www.instagram.com/p/CDyjJCRgwuS/?utm_source=ig_web_copy_link','1',0,'8c865236269d494aa157d2f4474cae02'),('E-4-August-kV3VU','2020-08-23 00:00:00.000000','2020-10-01 00:00:00.000000','Ganadhish','IS','0','10','0','An ISD event by RC Pune Pashan, where we collected and shared information about Ganapati Status and festival celebration across the Globe.','https://www.instagram.com/p/CEBqfv4gkqp/?igshid=6zavpw3bst3x','1',0,'715586ae6a074411910a9f2d15b13b65'),('E-4-August-L04UY','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Lift off','PD','13','2','0','We, Rotaract club of Zenith, along with Astronera conducted an astronomy PD session by Astronomer Rtr. Shweta Kulkarni. It was a fun session learning about space with friends joining from India and across India. It also perfectly concluded the Friendship\'s week.\n','https://www.instagram.com/p/CDwbPkwgKnl/?igshid=h2t846ae9fmv','1',0,'611556e79e9e454db666fd2832ee1143'),('E-4-August-l9oPt','2020-08-30 00:00:00.000000','2020-08-30 00:00:00.000000','Club Assembly','CS','30','4','0','\"Alone we can do little, but together we can do much!\"\nA team is always a winner when its members work together with a single vision and goal. And that what happened on 30th August which helped us have a successful club assembly. \nAZR Rtr Aditya Panchal guided us through. With near flawless presentations, awe gaping and wonderful ideas for the upcoming year the District Council was left impressed.\nWe hope to have a power packed year ahead and execute all the plans envisioned for the year. ','https://www.instagram.com/p/CE0h4rvAga4/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-4-August-MgQQC','2020-08-25 00:00:00.000000','2020-08-26 00:00:00.000000','CSD -pdd joint event','PD','70','6','0','In this event we do match club events with 3 others club Nd we do ice breaker ,of initiative in which each team have to present their ideas for the event.','https://www.instagram.com/p/CEGbmtqAPti/?igshid=1wyvrn1gmxsqr','1',0,'611556e79e9e454db666fd2832ee1132'),('E-4-August-n9v66','2020-08-03 00:00:00.000000','2020-08-03 00:00:00.000000','A Knot of Promise ','CM','9','1','0','RC Global Youth along with RC DYPIEMR, RC JIT, RC Urja, RC UBS, RC Xavier\'s College organized a thoughtful PR initiative encouraging Brothers to gift their beloved sisters Masks and Sanitizers to keep them safe in these uncertain times!\nDay & Date : Monday 3rd August 2020\nAvenue : A PR and Community Service initiative.','https://www.instagram.com/p/CDrkpXHgnZQ/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-4-August-t4Jaz','2020-08-03 00:00:00.000000','2020-08-03 00:00:00.000000','Knot of Promise','IS','10','05','0','This event encouraged people to celebrate Raksha Bandhan by gifting their sibling\'s mask and sanitizer .','https://www.instagram.com/p/CDeUgA7gWDZ/?igshid=wsnca9vyj9yk','1',0,'611556e79e9e454db666fd2832ee1151'),('E-4-August-TIHV4','2020-08-24 00:00:00.000000','2020-08-24 00:00:00.000000','INTERNATIONAL DOGS DAY','CM','13','12','0','On International Dogs Day 2020 we urged the members to post pictures with their pet dogs and feed street dogs and share pictures.','https://www.instagram.com/s/aGlnaGxpZ2h0OjE4MTI3NjI5ODUwMTAyODMx?igshid=1lonsn7f7ecan&story_media_id=2384046486192247305','1',0,'611556e79e9e454db666fd2832ee1175'),('E-4-August-TiVA9','2020-08-14 00:00:00.000000','2020-08-16 00:00:00.000000','RTR: Rise Through Rotaract(E-DFM)','CS','450','300','0','We, Rotaract Club of Pune Camp Pioneers along with Rotaract Club of Indira College co-hosted the first district event of this year, E- District Fellowship Meet RTR: Rise Through Rotaract). A 3-day event filled with games focused on the 6 major avenues of Rotaract, designed to help enrich the skills and to increase the amiable and cordial Rotaract bond among all the rotaractors of RID 3131. The list of the events that were conducted are:\n1. Movie Mashup, 2. Emojiwood, 3. Bollywood Nostalgia, 4. Cultural Videos, 5.Live Performance by Kushagra Thakur, 6. PUBG Bidding, 7.Online Scribble, 8.MEME Challenge, 9. Murder Mystery, 10. PUBG Tournament, 11. LUDO Tournament, 12. Money In The Bank, 13. Online Scavenger Hunt,14. PowerPoint Karaoke, 15. Family Feud, 16. Guess The Rotaractor, 17. Live Show by Daniel Fernandes, 18. E-MILAV','https://www.instagram.com/p/CD3r8-GAgdy/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-4-August-tjs2O','2020-08-25 00:00:00.000000','2020-08-26 00:00:00.000000','Rotanovation','PD','40','6','0','4 club members came together for series of bonding activities. Tasks were given to each team, making it fun yet learning experience, while participants ended up being friends.\nLast but not the least, we played games organized by different clubs while our president and secretary ended up winning some of them.','https://www.instagram.com/p/CEYqAIVgkny/?igshid=1dji3gcwvkrnj','1',0,'611556e79e9e454db666fd2832ee1197'),('E-4-August-uMfjH','2020-08-29 00:00:00.000000','2020-08-30 00:00:00.000000','E-inter Club Youth Exchange -Virtual tour to Vizag','IS','3','5','0','Rotaract CLub of Vizag City, RID 3020 approached us with the brilliant idea of doing a youth exchange - a virtual one! Along with 6 more clubs from various Districts. In an attempt to use today\'s technology to its fullest capacities, club members from Rotaract Club of Amanora Youngistan participated in an e-inter club youth exchange in the form of a virtual tour to Vishakhapatnam. Fun was had, bonds were created and strengthened, and Rotaract played yet another hand in furthering the social network of youngsters.','-','1',0,'611556e79e9e454db666fd2832ee1162'),('E-4-August-wIlTj','2020-08-15 00:00:00.000000','2020-09-15 00:00:00.000000','Feed the Need','CM','13','0','75000','On the occasion of Independence Day we conducted our flagship initiative Feed the Need 4.0  at LUI Breal Andh Apang Kalyan Sansthan. Working together to achieve a new milestone in our endeavour we have raised over Rs 75,000 by all your collective support to help them with food, masks and sanitary pads.','https://www.instagram.com/p/CEG8pw2g27B/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-4-August-WVJCS','2020-08-10 00:00:00.000000','2020-08-11 00:00:00.000000','GirlsXtech','PD','10','4','0','This initiative was taken by RC VIIT for all the girls of district 3131.  It was a bootcamp organized with GirlsXtech in association with Canva. 10 girls from RCSAOE participated in this bootcamp.','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-4-August-X7yf4','2020-08-08 00:00:00.000000','2020-08-08 00:00:00.000000','Club Orientation','PD','42','84','0','\"We Had Our Club \nOrientation By District Club Adviser Rtr. Umang Shah \n\"\n','https://www.instagram.com/p/CDx0JdGgut1/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1185'),('E-4-August-XqPKM','2020-08-10 00:00:00.000000','2020-08-15 00:00:00.000000','Palettes Of Diversity','CM','30','1','0','A week long Online Community Service initiative by our CMD , Rtr. Roshni Wadiwala, on our Instagram page where we showcased examples of communal harmony and also had various Rotaractors share their stories and experiences of the diverse culture and traditions of India. The aim of the activity was to promote and spread awareness about the various cultures and traditions as well as positive instances of communal harmony. Over 30 stories from Rotaractors were shared by us as well as them on our respective instagram handles.','https://www.instagram.com/s/aGlnaGxpZ2h0OjE3ODYzNjcxNDIyMDIyNDMx?igshid=1rbvys9pllmtu&story_media_id=2372623051180217514_5697553949','1',0,'611556e79e9e454db666fd2832ee1213'),('E-4-August-YK8g1','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','SWOT Workshop','CS','14','2','0','SWOT Workshopa PD event followed by a CSD activity and an introduction round with Rc of Amanora Youngistan and Rc of Guzelyali 2440, Turkey.','https://www.instagram.com/p/CDtRZzOgCnB/?igshid=ufw7yhqu25gz','1',0,'611556e79e9e454db666fd2832ee1174'),('E-4-August-ykWkC','2020-08-08 00:00:00.000000','2020-08-08 00:00:00.000000','Cervical Cancer Awareness Program','PD','70','3','2817','Cervical Cancer Awareness Program\nWR/PDD\n-The session was conducted under the WR initiative & PDD initiative exclusively for girls and woman where in more than 70 participants along with AZR Rtr. Mriti Agarwal & DWR Rtr.Punithjolie mane attended the session.\n-The girls from NGO were also a part of the session.\n-Our speaker Dr Savita Mehendale who has an immense contribution in the field of womens health and also won multiple life time achievement awards in field of obst & gyn gave the participants brief information about the cancer (causes, symptoms, vaccine)\n- The session had entry fee of Rs.30 which was a fund raiser for the Donation of Sanitary Napkins in the peripheral parts of Pune\n-The total amount collected from the session was Rs 2817/-.','https://www.instagram.com/p/CD190lhAwGI/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-4-August-YNvbD','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Sunday Vibes','CS','18','2','0','We had our first physical GBM. Most of us met each other for the first time and to remove everyone from their shy cocoons we decided to break the ice with a fun game of Verbal Volleyball! Post getting to know each other, we bonded over our love for Adam Sanders and Jennifer Aniston by watching the movie - Murder Mystery! It was a fun end to a fun day, and boy did we all enjoy it!','https://www.instagram.com/p/CEv1u1HgyXm/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-4-August-yPyBW','2020-08-10 00:00:00.000000','2020-08-10 00:00:00.000000','DENGUE SE FIGHT CORONA','PD','140','280','0','Health awareness session','-','1',0,'611556e79e9e454db666fd2832ee1181'),('E-4-September-0t7ku','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Session on Inner Peace by Dr. Virat Chirania','PD','200','3','0','Session on Inner Peace by Dr. Virat Chirania, It was the most productive session by Dr. Virat Chirania hosted by our District 3131 & ISD Rtr. Rhugved jointly with District 3080','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-4-September-1JVAY','2020-09-14 00:00:00.000000','2020-09-14 00:00:00.000000','Hindi Day','PD','2','1','0','Hindi Day wishing post with some information regarding this day.','https://www.instagram.com/p/CFHTlfZANuV/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1127'),('E-4-September-1uj9