 the presentation and we ended the fellowship with invitations to visit each other\'s countries soon!','https://www.instagram.com/p/CFgfzx_APJb/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-4-September-43Nx5','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Mental Health Webinar','PD','60','3','0','This event was initiated by RC Poona Royal. This was webinar on mental health and prevention. ','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-4-September-4uY8q','2020-10-27 00:00:00.000000','2020-10-27 00:00:00.000000','The Rising Pride ','PD','15','2','0','The Rising Pride it was organized by RC of Pune Camp Horizon along with 18 club from all over the World and one Rotary Club of Industrial Area RID 3142 (total 19 clubs) \nwe has an Interview session with Mr. Rahul Malde and Mr. Sushank Chibber (they are the gay Inspiration ) where they shared their love story their Struggle story how difficult it was to get accepted by the society and made a point they will be together no matter what (they both are from London) \nEvent Chairperson- WR Rtr Vaishnavi Saraf and SAA Rtr Bhagyashree Shinde\ntotal Attendees we had 140\nEditing work and PR Strategies by Rtr Tulna Gupta   ','https://www.instagram.com/p/CFrm1BPgquR/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1136'),('E-4-September-59bJ0','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000',' Financial Wellness Program','PD','55','180','0','A deep insight into financial awareness.\nThe speaker also shared some of his amazing and enlightening anecdotes and experiences about trading and investment.\nRegistrations were FREE of cost.\nRotaractors, as well as non-rotaractors, participated.\nOrganized with RC Aundh and BIAP.\n','https://www.instagram.com/p/CE05EYJA809/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-4-September-5r3ao','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Basics of Insurance','PD','95','3','0','We were educated by the basic of insurance.','https://www.instagram.com/p/CFZ4AQzAoLy/?igshid=132xnw03zug96','1',0,'611556e79e9e454db666fd2832ee1197'),('E-4-September-7Ba7n','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Blood Sweat and Tears','PD','11','0','0','This event was done in collaboration with RC Amanora youngistan . The topics were The Europe and Blood, Sweat and Tears.','https://www.instagram.com/p/CFnnYqLAmz3/?igshid=16qk55ohm27em','1',0,'611556e79e9e454db666fd2832ee1184'),('E-4-September-7FQMN','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Musical Night','CS','20','3','0','Musical night was conducted by playing Guitar player by Guinness world record holder Shubhankar, Kahoon by Kushal, Mouth organ by Saurabh ','https://www.instagram.com/rc_pune_heritage/','1',0,'611556e79e9e454db666fd2832ee1203'),('E-4-September-7yTVz','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Rotaland','PD','100','2','0','The event was based on awareness on the topic of insurance. The topic being importance of good health and finance required for treatment incase health deteriorates, that is Health Insurance.','-','1',0,'611556e79e9e454db666fd2832ee1150'),('E-4-September-9rQKC','2020-09-11 00:00:00.000000','2020-09-11 00:00:00.000000','RCPS Weekly Meeting','PD','20','40','0','\"Rotary Club of Pune Sarasbaug organized meet and greet with Maxwoman,Lady Bouncer. On\nFriday 11 th September. The name of the speaker was Deepa Parab She is an actor,activist and\nphilanthropist. She also own Rangragini Bouncer in Pune. More than 500 bouncers in Pune are\nnow working as bodyguards.She narrated her story and told her motivation or main intention\nwhy girls learn basic self defence tactics. She saw how women bouncers are limited to only pubs\nin Mumbai to keep the crowd in check. They had no other role to play.\"\n','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-4-September-A6zWj','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','SESSION ON FEMALE HYGIENE ON RURAL AREAS','CM','05','6','0','We discovered that many female residents in the village of Pen neither had access to sanitary pads and nor did they give much importance to female hygiene. Most of them resorted to traditional methods when it came to menstruation.\nThus, we also organized a session on Female Hygiene for Rural Women in which, our club member, Rtr. Ria Munot educated the villagers about the ill-effects of using cloth during menstruation. The significance of cleanliness measures was highlighted and the benefits of using biodegradable pads were also mentioned.\nThe session was successful with huge participation from the natives and all the pads were handed to them personally.','https://www.instagram.com/p/CF_SdibgcW9/?utm_sourc','1',0,'611556e79e9e454db666fd2832ee1209'),('E-4-September-ApR1L','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Knowing about beauty standards and mental health','CM','126','2','0','The NiB NGO has been focusing to curb unrealistic beauty standards and raise awareness about mental health by providing support and a platform. Normalising behaviour that threatens anyones well being is NOT NORMAL with this thought the Natural is beauty foundation is a NGO based in Pune, India founded in December 2019 by Maitryei Bhat. ','https://www.instagram.com/p/CFOwWKbgUyN/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-4-September-BfUPe','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Wildlife Conservation ','PD','12','2','00','Pd session on conservation of wildlife species with RC NIGDI','https://www.instagram.com/p/CFbfdyfg_z7/?igshid=1rolsz4420f9n','1',0,'611556e79e9e454db666fd2832ee1133'),('E-4-September-bmKxt','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Samvaad','CS','1200','3','0','RC Global Youth along with Punekar News in conversation with Mehab Qureshi hosted a Panel discussion through the medium of Facebook to spread awareness about Rotaract and its functioning while also highlighting the 