lk about those skills. She explored the reasons people tend to be unhappy and what one can do to combat that. It was a fun, relaxing and informative session.','https://www.instagram.com/p/CD1k9G4gyB6/','1',0,'611556e79e9e454db666fd2832ee1162'),('E-5-August-c0Zk9','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000',' Kick-start your Fitness journey','CM','10','1','0','We Rotaract Club of Laxmi College of Optometry in collaboration with Rotaract club of Patalganga where they hosted a prolific Webinar on  Kick-start your Fitness journey.','https://www.instagram.com/p/CD1Hkw2Acao/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-5-August-Ejdix','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Vivekananda Series','PD','70','2','0','Vivekananda Series\nPDD\n-Rotaract club of Pune Warje along with RC Aundh and other clubs organised a session on Vivekananda Series.\n-The session was conducted by Dr Chandrashekhar DP.\n-He explained the ways in which the conflicts that happen in our life and the various ways to control them.\n-He gave some basic techniques by which we can overcome the conflicts by handling the situations properly and keep growing as individuals.\n-This session was attended by about 70 rotaractors from the district.\n','https://www.instagram.com/p/CD19TuOA4j_/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-5-August-Eo0Zq','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','Re-design your life','PD','100','2','0','We Rotaract Club of Pune Kalyaninagar along with Rotaract Club of Universal Business School RID 3131, Rotaract Club of Aundh RID 3131, Rotaract Club of Pune Royal RID 3131 Rotaract Club of AIMS RID 3131, Rotaract Club of Bibwewadi Pune RID 3131, Rotaract Club of RSCOE RID 3131, Rotaract Club of Pimpri RID 3131,Rotaract Global Youth RID 3131 conducted this event in which speaker Monica Pahuja an alumnus of the Vedanta Academy took a session on Any Crisis can be viewed as a Loss compared to the past or an opportunity to be gained in the coming future.','--','1',0,'611556e79e9e454db666fd2832ee1157'),('E-5-August-fjP9B','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Knot the Tree','CM','12','2','0','Knot the Tree with RC Renaissance','https://www.instagram.com/p/CEhkL5pg74i/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-5-August-gK7C4','2020-08-11 00:00:00.000000','2020-08-11 00:00:00.000000','Charter Day Celebration','CS','20','2','0','On 11th of August 2020, Bibwewadi Family celebrated its Birthday with lots of joy, laughter, fun & Delicious Cakes .\n','https://www.instagram.com/p/CEWlJh-Asgb/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-5-August-HVGdF','2020-08-14 00:00:00.000000','2020-08-14 00:00:00.000000','SHARE MARKETING SESSION','PD','15','2','0','SHARE MARKETING SESSION UNDER THE BANNER OF ROTALAND.THE EVENT IS CO-HOSTED BY ROTARACT CLUB OF PANVEL MIDTOWN WITH 15+ CLUBS','https://www.instagram.com/p/CDtAwajgWI5/?igshid=rwlk4115tqe6','1',0,'611556e79e9e454db666fd2832ee1154'),('E-5-August-hxBQS','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Soul Science','CS','12','3','0','We conducted a professional development session called as \'Soul Science\', in collaboration with Tehrin Shaikh ~ Life is Art. She spoke about how the heart and the associated nervous system in our body, our soul, affects our decisions. The session was an eye-opener for us.','https://www.instagram.com/p/CDyjJCRgwuS/?utm_source=ig_web_copy_link','1',0,'8c865236269d494aa157d2f4474cae02'),('E-5-August-I1LpZ','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','\"Sukhakarta Idol Making \"','IS','70','140','0','\"PD Session on How to make Eco Friendly Ganesha Idol with Total 70+ attendees and collaboration with\n\"\n\"RC Urja\nRC DYPIMS\nRC ENTC MCOE \nRC Nasik Metro (RID 3030)\n\"\n','https://www.instagram.com/p/CDvTVSaA-Xo/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1185'),('E-5-Augus