llected all rakhis and greeting cards from the Rotaractors and presented them to the police station and celebrated Rakshabandhan by maintaining social distancing.','https://www.instagram.com/p/CDdYNvvBBuk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-5-August-LoTQB','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','Computer vision Syndrome','PD','9','1','0','In Collaboration with Rotaract club of Laxmi college of Optometry, the event was regarding the problems we could face with eyes for excessive use of laptop or mobile. The speaker for the seesion was MS. Shruti Lad','-','1',0,'611556e79e9e454db666fd2832ee1192'),('E-5-August-lUroB','2020-08-22 00:00:00.000000','2020-09-01 00:00:00.000000','Maza Bappa Lai Bhari','CS','55','2','100','On the occasion of the Ganesha Festival We Rotaract club of\nRSCOE conducted an event called Maza Bappa Lai Bhari 2.0\nFor this event, we asked our contestants to share their photos\nof Ganpati Decoration on their Instagram handle in the period\nfrom 22nd August to 1st September. This was a great success as\nwe received more than 50 entries for this event.\nThis event showed diversities in decoration and the idol of\nLord Ganpati. Through this event, we got a variety of exquisite\ndecorations that were unique in their own way.','https://www.instagram.com/p/CEj7-HYgUY-/','1',0,'611556e79e9e454db666fd2832ee1166'),('E-5-August-mZdxb','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Fukri','CS','','','','Fukri will be an offline event., It is game of cricket played with foot-ball.','','2',0,'611556e79e9e454db666fd2832ee1172'),('E-5-August-n0wlF','2020-08-14 00:00:00.000000','2020-09-14 00:00:00.000000','Whats Your Superpower','IS','4','4','0','Initiated by  RC Calcutta Old City, RID 3291. \nWe, Rotaract Club of Pune Mid-East collaborated along with RC Calcutta Old City, in an project named What\'s your Superpower? an initiative wherein we were supposed to showcase our potential as a Rotaracto