manora Youngistan.','https://www.instagram.com/p/CDtRZzOgCnB/?igshid=ufw7yhqu25gz','1',0,'611556e79e9e454db666fd2832ee1174'),('E-5-August-UeB95','2020-08-07 00:00:00.000000','2020-08-07 00:00:00.000000','Donut Making Session','IS','05','3','0','Donut making session was organized and our club collaborated for this event. Many clubs from all over India and abroad had joined this session. This session was led by Miss Ankita and was very interactive session','-','1',0,'611556e79e9e454db666fd2832ee1151'),('E-5-August-vdxUS','2020-08-14 00:00:00.000000','2020-08-16 00:00:00.000000','E-District Fellowship Meet','CS','10','72','0','We participated in E-DFM organised by our district. It was a fun event where we had an opportunity to interact with other club members also. We also got many club awards.','https://www.instagram.com/p/CEGwanTgGNO/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-5-August-VlQuN','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Sukhkarta','IS','10','3','0','An Eco-friendly Ganesh Idol making workshop led by Ar. Shraddha Bhise. She taught us how to make the Ganesh idol with shadu-mati.','https://www.instagram.com/p/CD3ug3UgxdW/?igshid=coe5mj2bfp46','1',0,'611556e79e9e454db666fd2832ee1184'),('E-5-August-WVmTN','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','Data Analysis','PD','24','2','0','An event organised under the PD avenue in collaboration with RC Pimpri, we had Mad Over Data conduct a webinar on the need and scope of data analytics in various fields for students, professionals and entrepreneurs. We had eminent speakers from Mad Over Data, a Boston based company, conduct the webinar. Amongst them were, Aniruddha Zutshi, Sufia Khan, Ashwin Malik Meshram. The speakers had a question and answer session towards the end of the webinar where they answered in detail the doubts and questions raised by the attendees.','https://www.instagram.com/p/CELrpJ2gQqn/?igshid=afk1tc3lo1nu','1',0,'611556e79e9e454db666fd2832ee1213'),('E-5-August-wVQJx','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','Deoding Job via LinkedIn ','PD','20','2','00','PD session on LinkedIn with RC MITCON ','https://www.instagram.com/p/CD3EHw4A6D2/?igshid=nz98gvwxo4dg','1',0,'611556e79e9e454db666fd2832ee1133'),('E-5-August-yam0v','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','BLOOD DONATION ','CM','91','8','0','\" A single pint can save three lives, a single gesture can create a million smiles.\"\nBlood donation is a noble cause and everyone who donates blood is no less than a hero. Standing by such words we Rotaract Club of Pimpri participated in a Blood Donation Camp on 15th August at RCC. Collectively, we managed to collect over 80 bottles of blood that day.\nMany of our fellow Rotaractors donated blood for the first time and even felt like a hero doing so.','https://www.instagram.com/p/CEoWHj0gLZ-/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1163'),('E-5-August-Z1799','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Blood Domation','CM','11','7','0','We along with our sponsor club- Rotary club of Pune Sarasbaug conducted Blooad donation camp at Deenanath Mangeshkar Hospital.','https://www.instagram.com/p/CEywMl1gEyk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-5-August-zOFqw','2020-08-01 00:00:00.000000','2021-06-30 00:00:00.000000','TAAZA KHABAR','PD','36','24','0','Taaza Khabar is a PD project initiated by our RRRO Rtr. Sahil Mande. Through this project the members are practising the habit of reading positive news every morning and sharing it with everyone later. This project is also our way of spreading positivity in these difficult times across the globe and promoting positive journalism.','https://www.instagram.com/s/aGlnaGxpZ2h0OjE4MTQ3ODk4MTQ0MDY4MTQ1?igshid=19gw7nw991yez&story_media_id=2370493069314313580','1',0,'611556e79e9e454db666fd2832ee1175'),('E-5-September-1arxF','2020-09-05 00:00:00.000000','2020-09-05 00:00:00.000000','Food donation','CM','10','3','0','We celebrated Teachers day at Pune Municipal Corporation(PMC) Kothrud Kshetriya Karyalaya in which fellowship of samosa, kachoris and of jalebi were remained with us. We donated that food to the kids that we found on streets selling disposable bags near Karishma Society. After getting ample amount of food at the time of lunch with sweet dish, kids enjoyed food. Also it impacted club members positively for taking this initiative','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-5-September-1j1HT','2020-09-19 00:00:00.000000','2020-09-19 00:00:00.000000','The Art of Roti Making','CS','13','2','0','This was joint initiative by WR and CSD. In this members of our club tried to make roti in perfect way and sent their pictures. This event was to enhance the bond between the club.','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-5-September-2nivY','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','KENSHO - A Night Yoga Workshop','CS','6','1','0','On Sunday, we, Rotaract Club of Pune Camp Next Gen along with Rotaract Club of Global Youth, RC Pimpri & RC Pune Royal conducted a session -\nKENSHO - A Night Yoga Workshop','https://www.instagram.com/p/CFGoZcZgfJ8/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-5-September-631Px','2020-09-21 00:00:00.000000','2020-09-25 00:00:00.000000','Plasma donation campaign','CM','0','0','0','In these unprecedented times of pandemic with millions of people suffering and dying across the globe any kind of donation is a great help to the entire mankind, with plasma being one of the important component of them. In order to contribute to this mission we organized an online awareness campaign along with Rotaract Club of Modern College Ganesh khind. Awareness was created through various social media posters and messages.','https://www.instagram.com/p/CGFnj3jAvpF/?igshid=1s2bzn48mcgz7','1',0,'611556e79e9e454db666fd2832ee1169'),('E-5-September-7i8E7','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Health Insurance ','PD','110','1','0','A webinar on \"HEALTH INSURANCE\" by Mr. Prashant Anchan, senior Training Manager at CARE Health Insurance with over 13+ years of experience in Life, Pensions and Health Insurance, a CF1 certified professional from Chartered Institute of Insurance  (UK) and have done his Licenciate from Insurance Institute of India, which was hosted by Rotaract Club of Roha in association with Rotaland and in collaboration with 20 other Rotaract Clubs from other RIDs.\nThe webinar focused on aspects of the health insurance it\'s types, benefits, advantages and why one should have it in normal as well as in these time of Covid-19 pandemic. The speaker delivered in-depth knowledge of health insurance. Followed by the session Q&A segment took place, in which speaker addressed various questions by the participants.\n','-','1',0,'611556e79e9e454db666fd2832ee1213'),('E-5-September-bHdZC','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Anirban Dasgupta - Journey with Comedy','PD','10','2','0','An event organized by Rotaract Club of Bombay Juhu Beach, RID 3141 on the life and journey of a stand up comedian and the struggles and challenges faced to become successful.','-','1',0,'611556e79e9e454db666fd2832ee1163'),('E-5-September-cdyei','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Ready to Revolutionise','PD','24','2','0','A Talk full of awakening and motivation by His Holiness Shri Braj Mohan Das Ji.','-','1',0,'611556e79e9e454db666fd2832ee1166'),('E-5-September-CQNAr','2020-09-15 00:00:00.000000','2020-09-15 00:00:00.000000','Tree Plantation','CM','13','1','0','An initiative by RaC Coorg Institute of Technology RID 3181. A plantation drive where members spent time with nature by planting saplings in their cute little gardens\n','https://www.instagram.com/p/CFxHKl4g7lC/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-5-September-CRnbU','2020-10-13 00:00:00.000000','2020-10-13 00:00:00.000000','Session on Yoga with Dr. Kush Panchal','