ood recipe includes\n\nChiken Biryani, Ceviche ,Kiri bath ,Methay Chwal and\nBrigaderios.\n4.E-Meeting\n5.E-Bulletin\"\n','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-5-September-mJVPn','2020-09-07 00:00:00.000000','2020-09-07 00:00:00.000000','How to be a news anchor','PD','16','1','0','Requirements to become a news anchor jointly with RC Pune Kothrud 3131','-','1',0,'611556e79e9e454db666fd2832ee1171'),('E-5-September-NCzjS','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','SPORTS DISTRIBUTION','CM','5','06','0','Sports has always been an integral part of our lives. Where else do we get to witness excitement, teamwork, competitiveness, and talent all at once!\nWe all have grown up playing several sports and those can be included in our fond memories and every child should be privileged to live those memories.\nHence Rotaract Club of Panvel Elite donated bats, balls, rackets, shuttles and other sports equipment to underprivileged children of the village Pen on 27th September 2020. We were glad to take up this Community Service Project and also enjoyed the priceless smiles on the faces of all the children.','https://www.instagram.com/p/CGAWeS4AZhZ/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-5-September-nnG6f','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','THE RISING PRIDE','PD','25','0','0','It was a collaboration event with RCPune camp horizon in which rahul malde and sushank chibber come as a gay inspiration for everyone and they had conducted a interview session','https://www.instagram.com/p/CFkTxrmAPDW/?igshid=dqpo6n9w41bt','1',0,'611556e79e9e454db666fd2832ee1196'),('E-5-September-NVnKo','2020-10-07 00:00:00.000000','2020-10-07 00:00:00.000000','Any Body can Do 2.0','CS','14','2','0','Any Buddy Can Do\nPDD/CSD/MDD\n-As ABCD 1.0 same concept was applied in ABCD 2.0.\n-The next 18 members were invited to the session.\n-After both the rounds some funny boomerangs and pictures were captured by the PRO.\n','htt