in the field of Digital Advertising and Communications\nIndustry. He has his own music band name Laxmi Bomb, which is going\ncrazy on Spotify, Jio-saavn, and also on the stages of Mumbai, across\nIndia and the world.\nIn this session, Mr. KEGAN shared some points of his journey and also\ngave brief information about digital advertising and communication\nwhich helped individuals how are interested in this field.','https://www.instagram.com/p/CEwUGOhAlWs/','1',0,'611556e79e9e454db666fd2832ee1166'),('E-6-August-4ma5n','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Ganesh Idol Making','CM','20','3','0','On 09th August We RC-DYPIMS collaborated with Rotaract club of Urja who took the initiative to organize an Amazing Session on -Ganesha Idol Making Workshop. Not only RC-DYPIMS but 03 other clubs also collaborated for the event.\nThe session was very interesting & helpful for the participants and the artist took the session in a practical mode to understand better.In this session,she taught us how easily we can make Eco Friendly Bappa and celebrate the Ganesha Festival in Eco Friendly way.\n','https://www.instagram.com/p/CEHmufWASlh/? igshid=1ginoeseytrgg','1',0,'611556e79e9e454db666fd2832ee1129'),('E-6-August-55pUm','2020-08-22 00:00:00.000000','2020-08-22 00:00:00.000000','How to overcome stage fear','PD','11','2','0','Stage fear will one day promote you to become a stage lover. This event was organised on 22nd August 2020 in association with 4 other rotaract clubs. The speaker for the session was our very own Rtn. Kranti Shah Mam who guided us with a lot of tips and tricks of how to overcome stage fear and become a more confident person. The cherry on the cake was the icebreaker Dumb charades session. We also express our heartfelt gratitude towards Rotaract club of Pune Camp Horizon for the collaboration.','https://www.instagram.com/p/CEROpBlArY2/?igshid=mp5rxus4zx6s','1',0,'611556e79e9e454db666fd2832ee1169'),('E-6-August-8IgeM','2020-08-15 00:00:00.000000