nce and changes required.\n-The session was attended by around 60 participants.','https://www.instagram.com/p/CD17mwMgjqR/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-6-August-aqyLh','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Life Of RJ','CS','14','4','0','Fun activites and interaction with RJ Apurva','https://www.instagram.com/p/CEV66CcgYmg/?igshid=1oq32vy1hopgn','1',0,'dc2244b6d8d843b985978ff06763b075'),('E-6-August-bGTCw','2020-08-31 00:00:00.000000','2020-08-31 00:00:00.000000','Artifice','IS','25','1','0','This event is hosted by our club.','-','1',0,'611556e79e9e454db666fd2832ee1132'),('E-6-August-ChSzJ','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','Computer Vision Syndrome','IS','120','3','0','This was ISD project initiated by RC Lakshmi College along with by 11 different clubs. Speaker for the event was Ms. Shruti Lad, Head of Vision therapy, Dept of Lakshmi Eye Institute.','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-6-August-DDwvj','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','Proud to be an indian','CS','6','1','0','We RaC Laxmi College of Optometry had a event on independence day -PROUD TO BE AN INDIAN. This was CSD event where we have to post our memories of Independence day in the form of images and also post a quote or a thing which makes you independent. ','https://www.instagram.com/p/CD2_eLMAAbF/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1126'),('E-6-August-DfkF7','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','NELSON MANDELA DAY','PD','17','3','0','We celebrated Mandela Day by sharing our thoughts and views about Sir Nelson Mandela. We also played videoz on the history and significance of his work, for the members to watch.','https://www.instagram.com/s/aGlnaGxpZ2h0OjE3ODQzODUyMzQyMzEwMDk4?igshid=1jd3qhqcu97z0&story_media_id=2355116421823929684','1',0,'611556e79e9e454db666fd2832ee1175'),('E-6-August-ejWTf','2020-08-09 00:00:00.000000','202