nd to bring a smile to their faces. This was a PR event as well.','https://www.instagram.com/tv/CER7j3gAetY/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-6-August-I7671','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','Rotaract colloquim - Kick Start you Fitness Journe','PD','19','2','00','Fitness tips where given by Professionals & collaborated with RC PATALGANGA','https://www.instagram.com/p/CD3ExRPAJn8/?igshid=jky5g4f86cpe','1',0,'611556e79e9e454db666fd2832ee1133'),('E-6-August-Izo4u','2020-08-08 00:00:00.000000','2020-09-08 00:00:00.000000','Rotaract Colloquium 1.0 - INDIA V/S CHINA','PD','88','8','0','Our club, Rotaract club of Patalganga successfully hosted the webinar along with 16 other Co-Host Clubs on the topic India vs. China- The race to be the vishwa guru under Rotaract Colloquium 1.9 a series of webinar and seminars in which various eminent speakers with expertise in various fields is invited to speak and enlighten on diverse themes.\nThe session was conducted by Mr. Aditya Lele , Political Analyst and student of Political Science, 5th year law student from prestigious Government Law College Mumbai and he is founder of YouTube channel Bharat Bhagya vidhata\nA total 80+ people attended it. Webinar was based on current affairs, Followed by extensive session of Q&A. The webinar was very informative and it will contribute to the knowledge of Rotaractors.','https://www.instagram.com/p/CDomwP5JtYy/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-6-August-JuYOt','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Ganpati Darshan','CS','12','8','0','This event was conducted from 23rd August 2020 to 29th August 2020\nWith all safety measures and following the guidelines regarding COVID 19 we visited Ganpati Bappa at places of our fellow rotaractors  Rtr. Aditi Pate, Rtr. Anoushka Malpathak, Rtr. Sumedh Gite and Rtr. Kimaya Pathak along with delicious fellowship, 100% Home Cooked. \n','https://www.instagram.com/p/CFAury-gwdt/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1155'),('E-6-August-JZlED','2020-08-05 00:00:00.000000','2020-08-05 00:00:00.000000','Birthday Peeak-a-boo (Rtr Harshada)','CS','29','1','0','A personally curated video by the club service directors for the club members is rolled out on their birthdays with a theme related to their profession. ','-','1',0,'611556e79e9e454db666fd2832ee1131'),('E-6-August-kF9uq','2020-08-11 00:00:00.000000','2020-08-15 00:00:00.000000','E-Learning from Home','PD','45','120','0','We did a project with Rotary Club of Pune Kothrud under the guidance of Rotary District 3131 Literacy committee.\nA 5 day Programme on Digital Learning, we learnt basics of online tools and got cleared with so many doubts which one should know.','https://www.instagram.com/p/CEHZSSOAPh9/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-6-August-Kh3z3','2020-08-14 00:00:00.000000','2020-08-14 00:00:00.000000','Orientation Program','PD','30','90','0','Orientation (with rotarians) by Rtn Prasad Sovani','-','1',0,'611556e79e9e454db666fd2832ee1181'),('E-6-August-lMLWW','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','Redesign your life','PD','14','1','0','A session where our speaker Monica Pahuja, Alumnus of the Vedanta Academy\nShe spoke about how to deal with crisis, how to manage our past and upcoming opportunities to gain a better future','https://www.instagram.com/p/CEZqe3UAnM-/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-6-August-mr8A5','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000','computer vision syndrome','PD','7','4','0','A seminar on Computer Vision Syndrome was conducted by spokes person Shruti Lad. This was match club\nevent with different clubs from our district. She suggested some ways to keep our eyes healthy and also told\nwhat is effect of blue light on eyes.','-','1',0,'0fd27714b7994a42a0fd4166cc094505'),('E-6-August-NiWLP','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Know Your Rights','P