','2','0','Learning about the\nsignificance of Womens rights, Rotaract Club of Panvel Elite organized a webinar on\nWomens rights on Independence Day.\nIt was conducted by Adv. Sonika Jain. She is a councillor at Municipal Corporation, Udaipur\nand has two years of experience at Mumbai High Court. She briefed us about the rights which\nprotect women from exploitation, domestic violence and provides them rights which help\nthem lead a quality life. The session was indeed insightful and helpful.','-','1',0,'611556e79e9e454db666fd2832ee1209'),('E-6-August-sHItH','2020-08-14 00:00:00.000000','2020-08-16 00:00:00.000000','E-DFM.','CS','450','120','3259','It was a E- district fellowship meet which was combinedly hosted by RC  Indira College and RC Pioneers, the event was combination for various activities,sessions by some celebrities, games and many more. the complete event was of 3 days starting from 14th of august to 16th of august.','https://www.instagram.com/p/CEHFLiJgANq/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1152'),('E-6-August-sQCPS','2020-08-10 00:00:00.000000','2020-08-10 00:00:00.000000','Dengue  Fight  ','PD','12','5','0','As the monsoon finally arrives, the risk of Dengue also increases along with the Corona Virus. So in the hard times where we are already fighting COVID-19, Rotaract Club of Pune Zenith conducted- Dengue  Fight , a PD session on prevention of Dengue along with Covid-19 by Dr. Sachi Desai (MD Ayurveda)\n','https://www.instagram.com/p/CDyG4vEAMeA/?igshid=191kgcproib31','1',0,'611556e79e9e454db666fd2832ee1143'),('E-6-August-UscUH','2020-08-02 00:00:00.000000','2020-08-03 00:00:00.000000','SurakshaKawach(Phase II)','IS','46','2','0','On the Occasion of Rakshabandhan., event was hosted by Rotaract Club of DAVIM sponsored by Rotary Club of Faridabad, RID 3011., it was about Posting a picture of yourself while tying a rakhi on the hand of security guard , police officers and our help workers who are working non-stop in this 