\n','https://www.instagram.com/p/CD8t_vzANUK/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-6-August-Zz8Mu','2020-08-27 00:00:00.000000','2020-08-27 00:00:00.000000','Ganesh Aarti','CS','17','1','0','Attended Virtual Ganesh Aarti along with Rc of Warje.','-','1',0,'611556e79e9e454db666fd2832ee1174'),('E-6-September-0cLU2','2020-09-21 00:00:00.000000','2020-09-24 00:00:00.000000','Plasma Donation Awareness','CM','17','4','0','Plasma Donationation is a Priority Looking at the situation around us so we Planned a  Plasma Donation Awareness Through Virtual Platform. Where many Clubs Joined in sharing the facts About Plasma Donation. ','https://www.instagram.com/p/CFZfOQjAbhA/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-6-September-15uBf','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','RCC Meetup','CS','18','4','0','A general body meeting at our venue where we discussed our previous events and also upcoming ones and had a club bonding game session. ','-','1',0,'611556e79e9e454db666fd2832ee1163'),('E-6-September-2yqzC','2020-10-04 00:00:00.000000','2020-10-04 00:00:00.000000','Zumba Session','PD','','','','This session is taken along with Rotaract Club of Pune Camp Horizon in which members turned a lazy sunday morning to a morning where they wanted to be fit and to achieve pink of thier health','','2',0,'eb9670d295cc4f6e929bdf0c2e29fddf'),('E-6-September-4XRj0','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Inner Peace','IS','220','2','0','On the occasion of World Peace Day i.e. 21/09/2020 , Rotaract District 3131 jointly with Rotaract District 3080 conducted a Professional Development Session on Inner Peace. Members of Rotaract Club of Pune Renaissance took part in the session actively. Dr. Virat Chirania, a TedX Speaker and Life Coach explained in great detail how to achieve inner peace and showed us some meditation techniques to get there. We were glad to have been able to listen to him',