ractors instill the spirit to do something great! Answering all the questions ranging from life issues to Bhagwadgeeta and Mahabharata he did won everyone\'s hearts. The event did gather lots of appreciation and love.','https://www.instagram.com/p/CEtdJFXJp3T/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1150'),('E-6-September-cJxiz','2020-10-20 00:00:00.000000','2020-10-20 00:00:00.000000','Conservation Conversation','PD','12','2','0','RC Global Youth along with RC Nigdi along with 8 other Rotaract Clubs hosted a session on Wildlife Conservation to help raise awareness about their Rights and initiatives taken to protect them. Resource person: Mr Shubham Pande, Founder of World For Nature organization.','https://www.instagram.com/p/CFkV7dlAdGX/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-6-September-CnPsg','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Digital Marketing','PD','60','1','00','Digital Marketing was a joint project executed by RaC Amanora Youngistan 3131, RaC Bibwewadi Pune 3131, RaC Pune Vibrant East 3131, RAC Calicut Central 3202 and RAC Vapi 3060.\nSpeaker: Rtr. Harshad Dhawale','-','1',0,'611556e79e9e454db666fd2832ee1194'),('E-6-September-Dg8u0','2020-09-19 00:00:00.000000','2020-09-19 00:00:00.000000','Dodge Ball and 10 Passes','CS','21','2','0',' We started off with Dodge ball and ended with 10 passes. It was a team building activity.','https://www.instagram.com/p/CFydYuugaF_/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-6-September-fVNH0','2020-09-21 00:00:00.000000','2020-09-24 00:00:00.000000','Plasma Donation Awarness ','CS','00','00','00','Released POSTERS on plasma donation to create an awareness With RC modern Gk ','https://www.instagram.com/p/CFYy4lzAsJ1/?igshid=gw9jpyz3a9jo','1',0,'611556e79e9e454db666fd2832ee1133'),('E-6-September-gqWo2','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','TOYS DISTRIBUTION','CM','05','6','0','When we\'re asked about our childhood memories, mostly all of us can remember playing with toys, putting life into them and seeing them as our friends. They were not only a source of entertainment but they indirectly also engendered creative ideas in our minds. Inspired from the same, Rotaract Club of Panvel Elite distributed several toys to the children of village Pen on 27th September 2020. We thank everyone who helped us complete this project by taking a step forward in creating beautiful memories for the children.','https://www.instagram.com/p/CGAWsoZgaeC/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-6-September-HinPd','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Melody Night','CM','40','60','1800','\"This was joint event. Rotaract Club of Alumni in collaboration with Rotary Club Of Pune\nSarasbaug. A 17 year old artist name Arpan Shishetty was invited to perform for Alumni.He has\nhis own youtube channel where he posts his songs.This event was fundraiser event where the\nartist will be entertaing us and the registration amount collected from this will be used in Feed\nthe need(food donation) for a good cause.\"\n','https://www.instagram.com/p/CFuifPvA2um/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1185'),('E-6-September-hJFbm','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Rotalingo','PD','12','2','0','Rotalingo - A PD event gave us a chance to learn basic slangs, statements in other languages and gave us a platform to share our culture. \nThis event was hosted by RC of Viman Nagar and RC of Camp Pioneers along with other collaborating clubs.','https://www.instagram.com/p/CFwShCaglJS/?igshid=scp1dejcgqin','1',0,'611556e79e9e454db666fd2832ee1174'),('E-6-September-HnMbn','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Grand Talk','PD','200','2','0','We, Rotaract Club of Pune Mid-East in collaboration with the Host Club RAC Panvel Central with Zone 1 and 29 other clubs from the country conducted an event Ready to Revolutionize which was deliv