n. Kranti Shah Ma\'am and it was a great session as\nthe speaker gave an idea why one is afraid of getting on stage and how can we overcome them and be\nconfident.','-','1',0,'0fd27714b7994a42a0fd4166cc094505'),('E-7-August-lOzWX','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','Celebrating 74th Independence Day','CS','21','48','0','On this Independence Day. We, MMRCPK are did an initiative \" Celebrating 74th Independence Day.\nIn this Pandemic situation we can\'t go outside and celebrate, but yeah we can celebrate Independence Day at our home only by our creative way.\nSo our members celebrated this Independence day by being at their home in their own innovate way.','https://www.instagram.com/p/CEHgB_mg0nu/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-7-August-LYh4z','2020-08-17 00:00:00.000000','2020-09-17 00:00:00.000000','Prendre-en-Photo','IS','4','8','0','On the occasion of world photography day we, Rotaract Club of Pune Mid-East along with RC Mumbai Mulund South, RID-3291 initiated Prendre-enPhoto where in a collage collection was to be prepared on, A picture of something that motivates you. A picture of something that brings happiness in times of distress. An emotional moment in life. Holding a new born baby. A picture with the most important and beautiful person for you. The first dish prepared in the kitchen by you. The moment you discover when your crush likes you back. A glimpse of your bucket list. The smile on face when you receive your first pocket money/ salary / stipend. The best individual candid / the best candid with someone. A picture of your desk where you work, dream, desire and fly into your world of imaginations. The book you love. The plant you\'ve been nurturing and taking care of since a long time. A picture of you with best friend. A picture of you doing an act of compassion or a random act of kindness.','-','1',0,'611556e79e9e454db666fd2832ee1212'),('E-7-August-Mywzj','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000