r the attendees so that they could bond with each other.\n\n','-','1',0,'611556e79e9e454db666fd2832ee1201'),('E-7-August-PrpXU','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000',' Ye hain mera bharat (Quiz Competition)','PD','27','120','0','(1) We had conducted a quiz for us named \"Ye hai Mera Bharat\".\n(2) 5 teams were made with different names, namely Ganga, Yamuna, Narmada, Godavari, Krishna. And 3 segments were made which had different quiz questions and had points for each correct answer.\n(3) The quiz was based on different aspects like historic, geography, mythology, architecture, current affairs, culture.\n','https://www.instagram.com/p/CD8t_vzANUK/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-7-August-QBOey','2020-08-20 00:00:00.000000','2020-08-20 00:00:00.000000',' GANPATI MAKING WORSKHOP','CM','26','3','0','GANPATI MAKING WORKSHOP','https://www.instagram.com/p/CECi2qKg7Jj/?igshid=1de001zs2m9v0','1',0,'611556e79e9e454db666fd2832ee1154'),('E-7-August-qPstA','2020-08-20 00:00:00.000000','2020-09-20 00:00:00.000000','Computer Vision Syndrome','PD','150','2','0','Event by RAC Laxmi College of Optometry to spread awareness over CVS which is a common symptom observed in many because of increasing digital footprints. It was addressed by Ms. Shruti Lad tutor at Laxmi College of Optometry.','-','1',0,'611556e79e9e454db666fd2832ee1150'),('E-7-August-R6s8i','2020-08-10 00:00:00.000000','2020-08-10 00:00:00.000000','Books Donation ','CM','23','2','0','We Rotaract Club of Pune Zenith, donated a set of 11 novel books (according to their requirement) worth 2500/- in a rural school under the initiative of Jagar carried out by Samakalin Prakashan.\n','-','1',0,'611556e79e9e454db666fd2832ee1143'),('E-7-August-XAuKW','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','Lens of Light','PD','11','2','0','This session explained us about DSLR photography and mobile photography. It was conducted by Rtr. Naveen Kumar form Nexus Reflection.','https://www.instagram.com/p/CEeqWpggoDC/?igshid=x72tl744wmr0','1',0,'611556e79e9e454db666fd2832ee1184'),('E-7-August-xD1i8','2020-08-22 00:00:00.000000','2020-09-01 00:00:00.000000','Stories about Bappa','CS','31','1','0','Stories about Bappa was a PR initative for 10 Days on our Club Instagram Handle. Every Day for 10 days we use to share stories about Lord Ganesha.','-','1',0,'611556e79e9e454db666fd2832ee1174'),('E-7-August-YP5ti','2020-08-24 00:00:00.000000','2020-08-24 00:00:00.000000','Aaplya Gharcha Ganpati','CS','12','4','0','This was a joint event between RaC Warje and RaC Pune Hillside where we attended Virtual Ganesh aarti at the homes of our fellow Rotaractors Rtr. Sahil and Rtr. Shraddha from RaC Warje and Rtr. Sumedh Gite from RaC Pune Hillside. We also played a fun guessing game hoster by \nRtr. Aishwarya Wani where she told us the names of actors from different movies and we had to guess the name of the movie. It was a very interactive session and everyone had fun!  \n','https://www.instagram.com/p/CEXU_87ATm5/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1155'),('E-7-August-ZubQT','2020-08-14 00:00:00.000000','2020-08-14 00:00:00.000000','Youth\'s Move','IS','5','1','0','Rotaract Club of Pune Renaissance collaborated in the project- Youth\'s Move\nInitiated by Rotaract Club of Badulla, RID 3220 and Rotaract Club of Xallitic, RID 4185. Various industries were affected due to the Covid-19 pandemic. This initiative aimed to get an idea of how each industry has been affected in various countries and what was done by them to continue working! 5 members from RCPR participated and sent videos relating to various Impacts. Out of these, our President Rtr. Aishwarya Sancheti Patel won the Legal Impact category! ','https://www.instagram.com/p/CEyw06Eg8La/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-7-September-0hQCD','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Digital Marketing','PD','15','1','0','An initiative by RaC Amanora Youngistan 3131. Our speaker was Rtr. Harshad Dhawale. He is a Digital media specialist at Eminence & Co-founder of Bluenest and Studiare Global. This session was fun learning, informative and covered the world of digital marketing for freshers and businesses','https://www.instagram.com/p/CFy9XBag8Xl/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-7-September-1AiYN','2020-09-21 00:00:00.000000','2020-10-21 00:00:00.000000','International Day of Peace','IS','200','2','0','Hosted by RID 3131 and 3080, A SESSION BY SPEAKER, TO GAIN KNOWLEDGE AND IDEAS ON PEACE AND HOW TO BUILD IT IN OUR OWN COMMUNITY.\n','-','1',0,'611556e79e9e454db666fd2832ee1150'),('E-7-September-1ia0q','2020-09-15 00:00:00.000000','2020-09-15 00:00:00.000000','CHILDHOOD MEMORIES ','CS','20','2','0','All the rotaractors were nostalgic and went down the memory lane of our childhood together.\nWhat a perfect way of bonding than by watching some of our favorite cartoons together and surprisingly finding it equally funny even today.','https://www.instagram.com/p/CFKc_cYg_sr/','1',0,'611556e79e9e454db666fd2832ee1168'),('E-7-September-1jupZ','2020-09-28 00:00:00.000000','2020-09-29 00:00:00.000000','Future Opportunities in Optometry','CS','18','5','0','We Rotaract Club of Laxmi College of Optometry organized a talk on Future Opportunities in optometry, were our Seniors were told us about what we will do after competing optometry.','-','1',0,'611556e79e9e454db666fd2832ee1126'),('E-7-September-1Ler9','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Chalk Carving','CS','14','10','0','Conducted a session an online Chalk Carving in collaboration with RC Nasik Grape Valley, RC Vibrants, RC Gwalior Regal, RC Warje. It was conducted by Mr. Omkar Doiphode wherein he explained the basics of chalk carving and the tools required for the same and the session ended with a follow along session where the participants carved words on chalk along with the speaker. A club service activity was also conducted namely, Guess The Word wherein the participants had to guess the word by looking at the combination of images displayed on the screen.','https://www.instagram.com/p/CGACTjpgyG_/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-7-September-2P1Bz','2020-09-18 00:00:00.000000','2020-09-18 00:00:00.000000','Vyakhyamala - Financial Literacy ','PD','40','3','0','RCGY in collaboration with RC Pune Vibrant East, RC UBS, RCGY, RC SLS, RC DPU conducted a session on financial literacy to understand the basics of investment and the best way to invest and get returns. Resource person for the said session was Rtn Huzefha Ibrahim and Rtn CA Aniruddha Rathi. Attended by 12/30 Members from RCGY. \n\n','https://www.instagram.com/p/CFkVNP9gAIS/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-7-September-7JHNv','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','The Melody Night','CS','40','60','1800','\"This was joint event. Rotaract Club of Alumni in collaboration with Rotary Club Of Pune\nSarasbaug. A 17 year old artist name Arpan Shishetty was invited to perform for Alumni.He has\nhis own youtube channel where he posts his songs.This event was fundraiser event where the\nartist will be entertaing us and the registration amount collected from this will be used in Feed\nthe need(food donation) for a good cause.\"\n','https://www.instagram.com/p/CFuifPvA2um/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1185'),('E-7-September-7MnNW','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Rotalingo','CS','12','2','0','Rotalingo - A CSD event gave us a chance to learn basic slangs,along with quiz activity statements in other languages and gave us a platform to share our culture. \nThis event was hosted by RC of Viman Nagar and RC of Camp Pioneers along with other collaborating clubs.','https://www.instagram.com/p/CFwShCaglJS/?igshid=scp1dejcgqin','1',0,'611556e79e9e454db666fd2832ee1174'),('E-7-September-7oBy1','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Vision Board ','PD','26','3','0','The event was organised under the PD avenue,where we had Rtr. Jeevisha Rana and Rtr. Alina Tambuwala explain the concept as well as teach us how to make Vision Board for ourselves. We learnt how vital it is to keep one\'s goals and vision in front of us at all times and how doing so will keep one motivated to work towards achieving said goals and vision. We also learnt how to set realistic and practical goals and plan out our steps. The members then made their own vision boards and paired it with the habit trackers that they had made at an earlier event. The activity was aimed at improving our attitude towards our goals and helping us focus and plan the steps required for achieving  the goals. ','https://www.instagram.com/p/CFuWXAxgSbL/?igshid=n6l723w7odjf','1',0,'611556e79e9e454db666fd2832ee1213'),('E-7-September-8gKP7','2020-09-15 00:00:00.000000','2020-09-15 00:00:00.000000','Public Speaking Skills','PD','30','48','0','Joint Clubs - RC Mitcon and RC RSCOE\nWe conducted another PD session on PUBLIC SPEAKING SKILLS which was taken by Mr. Amritansh Tiwari. Herein, we got to learn many skills in a fun way and the key to establish great communication.','https://www.instagram.com/p/CFwljKAAWPc/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-7-September-aDQxj','2020-09-15 00:00:00.000000','2020-09-15 00:00:00.000000',' What industry expects from engineers ','PD','33','240','0','Mr. Mangesh Mulmule the Sr. Vice President at eTouch Systems was the speaker.\nThe agenda was What industry expects from engineers?\nRegistrations were FREE of cost.\nRotaractors, as well as Non-rotaractors, were allowed to participate.\n','https://www.instagram.com/p/CFRs90yg46E/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-7-September-b1sTL','2020-09-23 00:00:00.000000','2020-09-27 00:00:00.000000','DIVERSIDAD','IS','9','5','0','It was a cultural exchange program jointly hosted with RC Indore Royals, RC Anits, RC Metropolitan. ','https://www.instagram.com/p/CFw6UbTAQ7P/?igshid=12vwl12j991st','1',0,'611556e79e9e454db666fd2832ee1152'),('E-7-September-bDqum','2020-09-24 00:00:00.000000','2020-09-24 00:00:00.000000','SEAS THE DAY','PD','18','2','0','A PR and PD initiative by RaC Pune Royal. On 24th September 2020, World Maritime Day SEAS THE DAY By, Our own Seafarer, Rtr. Pranit Bakshi. Out at sea, every day is something different. Something enjoyable and something strange. But each day is unique in its own sense. This is one such day.','https://www.instagram.com/p/CFjzRFdA3wm/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-7-September-D80dU','2020-09-21 00:00:00.000000','2020-09-24 00:00:00.000000','Plasma Donation Awareness','IS','17','4','0','Plasma Donationation is a Priority Looking at the situation around us so we Planned a  Plasma Donation Awareness Through Virtual Platform. Where many Clubs Joined in sharing the facts About Plasma Donation. ','https://www.instagram.com/p/CFZfOQjAbhA/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-7-September-dRaLM','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Fort Preservation and Tree Plantation','CM','17','6','0','CMD event under which tie up was done with Nelda Foundation to plant trees at Hanuman Tekdi. \nSmall trek followed by tree plantation and fellowship ','https://www.instagram.com/p/CFuE-vAAxgN/?igshid=cdpn9kwmh9jz','1',0,'611556e79e9e454db666fd2832ee1172'),('E-7-September-EZwjG','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','READY TO REVOLUTIONIZE','IS','200','2','0','Initiated by Rotaract club of Rotaract Club of Panvel Central, RID 3131. The session was taken up by His Holiness Shri Braj Mohan Das Ji, who is a Great Life Coach and a Spiritual Influencer himself. He enlightened everyone about the Optimistic and Spiritual Aspect of Life. This session was attended by 200+ Rotaractors, including 29 other Rotaract Clubs from Different Districts. We thank RAC Panvel Central for organizing such a blissful session where the Youth is enlightened with a Spiritual and Positive perspective.','https://www.instagram.com/rcpunemideast/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-7-September-flFKV','2020-09-21 00:00:00.000000','2020-09-24 00:00:00.000000','Plasma donation Awareness','CM','25','6','0','Rotaract club of Pune Zenith in collaboration with Rotaract club of Modern College GK and 10 other clubs from different districts conducted a Plasma Donation Awareness Drive from: 21 Sept to 24 Sept. The Collaborating Clubs were\n-RC DYP ACS RID 3131\n-RAC Karachi Strivers RID 3271\n-RC DYPIMS RID 3131\n-Rotaract club of Mitcon RID 3131\n-RC Vishwaniketan RID 3131\n-Rotaract club of Calcutta Metropolitan RID 3291\n-Rotaract club of Poona Royal 3131\n-Rotaract club of GEM, RID 3131\n-Rotaract Club of Pune Zenith, RID 3131\n-Rotaract Club of Pune Vibrant East, RID 3131\nThe Awareness Drive was carried out by sharing information about Plasma Donation and it\'s importance on various social media platform. ','https://www.instagram.com/p/CFy2bMMgCNE/?igshid=hku56cu4jztc','1',0,'611556e79e9e454db666fd2832ee1143'),('E-7-September-LwAx5','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Memory Wall','CS','14','0','0','On the occasion of world tourism day on 27th September 2020 we came up with an interesting rather nostalgic activity where all the club members came up with their travel stories. The stories were quite interesting including some scary some funny and some really nostalgic, some stories even included travel plans which were ruined due to the pandemic. In all it was a fun filled and interesting event.','https://www.instagram.com/p/CF_mM3aAILk/?igshid=4oyrbyipw139','1',0,'611556e79e9e454db666fd2832ee1169'),('E-7-September-NI4Mb','2020-09-12 00:00:00.000000','2020-09-12 00:00:00.000000','SAFETY FIRST IS SAFETY ALWAYS','CM','9','2','0','On the occasion of World first-aid day a webinar on \"First-aid\" by Dr. Manisha Kumari who is a BHMS, GP & Casualty which was hosted by the Rotaract club of Laxmi College of optometry. \nOur Club, Rotaract club of patalganga along with 17 more clubs like RC of  Mangalore city, RC of Hindustan University, RC of Khopoli, RC of Modern collage Ganeshkhind, RC of Steel city, and many more successfully co-hosted this webinar \nMore than 200 participants from various clubs marked their presence. \nThe session was very essential the speaker signified  numerous percussion to be taken place during an accident because sometimes later becomes never so first is better than last.\nThe webinar was an interactive session and the speaker answered many queries raised by the participants.','-','1',0,'611556e79e9e454db666fd2832ee1160'),('E-7-September-njcpp','2020-09-21 00:00:00.000000','2020-09-27 00:00:00.000000','Here to hear ','CS','00','00','00','Deaf day awareness with RC SIES SE','https://www.instagram.com/p/CFnK_XPAtXv/?igshid=1ipc4er25k6dk','1',0,'611556e79e9e454db666fd2832ee1133'),('E-7-September-oLAKf','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','Ready to revolutionize','PD','10','2','0',' How to revolutionize, think deep and act right jointly with RC Panvel Central 3131','https://www.instagram.com/p/CE3jk4SgBrl/?igshid=171layng5goxi','1',0,'611556e79e9e454db666fd2832ee1171'),('E-7-September-oX7Xi','2020-09-18 00:00:00.000000','2020-09-18 00:00:00.000000','Bollywood Quiz ','CS','45','3','0','On 21st September 2020, we Rotaract Club of DYPIMS held a CSD event  The Bollywood Quiz. This was the event were members of the club were ask to identify the movie name by the famous dialogue used in the movie. More than 50+ members played this quiz and had lot of fun.\nThis interactive fun event was specially conducted to make the bond stronger between the members as we are all being quarantine from so long in our homes. This event helped members to interact with each other and have fun.\n','https://www.instagram.com/p/CFboRxHgM7q/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1129'),('E-7-September-PaURb','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','BIRTHDAY CELRBRATION','CS','34','0','0','We had celebrated the birthday of RTR. Saurav khamankar who is our co-PUBLIC RELATION OFFICER','https://www.instagram.com/p/CFoJ8oAAAdo/?igshid=1lm7r2ylatqdn','1',0,'611556e79e9e454db666fd2832ee1196'),('E-7-September-rl3vO','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Treee Plantation  1..0','CM','16','3','0','Conducted a very sudden Plantation Drive at Gupteshwar Forest Area as on 20th Sept\' 2020.\nSeed plantation of Ashoka tree.','https://www.instagram.com/p/CFWb0sGgk3z/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1127'),('E-7-September-Rp1Ct','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Foster A Pet','PD','30','2','0','RC SAOE conducted CMD+PD initiative along with RC DYPACS and RC Pristine. the speaker for the event was Dr. Hemant Sontakke.','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-7-September-SnUIE','2020-10-09 00:00:00.000000','2020-10-09 00:00:00.000000','Power of Physics','PD','30','2','0','Power of Physics\nPDD/RRRO initiative\n-The session was arranged by Rotary Club of Aundh conducted by speaker Mr Deepak Modak sir who has acquired Bsc in physics and has also completed his graduation in civil engineering.\n-He showcased the lake tapping project which was done in the year 2010.\n-He shared his knowledge and experience in the field of science and gave insights on future scope and significance in the innovation and technological field.\n-He also shared his knowledge and passion about writing, music and astronomy which was the highlight of the event.\n-The event was attended by almost 30 rotaractors and rotarians.\n','https://www.instagram.com/p/CGApQtkAI9h/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-7-September-t4vSE','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000'