-August-4pWNX','2020-08-17 00:00:00.000000','2020-08-17 00:00:00.000000','Mind Games','CS','26','2','0','Rotaract Club of Pune Renaissance challenged our members to a thrilling game of Tambola! MIND-GAME -A Mysterious Tambola, Where we gave out clues for each number instead of just calling it out. The members had a lot of fun searching (and disclosing) the answers and we bonded really well!','https://www.instagram.com/p/CEKB3oUgLja/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-8-August-7kqrx','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Peace&Conflict session','PD','22','3','0','We RC-DYPIMS  alongwith our parent club Rotary Club Of  Pune Sunrise presented a motivational session on the occasion of  Hiroshima and Nagasaki Memorial Day which is organized on 9th August.The name of the Speaker is Mr.TomioIsogai. He is the Former Managing Director of Sharp India Ltd.The session was done in Collabration with 06 other clubs.','https://www.instagram.com/p/CEHmdIeASzA/? igshid=1q9ec00enyjcg','1',0,'611556e79e9e454db666fd2832ee1129'),('E-8-August-86AVh','2020-08-27 00:00:00.000000','2020-08-27 00:00:00.000000','SHAILEE- SESSION ON TRADITIONAL FASHION OF LIVING','PD','22','4','0','The 2nd part of Shailee was conducted as a PD session in which Dr. Rohit Jadhav spoke about Indian Etiquettes and the scientific reasoning behind it.  ','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-8-August-8eUbo','2020-08-15 00:00:00.000000','2020-08-20 00:00:00.000000','Digital Gurumantra','PD','15','5','0','RCP Urja participated in Rotary District 3131 Literacy Committee initiative of 5 days training program on IT skills for Smart Teaching. There was an e-test held for this course. Many members from our club gave examination and everyone received certificate after successfully passing the test.','-','1',0,'611556e79e9e454db666fd2832ee1151'),('E-8-August-9NBiu','2020-08-15 00:00:00.000000','2020-08-15 00:00:00.000000','Ice breaking and fun activities','CS','26','55','0','Interactive ice breaking activities(two truths one lie)  taken online.','-','1',0,'611556e79e9e454db666fd2832ee1181'),('E-8-August-Aoct2','2020-08-12 00:00:00.000000','2020-08-12 00:00:00.000000','Decoding Job via LinkedIn','PD','11','3','0','We Rotaract Club of Pune Zenith in collaboration with@rcmitconalong with speaker Gaurav Ghewade successfully carried out a PD session Decoding Job via LinkedIn. Mr.Gaurav is member of Global Host Community at LinkedIn and Head Organizer of LinkedIn Local Kolhapur Chapter who believes in networking and building meaningful connections.\n','https://www.instagram.com/p/CD22vWyA5qB/?igshid=1be48sdhwfuad','1',0,'611556e79e9e454db666fd2832ee1143'),('E-8-August-BLkel','2020-08-21 00:00:00.000000','2020-08-21 00:00:00.000000','SANITIZER DISTRIBUTION P.D. SESSION','CM','2','1','0','Our frontline workers have constantly been serving the country even during tough times like\nthe situation of Covid-19 pandemic. Their relentless efforts have been helping us take care of\nourselves. Hence, we also must contribute in whatever way possible to assist them and do our\npart for the society. Recognizing the same, Rotaract Club of Panvel Elite donated a 5-litre\nsanitizer can to the head traffic officer of Kalamboli Police station. We believe, we all must\ndo our part and initiate steps of philanthropy for the collective well-being of our society. This\nwas one of Community Service Projects of August and we look forward towards various\nother similar projects soon.','https://www.instagram.com/p/CEejL_NgjGi/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-8-August-Cuedg','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','One Minute Fitness by Rotaract  Supplements','CS','24','3','0','Rtr. Siddhesh Bhojane enlightens viewers by the means of official instagram handle of Rotaract club of Patalganga about the various workout supplements such as proteins, multi-vitamins, etc which are boonful toward