b of Pune Pristine, Rotaract Club of Patalganga, Rotaract Club of Khopoli, Rotaract Club of Ganeshkhind, Rotaract Club of Panvel Central, Rotaract Club of Modern College, Ganeshkhind, Rotaract Club of SAOE, Rotaract Club of DYP ACS, Rotaract Club of Ahmedabad Midtown and Rotaract Club of PSCMRCET conducted a session on CVS (Computer Vision Syndrome) which was delivered by Ms. Shruti Lad, Head of Vision Therapy, Department of Laxmi Eye Institute. As computers have become an integral part of our lives and there have been side effects of continuously sitting in front of it. Ms. Shruti Lad from the session educated us about those side effects, causes of CVS and also gave us insightful tips on how they can be prevented. The session was attended by 110+ rotaractors and was indeed an insightful one','https://www.instagram.com/p/CEMrBVdAd0N/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1212'),('E-8-August-OOjH9','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Friendship day celebration ','CS','22','3','0','Played games and had a fun evening ','-','1',0,'611556e79e9e454db666fd2832ee1157'),('E-8-August-PjPTx','2020-08-25 00:00:00.000000','2020-08-26 00:00:00.000000','Stree Leads','CS','13','24','0','On the occasion of Womens Equality Day, an E-Poster making competition was held in which the club members were asked to make posters focusing on women that have made remarkable progress in their respective sectors, in order to spread awareness about women equality. We also circulated a video depicting the history of Womens Equality Day to raise awareness regarding the same. This was a WR and PR event too,as all the posters were uploaded as stories on our club\'s Instagram account to create awareness regarding this day and its importance.\n','https://www.instagram.com/p/CEcKq8kALRk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1201'),('E-8-August-PoewQ','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000',' Redesign Your Life ',