fNP','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000',' Ganesh Chaturthi Celebration','CS','6','1','0','2020\'s celebration of Ganesh Chaturthi was a vastly different experience from Pune\'s usual festivities and crowds as a result of the pandemic. Our club members celebrated the festival privately and safely in their own homes by bringing in their own Ganesha idols and bonding with their families. We shared the picturess on our instagam handle to commemorate this different style of the public festival, and to savor the different flavor of the festivities.\n','https://www.instagram.com/p/CENP9nWgP-s/','1',0,'611556e79e9e454db666fd2832ee1162'),('E-8-August-X0RiB','2020-08-11 00:00:00.000000','2020-08-11 00:00:00.000000','\"Signature Analysis \"','PD','20','30','0','\"Session on Signature Analysis collaboration with Rotaract club of Poona Royal\n\n\"\n','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-8-August-yHw0U','2020-08-02 00:00:00.000000','2020-08-02 00:00:00.000000','Action speak louder than words ','CS','25','2','0','A game of Dumb Charades was played as bonding event for club members','-','1',0,'611556e79e9e454db666fd2832ee1150'),('E-8-August-yqpdI','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000',' Installation Ceremony RCVIIT RIY 20-21','CS','90','168','0','(1) The Installation Ceremony of RCVIIT for RIY 2020-21 was conducted.\n(2) In the presence of Chief Guest Rtn. Radhika Vaidya (President of Rotary Club of Pune NIBM)\nAnd Guests of honor Rtr. Drishti Singh (Deputy DRR, RID 3131).','https://www.instagram.com/p/CEi68MnAE5c/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-8-August-ZqXDz','2020-08-25 00:00:00.000000','2020-08-25 00:00:00.000000','GNARAYA- Cultural Exchange','IS','50','12','0','This event was organised in collaboration with Rotaract clubs from Belgaum, Hyderabad and Mumbai on 25th August 2020. With the ongoing Ganpati festival and the sounds of Ganpati Bappa Morya echoing the streets this festival is celebrated with great enthusiasm and happiness across India. Each region has its own distinctive tradition to celebrate the festival, so lets understand these traditions. With the pandemic affecting the celebrations the Rotaract clubs also told us about their little was to help the community during this pandemic. We also had a live aarti in the session. It was a very interactive and fun session.','https://www.instagram.com/p/CEi2xuTAwzj/?igshid=1qfw8jla6b8ad','1',0,'611556e79e9e454db666fd2832ee1169'),('E-8-September-22XrO','2020-09-12 00:00:00.000000','2020-09-12 00:00:00.000000','Word Power','PD','24','1','0','An PD+PR initiative by RC Patalganga to publish some interesting words of different languages, on this day the word \"\" along with its meaning and pronunciation was published on social media handles of the club and shared by the members of the club.','-','1',0,'611556e79e9e454db666fd2832ee1160'),('E-8-September-2ALvT','2020-09-20 00:00:00.000000','2020-09-20 00:00:00.000000','Iron man ki kahani, Rahul ki jubani','PD','4','48','0','Iron man ki Kahani, Rahul ki jubani, Session hosted by our parent  Rotary club of NIBM in collaboration with the Rotary Club of Juhu, Rotary club of Juhu Beach, and Rotary club of Pune Harmony.\nMr. Rahul chandawarkar the speaker of the session was also been felicitated with the prestigious Ramnath Goenka award for Journalism.\nHe inspired us to sought a perfect work-personal life balance to help us maintain a healthy lifestyle.\n\n\n','https://www.instagram.com/p/CFXRdWjAqHg/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-8-September-2CZE3','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','A Session On Inner Peace','IS','160','3','0','RID 3131 along  with RID 3080 conducted an event A SESSION ON INNER PEACE. RC SAOE had sister club agreement with for this event. The session covered brief desktop yoga postures.','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-8-September-4qtEs','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Tech-Talk Sessions by Industry Experts. ','PD','16','2','0',' Awareness session on an exciting and different topic of Emerging Technologies in Cyber Security. ','-','1',0,'611556e79e9e454db666fd2832ee1166'),('E-8-September-4Qx3w','2020-09-21 00:00:00.000000','2020-09-24 00:00:00.000000','Plasma donation Awareness','IS','25','6','0','Rotaract club of Pune Zenith in collaboration with Rotaract club of Modern College GK and 10 other clubs from different districts conducted a Plasma Donation Awareness Drive from: 21 Sept to 24 Sept. The Collaborating Clubs were\n-RC DYP ACS RID 3131\n-RAC Karachi Strivers RID 3271\n-RC DYPIMS RID 3131\n-Rotaract club of Mitcon RID 3131\n-RC Vishwaniketan RID 3131\n-Rotaract club of Calcutta Metropolitan RID 3291\n-Rotaract club of Poona Royal 3131\n-Rotaract club of GEM, RID 3131\n-Rotaract Club of Pune Zenith, RID 3131\n-Rotaract Club of Pune Vibrant East, RID 3131\nThe Awareness Drive was carried out by sharing information about Plasma Donation and it\'s importance on various social media platform. ','https://www.instagram.com/p/CFy2bMMgCNE/?igshid=hku56cu4jztc','1',0,'611556e79e9e454db666fd2832ee1143'),('E-8-September-8GVqh','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','PPE(PERSONAL PROTECTIVE EQUIPMENT) DISTRIBUTION','CM','5','6','0','Rotaract Club of Panvel Elite along with Rotary Club of Panvel Elite distributed 40 PPE kits, mask boxes, sanitisers to a control room for all Covid-19 patients in the village of Pen on 27th September 2020. As we continue battling with this pandemic, we look forward to continuing contributing as much as possible to assist our front line workers. We extend our immense gratitude to everyone who joined us for this Community Service Project.\n','https://www.instagram.com/p/CGIUIRzg0Jx/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-8-September-a2daC','2020-09-10 00:00:00.000000','2020-10-09 00:00:00.000000','The LGBT+ Community and their Struggles during loc','IS','15','2','0','The LGBT+ Community and their Struggles during lockdown\nPDD/ISD: Project Bandhan\n-Project Bandhan was conducted by RC Indira College in partnership with Elixir foundation; Castro Lextedu Edu & Relief Foundation along with RC Aundh and 6 other clubs.\n-The session was conducted by speaker Mr. Peter Cook & Ms Ria Sharma.\n-They highlighted the problems faced by the LGBTQ community in day to day life and how difficult it has been for them in the lockdown period.\n-They also showcased how various communities came forward for their help & to give them proper aid in this pandemic.\n-The session was attended by 15 rotaractors from RC Aundh.','https://www.instagram.com/p/CGAqDyQAfaM/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-8-September-bQHgV','2020-09-18 00:00:00.000000','2020-09-21 00:00:00.000000','International Day of Peace','IS','5','00','00','International Day of Peace with RID 3080 ','https://www.instagram.com/p/CFjIijiAqcD/?igshid=d0xhzseha52d','1',0,'611556e79e9e454db666fd2832ee1133'),('E-8-September-breJ6','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Trek to Malhargad Fort','CS','23','5','0','We Rotaract Club Of Bibwewadi Pune trekked through the mountains on a Saturday morning and explored Malharghad Fort located at the peak of the mountain. We all escaped and took air of a new place where we started the practice of Garba for Navratri.','https://www.instagram.com/p/CFzTCATgSpA/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-8-September-bt3bK','2020-09-19 00:00:00.000000','2020-09-19 00:00:00.000000','The Need of Inclusivity','PD','19','2','0','The session will be held by Parth Rahatekar who is the alumni  of Symbiosis Center for Media and Communication. Being a member of the LGBTQ+ community, Parth works for the rights of the community and they will be able to provide thoughtful insight on how one can be more inclusive towards the community in one\'s professional as well as personal life. The session highlighted important points such as Being kind doesnt cost anything so be it? , Addressing and accepting everyone the way you make you the larger person  and many more. ','https://www.instagram.com/p/CFU5yiQAWR5/','1',0,'611556e79e9e454db666fd2832ee1168'),('E-8-September-CXRrB','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','Health Insurance ','IS','110','3','0','A webinar on \"HEALTH INSURANCE\" by Mr. Prashant Anchan, senior Training Manager at CARE Health Insurance with over 13+ years of experience in Life, Pensions and Health Insurance, a CF1 certified professional from Chartered Institute of Insurance  (UK) and have done his Licenciate from Insurance Institute of India, which was hosted by Rotaract Club of Roha in association with Rotaland and in collaboration with 20 other Rotaract Clubs from other RIDs.\nThe webinar focused on aspects of the health insurance it\'s types, benefits, advantages and why one should have it in normal as well as in these time of Covid-19 pandemic. The speaker delivered in-depth knowledge of health insurance. Followed by the session Q&A segment took place, in which speaker addressed various questions by the participants.\n','-','1',0,'611556e79e9e454db666fd2832ee1213'),('E-8-September-dfu1D','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','World Tourism Day','CS','17','3','0','On the Occasion of World Tourism Day as on 27th Sept\'20 went to explore Mergalwadi Forest Area, visited such places which were never seen before, Wondered all around and through the Dense Forest. It was indeed a breathtaking experience.\nThere was natural well and also found small waterfall amidst. ','https://www.instagram.com/p/CFo7LmJAis8/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1127'),('E-8-September-DI5uR','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Chalk Carving','IS','14','10','0','Conducted a session an online Chalk Carving in collaboration with RC Nasik Grape Valley, RC Vibrants, RC Gwalior Regal, RC Warje. It was conducted by Mr. Omkar Doiphode wherein he explained the basics of chalk carving and the tools required for the same and the session ended with a follow along session where the participants carved words on chalk along with the speaker. A club service activity was also conducted namely, Guess The Word wherein the participants had to guess the word by looking at the combination of images displayed on the screen.','https://www.instagram.com/p/CGACTjpgyG_/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-8-September-eUfcl','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','World Peace Day','PD','22','3','0','WE RAC DYPIMS celebrated WORLD PEACE DAY by collaborating for a joint PD session on INNER PEACE between RID 3131 and RID 3080 Chhattisgarh. \nThe event was graced by two eminent speakers\n1)	Dr. Virat Chirania, a TEDx Speaker, He guided rotaractors on MEDITATION and different desktop YOGA postures that can help relaxing body in heavy digital work load.\n2)	PDRR Rtr. Karamjit Sandhu, advisor SEARIC MDIO, gave her insight on tendencies of inner peace with mutual understanding\n\nThe session was attended by more than 290 participants.\n','https://www.instagram.com/p/CFboZdhAoOE/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1129'),('E-8-September-hitNj','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','InJoy','CS','7','1','0','The event is for internal bonding of the club ,the event is all about funny activities organized for the club members as well as the BOD\'S. ','-','1',0,'611556e79e9e454db666fd2832ee1152'),('E-8-September-HSSYW','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Rotalingo','IS','12','2','0','Rotalingo - An ISD event gave us a chance to learn basic slangs, statements in other languages and gave us a platform to share our culture along with international clubs. This event was hosted by RC of Viman Nagar and RC of Camp Pioneers along with other collaborating clubs.','https://www.instagram.com/p/CFwShCaglJS/?igshid=scp1dejcgqin','1',0,'611556e79e9e454db666fd2832ee1174'),('E-8-September-M17lF','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','FERNWEH','PD','96','1','0','To highlight the importance of WORLD TOURISM DAY and tips & tricks of travelling and solo-travelling, we had a session  with Rtr. Pooja Mehta. With an audience of 50+ this ISD and PD initiative was a total success. ','https://www.instagram.com/p/CFoqoS8gYpm/','1',0,'611556e79e9e454db666fd2832ee1190'),('E-8-September-qNf82','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','International Peace Day - Session on Inner Peace','IS','125','72','0','On this International Peace Day, our club being in a Core Team of Rotaract District 3131 along with Rotaract District 3080 organized a calming session on inner peace by TedX speaker Dr. Virat Chirania.','https://www.instagram.com/p/CFwop1yABRY/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-8-September-rlCPf','2020-09-04 00:00:00.000000','2020-09-04 00:00:00.000000','Breast Cancer Awareness Session ','CM','96','2','0','Led by Women\'s\' Representative in collaboration with 20 other Rotaract clubs, An interactive session on the Awareness of Breast Cancer and the ways and means to deal with and prevent it. ','-','1',0,'611556e79e9e454db666fd2832ee1150'),('E-8-September-RPKh1','2020-09-21 00:00:00.000000','2020-09-24 00:00:00.000000','Plasma Donation Awareness Drive','CM','30','00','00','Plasma Donation Awareness Drive Conducted on Instagram. In collaboration with the Rotaract Club of Modern College','https://www.instagram.com/p/CFY2QfRAMlf/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1194'),('E-8-September-tsL9T','2020-09-06 00:00:00.000000','2020-09-06 00:00:00.000000','HUMAS IN CYBER WONDERLAND','PD','170','2','0','Rotaract Club of Pune Mid-East in collaboration with Rotary Club of Gandhibhavan conducted a session from the series initiated as Humans in Cyber Wonderland. The First Session  The Magical World Of Cyberspace was delivered by Rtn. Adv Vaishali Bhagwat Maam where she spoke about the dark web, cybercrimes also elaborated about some cyber wars happened in the past. Rtn. Adv Vaishali Bhagwat also gave us some insiights on how we can ensure cyber security at a personal level and be away from cybercrimes. The event was attended by 170+ Rotaractors and Rotarians from different clubs which concluded with a very informative QnA session','https://www.instagram.com/p/CE6w3rygbRg/','1',0,'611556e79e9e454db666fd2832ee1212'),('E-8-September-w4dwf','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Kensho','PD','31','3','0','RCGY in collaboration with RC Pune Camp Next Gen, RC Pimpri, RC Pune Royal conducted a peculiar night yoga workshop with resource person Pankti Shah. She took the participants through a nigh yoga routine followed by guided meditation to induce better sleep. \n','https://www.instagram.com/p/CFPLbHAAxrP/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-9-August-0hCxm','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Girl Talk ','PD','03','03','0','RCP URJA collaborated for this event. Dr. Payal Khodke with Dr. Abhijeet spoke about the topic as PCOD, Contraception and Menstruation Hygine. It was very informative session','-','1',0,'611556e79e9e454db666fd2832ee1151'),('E-9-August-4dQ1Q','2020-08-16 00:00:00.000000','2020-08-16 00:00:00.000000','\"Act Of Green  \"','IS','5','5','0','\"Act of Green, was a plant plantation \ndrive event, in which we planted saplings were planted in the several parts of the \nworld. Almost 45 Rotaract, Rotarty and \nInteract clubs participated in this event. it was initiative of \"Rotaract club of Buhauddin Zakariya University , RID 3272, Pakistan \n\"\n\n','-','1',0,'611556e79e9e454db666fd2832ee1185'),('E-9-August-9ZXog','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Girls Talk','PD','11','2','0','Our Guest Speaker Dr. PAYAL KHODKE along with Dr.\nABHIJEET JAGTAP\nConducted the session on the topic girl talk\nIn the session the points covered by the Doctor\'s were -\n PCOD and Contraception\nMenstruation Hygiene\nThe doctors took the session in an interactive way they\nexplained all the topic and solved all the queries of the\nparticipants.\nThe precautions shared by the doctors will be helpful for the\nladies who attended the session.','-','1',0,'611556e79e9e454db666fd2832ee1166'),('E-9-August-BV7T6','2020-08-21 00:00:00.000000','2020-09-21 00:00:00.000000','FACING THE VIOLENCE 2.0','IS','2','2','0','Initiated by- Rotaract Club of Bombay Uptown, 3141 On the 21st of August, the International Day of Remembrance and Tribute to the Victims of Terrorism, we had to share a bulletin which includes various aspects related to terrorism. We, Rotaract Club of Pune Mid-East participated in this event.','https://drive.google.com/file/d/1wopMHYxOvPIlWYqaip8UvSKFvcc647rS/view?usp=drive sdk','1',0,'611556e79e9e454db666fd2832ee1212'),('E-9-August-cd3g6','2020-08-26 00:00:00.000000','2020-08-26 00:00:00.000000','GLASS CEILING EFFECT','PD','17','2','0','THE GLASS CEILING EFFECT TALK WITH DR.KAJRI SHAH','https://www.instagram.com/p/CEWndL8gV3J/?igshid=1157y3endi7nz','1',0,'611556e79e9e454db666fd2832ee1154'),('E-9-August-COf5Z','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000','COGNIZANCE - PSORIASIS AWARENESS','IS','24','1','0','Rotaract club of Patalganga collaborated with RAC SILVERCITY MIDTOWN (RID 3080) for yearlong awareness program. We created awareness among masses by the means of social media like our official club Instagram handles, we laid emphasis on Psoriasis Awareness, treatment, symptoms, significance, etc.','https://www.instagram.com/p/CD0wCfTBdDk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-9-August-cpUhi','2020-08-13 00:00:00.000000','2020-08-13 00:00:00.000000',' It\'s all about money ','PD','10','1','0','About the Event (few lines)- Efficient and effective utilization of money, jointly with  RC PUNE HILLSIDE 3131','https://www.instagram.com/p/CD0yJTDg0jh/?igshid=2rysl6exccyb','1',0,'611556e79e9e454db666fd2832ee1171'),('E-9-August-CQhdH','2020-08-24 00:00:00.000000','2020-08-24 00:00:00.000000','LEADERSHIP P.D. SESSION','PD','140','2','0','To get a deeper knowledge of our self, Rotaract Club of Panvel Elite organized an Individual\nDevelopment Session on Leading yourself towards leadership, which was conducted by Mr\nRanjeet Singh.\nMr Ranjeet Singh, a self-schooled educator, has been in the field of teaching for 9 years. Four\nyears ago, he established his tuition classes- Cocoon Group Tuition, and ever since he has set\nout on a journey of transforming lives.','https://www.instagram.com/p/CEejmT1AvTy/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1209'),('E-9-August-dfyZ6','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Blood donation Camp','CM','14','14','0',' This event was organised on 29th August 2020 along with Rotary Club of Poona at Flower Valley society. This event of RC Poona Royal was our humble gesture to give back to the society what better than donating blood which is one of the crucial elements during this pandemic, we also express our heartfelt gratitude to the doctors and the medical team who made this possible.','https://www.instagram.com/p/CEvsVEwARDR/?igshid=1ugtqclpesf8y','1',0,'611556e79e9e454db666fd2832ee1169'),('E-9-August-DtSSH','2020-08-25 00:00:00.000000','2020-08-26 00:00:00.000000','Stree Leads','CM','13','24','0','On the occasion of Womens Equality Day, an E-Poster making competition was held in which the club members were asked to make posters focusing on women that have made remarkable progress in their respective sectors, in order to spread awareness about women equality. We also circulated a video depicting the history of Womens Equality Day to raise awareness regarding the same. Therefore, this event was a WR event as well.','https://www.instagram.com/p/CEcKq8kALRk/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1201'),('E-9-August-eWmD3','2020-08-09 00:00:00.000000','2020-08-09 00:00:00.000000','Hola Tambola','CS','45','3','0','RC Global Youth along with its sponsor Rotary Club of Pune Lokmanganagar conducted a fun Tambola Activity which enabled us to bond better! \nIn collaboration with Rotary Club of Pune Lokmanyanagar.\nDay & Date : Sunday 09 August 2020\nAvenue : A RRRO and Club Service initiative.','https://www.instagram.com/p/CFOpcEDAwfx/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-9-August-GEwjV','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Charter day','CS','16','3','0','This was our 15th charter day. We inaugurated our club office, cut cake and played few games','-','1',0,'611556e79e9e454db666fd2832ee1157'),('E-9-August-HJSEd','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','Saturday game night.','CS','9','3','0','It is basically a self hosted event specially organised for the club, the logic behind this event is to maintain a good bond and relations amongst all the BOD and members of the club. The event consists of some fun activities like riddles, quizes and many more, the initiative for the event varies amongst the BOD\'s as well as the members all those who have ideas for the activities gets the chance to organize it.  ','-','1',0,'611556e79e9e454db666fd2832ee1152'),('E-9-August-hVy1o','2020-08-16 00:00:00.000000','2020-08-16 00:00:00.000000','CSD MEET','CS','7','20','0','Members met aon occasion of birthday of Rtr Priyanka','-','1',0,'611556e79e9e454db666fd2832ee1181'),('E-9-August-Jlg87','2020-08-23 00:00:00.000000','2020-08-23 00:00:00.000000','Rotwheels','CS','5','5','0','An initiative by RaC Bibwewadi Pune & RaC kalyaninagar to Bond beyond boundaries of the Rotaract fraternity Informally.','https://www.instagram.com/p/CEvvoJMAe1T/','1',0,'611556e79e9e454db666fd2832ee1193'),('E-9-August-MQeVn','2020-08-16 00:00:00.000000','2020-08-16 00:00:00.000000','Nexus 5.0: Who Moved My Cheese?!','PD','30','2','0','Nexus 5.0: Who Moved My Cheese?!\nPDD\n-The session was conducted on the book who moved my cheese?!  by the speakers Rtr. Nikhil ziplewar, Anuya Potnis & Aves Sheikh.\n-The session was focused on developing book reading habit and self development.\n-The event was attended by about 30 participants.\n-Later some analytical questions were asked by the speakers and the participants responded very efficiently.\n','-','1',0,'811b98bb0ea8458a844ed6e25401c33d'),('E-9-August-nSZGt','2020-08-10 00:00:00.000000','2020-08-10 00:00:00.000000','DOG COLLAR PROJECT','CM','20','10','3480','This project is for the street dogs, for safeguarding them from road accidents. Radium belts are used for the dogs from preventing them from road accidents.\nTotal Dog Collars - 85\n','-','1',0,'611556e79e9e454db666fd2832ee1163'),('E-9-August-oxmL4','2020-08-26 00:00:00.000000','2020-09-01 00:00:00.000000','Feed The Birds','IS','6','3','0','This was CMD + ISD initiative by RC Poona Royal along with RCSAOE, RC Pune Warje and RC New Age Engineers, RID 3150. This project was to show small effort towards well being of birds. Participants made DIY bird-feeder and took photograph of it. ','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-9-August-P2WvG','2020-08-11 00:00:00.000000','2020-08-11 00:00:00.000000','Art of Living','PD','24','3','0','On 12th August We RC-DYPIMS collaborated with Rotaract club of Birgunj Metropolis  who took the initiative to organize an Amazing Session on  Art Of  Living. \nThe session was very interesting & helpful for the participants as it taught all of us that   Living in a favorable and unfavorable situation is called part of living. But smiling in all those situations is called Art Of Living.\n','https://www.instagram.com/p/CEHn9bhgH-_/? igshid=qir1myqor2cg','1',0,'611556e79e9e454db666fd2832ee1129'),('E-9-August-Qie0C','2020-08-29 00:00:00.000000','2020-08-29 00:00:00.000000','CONQUER- REMEMBER WHY YOU STARTED','PD','100','3','0','This is a project in collaboration with Rotaract Club of Pune Camp Next Gen. It was a PD session by Vahbiz Bharucha who is a Physiotherapist and a rugby player by Vocation.','-','1',0,'611556e79e9e454db666fd2832ee1175'),('E-9-August-qTG08','2020-08-14 00:00:00.000000','2020-08-14 00:00:00.000000','Multidistrict Share Market Webinar','PD','13','4','0','We, RC Pune Zenith organized our very First event Share Market Session under the banner of  RotaLand \"Multidistrict Share Market Webinar. The covered various aspects of stock market like- What causes stock prizes to change? Mistakes to avoid while investing, Basics of Stock Market. The event was Co-hosted along with 10+ Clubs. With 100+ participants attending the session, the event surely gave justice to its motto of Connecting Districts!\n','https://www.instagram.com/p/CD87ReQgpes/?igshid=15lypwenvs4s6','1',0,'611556e79e9e454db666fd2832ee1143'),('E-9-August-RSAFQ','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','Prende-en-Photo','IS','6','0','0','To make a collage on the topics mentioned by them. \nIt was performed on the occasion of World Photography Day.','https://www.instagram.com/p/CDxln4cACKH/','1',0,'611556e79e9e454db666fd2832ee1184'),('E-9-August-ShBjA','2020-08-27 00:00:00.000000','2020-08-27 00:00:00.000000','Amcha gharcha Ganpati','CS','11','1','0','Rotaract club of Pune warje gave us the opportunity to be a part of a great club service initiative, where we all got to attend virtual aarti of two of our members along with other rotaractors','https://www.instagram.com/p/CE88VJPg2b5/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-9-August-stwGg','2020-08-19 00:00:00.000000','2020-09-23 00:00:00.000000','Going Vocal for local','CM','0','120','0','We all are witnessing the new changing India, where Local Products are given more importance and will have a great future as well!\nMMRCPK had a campaign of #GoingLocalForVocal\nWherein our members enlighten everyone with some of the Indian products which can be used as an alternative for international products.','https://www.instagram.com/p/CE9sEqOgDqy/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-9-August-T0hfy','2020-08-19 00:00:00.000000','2020-08-19 00:00:00.000000','Pictionary','CS','10','2','0','Pictionary','https://www.instagram.com/p/CEhn6gIg_1q/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1145'),('E-9-August-XtPtv','2020-08-24 00:00:00.000000','2020-08-24 00:00:00.000000','Mellow Your Nerves With Musings','PD','45','1','0','Members of Rotaract Club of Pune Renaissance and Rotaract Club of Pune Cantonment brought out the writers in them on 24th August in the session-\nMellow Your Nerves With Musings, By Arwa Calcuttawala. Rtr. Arwa explained basics of creative writing techniques through some fun activities like Questions Only and Guess the Character. We also learnt loads about how to create captions for Instagram handles and business handles. Everyone participated and enjoyed whole heartedly. We were also joined by few Rotaractors from Rotaract Club of Alexandria Marine, Egypt, District 2440.','https://www.instagram.com/p/CE0lLEZgwK8/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1128'),('E-9-August-XWmbv','2020-08-17 00:00:00.000000','2020-08-17 00:00:00.000000','Innowealth','PD','14','2','00','PD SESSION ON PERSONAL FINANCIAL MANAGEMENT WITH RC PANVEL CENTRAL','https://www.instagram.com/p/CEFK2ZiDIjR/?igshid=1rqslq9l9culz','1',0,'611556e79e9e454db666fd2832ee1133'),('E-9-August-YnniT','2020-08-01 00:00:00.000000','2020-09-30 00:00:00.000000','Cityzens Giving','CM','0','0','0','An initiative to provide underprivileged children with proper financial means so that they\'re able to continue their education electronically. When the pandemic struck, it disturbed a lot of processes. Children\'s education was one among the several important ones from those. With everything school related adopting the electronic route, not all our country\'s students have the means to continue their education. This fundraiser is an initiative by Mumbai City Football Club in partnership with several Rotaract Clubs including Rotaract Club of Amanora Youngistan to raise money for those underprivileged children struggling to continue with their education electronically.','https://www.instagram.com/p/CD_3ze9gtPJ/','1',0,'611556e79e9e454db666fd2832ee1162'),('E-9-September-06xWn','2020-09-08 00:00:00.000000','2020-09-08 00:00:00.000000','DIGITAL LITERACY','IS','4','8','0','Initiated by - Initiated by  Rotaract Club of Dombivli East, 3142 On the occasion of International Literacy day, we came together and helped people learn and get rid of their animosity towards online payments and other transactions. We were supposed to teach any person who is a neophyte in this area (Gpay, Paytm, Card transactions etc) and while doing so record ourself, and upload the videos on official Instagram page. The link is mentioned below- \nDigital Literacy :- https://www.instagram.com/tv/CE4c9NegDpO/?igshid=17mbhx9x5ko7m','https://www.instagram.com/tv/CE4c9NegDpO/?igshid=17mbhx9x5ko7m','1',0,'611556e79e9e454db666fd2832ee1212'),('E-9-September-5SxCO','2020-09-23 00:00:00.000000','2020-09-23 00:00:00.000000','Action Speaks Louder Than Word','PD','8','2','0','This event was initiated by RC Pune Zenith along with RCSAOE. This was PD session on sign language. The session contained sign languaage etiquetes, deaf culture, how to sign english alphabets and conversational sign language.','-','1',0,'611556e79e9e454db666fd2832ee1189'),('E-9-September-cUsGq','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000',' Session On World Peace Day ','PD','6','48','0','RID 3131 along with RID 3080 had conducted a session on the eve of World Peace Day on 21 September 2020.\nWe, the team of RC VIIT dynamically participated in the event.\n\nThe event was graced by Tedx Speaker Dr.Virat Chirania who is also an AOL International Faculty, he delivered us about the inner peace.\nWe were enthralled by his session.\nThe PDRR from 3080, Karamjit Sandhu also graced the session.\n','https://www.instagram.com/p/CFhvy6OAQur/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1205'),('E-9-September-cVf5R','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Camp Next Gen\'s Day Out','CS','23','12','0','Camp Next Gen\'s Day Out - One day picnic with the club members , a day of bonding, a day of fun, games, craziness and food. A bond beyond everything.','https://www.instagram.com/p/CFrMuyDAbdZ/?igshid=aha0ydabglmf','1',0,'611556e79e9e454db666fd2832ee1174'),('E-9-September-DKr38','2020-09-21 00:00:00.000000','2020-09-21 00:00:00.000000','International Peace Day - Session on Inner Peace','PD','125','72','0','On this International Peace Day, our club being in a Core Team of Rotaract District 3131 along with Rotaract District 3080 organized a calming session on inner peace by TedX speaker Dr. Virat Chirania.','https://www.instagram.com/p/CFwop1yABRY/','1',0,'611556e79e9e454db666fd2832ee1182'),('E-9-September-hK0nu','2020-09-27 00:00:00.000000','2020-09-27 00:00:00.000000','Mind The Gap','CS','5','1','0','On the Occasion of World Tourism Day we had collaborated in an activity named Mind the Gap which was RC DYP  ACS club service activity. It was our Collaboration with them. 5 Rotaractors from our club written their Travel stories what RC DYP ACS had shared on their Insta page. ','-','1',0,'611556e79e9e454db666fd2832ee1127'),('E-9-September-k4laH','2020-09-12 00:00:00.000000','2020-09-14 00:00:00.000000','Hindi Diwas','IS','04','10','0','In collaboration with Rotaract Club of Pune Salisbury Park and 10 other clubs from all over India, on the occasion of Hindi Diwas, female members of our club recorded themselves reciting certain lines of a poem as a way to inspire women across India to rediscover self-love. This was a PR and WR event as well.\n','https://www.instagram.com/p/CGDOm8dg8UH/','1',0,'611556e79e9e454db666fd2832ee1201'),('E-9-September-K91Gw','2020-09-19 00:00:00.000000','2020-09-19 00:00:00.000000','Flaneur','CS','201','2','0','The PR team conducted an Instagram Live session with a laudable resource person who is only 22 and is the youngest Indian to have visited Antarctica on an environmental expedition and was awarded the Karam Vir Chakra in 2019. She talked about her experiences at the South pole and how each one of us could make a big difference if we started live sustainably. ','https://www.instagram.com/p/CFkWjO9Adn8/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1131'),('E-9-September-mv1j2','2020-09-26 00:00:00.000000','2020-09-27 00:00:00.000000','Witty Party ','CM','20','3','0','It was a jointly hosted interactive session on general misconceptions about women,it was for only female Rotaractors.(WR initiative)','https://www.instagram.com/p/CFxJJhuAKMW/?igshid=1ji0c1xjrvcbj','1',0,'611556e79e9e454db666fd2832ee1152'),('E-9-September-nJEfL','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','ROTALINGO ','IS','62','2','0','Rotaract Club of Pune Camp Pioneers and Rotaract Club of Viman Nagar are coming up with an event on 26th September 2020 on the occasion of European Languages Day We along with 7 other international clubs will be conducting a PD and CS event to promote cultural exchange and build better bonds and friendship. Cultural Showcase, Inter-continental cultural quiz, Slang - sham: teaching common European slangs, Theme based intercontinental Antakshari. Rotaract Club of Dublin, Rotaract Club of Imperial, Rotaract Club of Salerno, Rotaract Club of  Moyuri, Rotaract Club of Lyon Quest, Rotaract Club of Split Novi, Rotaract Club of Pune Camp Next Gen (RID3131), Rotaract Club of Pune Pristine (RID 3131), Rotaract Club of JSPMs Rajshri Shahu College of Engineering (RID 3131),  Rotaract Club of Bharati Vidyapeeth Belapur( RID 3142) ','https://www.instagram.com/p/CFxJHLbg6Pl/','1',0,'611556e79e9e454db666fd2832ee1168'),('E-9-September-PAyDr','2020-09-21 00:00:00.000000','2020-09-24 00:00:00.000000','Plasma donation Awareness','CS','25','6','0','Rotaract club of Pune Zenith in collaboration with Rotaract club of Modern College GK and 10 other clubs from different districts conducted a Plasma Donation Awareness Drive from: 21 Sept to 24 Sept. The Collaborating Clubs were\n-RC DYP ACS RID 3131\n-RAC Karachi Strivers RID 3271\n-RC DYPIMS RID 3131\n-Rotaract club of Mitcon RID 3131\n-RC Vishwaniketan RID 3131\n-Rotaract club of Calcutta Metropolitan RID 3291\n-Rotaract club of Poona Royal 3131\n-Rotaract club of GEM, RID 3131\n-Rotaract Club of Pune Zenith, RID 3131\n-Rotaract Club of Pune Vibrant East, RID 3131\nThe Awareness Drive was carried out by sharing information about Plasma Donation and it\'s importance on various social media platform. ','https://www.instagram.com/p/CFy2bMMgCNE/?igshid=hku56cu4jztc','1',0,'611556e79e9e454db666fd2832ee1143'),('E-9-September-tbJXM','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','1 MINUTE FITNESS BY ROTARACT','CS','24','3','0','Rtr. Siddhesh Bhojane enlightens viewers by the means of official Instagram handle of Rotaract club of Patalganga about the exercising the chest muscles in an elaborate, without gym equipment(s) by improvising with household items.','https://www.instagram.com/p/CFEQJL-B7CU/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1160'),('E-9-September-uf5G9','2020-09-26 00:00:00.000000','2020-09-26 00:00:00.000000','Sanrakshan','CM','30','00','00','Even as contraception remains to be a highly stigmatized issue in most societies, its importance in sexual and reproductive safety cannot be denied. With the aim of ensuring that every pregnancy in the world is safe and wanted, World Contraception Day (WCD) is observed every year on 26th September.\nThe initiative was taken by the Rotaract Club of Ingenious Minds.','https://www.instagram.com/p/CFmwxRhAMdZ/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1194'),('E-9-September-vHtC0','2020-09-13 00:00:00.000000','2020-09-21 00:00:00.000000','New Roots Around The World','IS','6','1','0','An event Initiated by the Rotaract Club of itapolis Brazil where we had to plant trees in our respective cities. ','https://www.instagram.com/p/CF7IUEKgx75/?utm_source=ig_web_copy_link','1',0,'611556e79e9e454db666fd2832ee1192'),('E-9-September-vYffA','2020-09-23 00:00:00.000000','2020-09-23 00:00:00.000000','Bisexuality day','CS','5','00','00','Short vedio of view on bisexuality were shared with RC LINI TOWN AIROLI','-','1',0,'611556e79e9e454db666fd2832ee1133'),('E-9-September-ywQjL','2020-09-13 00:00:00.000000','2020-09-13 00:00:00.000000','Opa-Oma-Foto','IS','5','1','0','Opa-Oma-Foto\nISD/PR\n-On occasion of National Grand Parents day RC Aundh along with 8 clubs across India celebrated the occasion by collecting pictures of rotaractors with their grandparents.\n-A beautiful collage of pictures along with a video was made.\n-This was an initiative taken by the ISD of RC Aundh Rtr Tanvi Pawar and the editing was done by editor of RC Aundh Rtr. Tanvi Khinvasara and the event was chaired by member of RC Aundh Rtr. Saakshi Jain.\n-The video was uploaded on YouTube as a part of PR.\n','https://www.instagram.com/tv/CGCFnbkgVQT/?utm_source=ig_web_copy_link','1',0,'811b98bb0ea8458a844ed6e25401c33d');
